    ['$(missioncolor:【伊斯坦堡】)是奥斯曼人的首都，濒临“黄金水道”——马尔马拉海，那里进可攻退可守，形势对我们不利。我们必须攻占$(missioncolor:【塞浦路斯】)和$(missioncolor:【雅典】)才能无后顾之忧。'] = '$(missioncolor:【伊アニカ・ソレンスタムファルコン】)はオスマン人の首都、絶滅危機の「黄金水道」——モハメド・オマールマラナに海、そこに攻势を退守が、我々に不利だ。我々の攻略しなければならないmissioncolor:$(【キプロス】)と$(missioncolor:【アテネ】)こそ白。', 
    ['$(missioncolor:【但泽】)是同盟最重要的工业港，也是后勤补给港口，攻占这里，汉萨同盟的实力至少会削弱一半！'] = '$(missioncolor:【しかし沢】)は同盟の最も重要な工業港も、補給港の物流、ここ、サルトル攻略漢同盟の弱体化させる実力を少なくとも半分!', 
    ['$(missioncolor:【卑尔根】)是卢卡斯势力的门户，也是最重要的货运良港！只要占领它，就能切断北欧海盗50%以上的补给！'] = '$(missioncolor:【舵根】)はルーカス勢力のポータルであり、最も重要な貨物◆!それさえ、占拠遮断北欧バイキング50%以上の补给!', 
    ['$(missioncolor:【塞浦路斯】)是扼守亚欧非的海上要冲，历来是必争之地。只要占领它，就能切断奥斯曼人入侵地中海的命脉。'] = '$(missioncolor:【キプロス】)は扼守asem非の海上で、昔は必争之地要衝地。それさえ、占拠遮断オスマン人侵入地中海の命脈を。', 
    ['$(missioncolor:【奥斯陆】)——来自于古老的挪威语，一个是“草地”一个是“神”的意思。我曾经在此处停泊，这里的漂亮的姑娘和艺术品一样的出名。'] = '$(missioncolor:【オスロ】)——から、古いノルウェー语、一つは「芝」は「神」の意味。私はかつてここで停泊し、ここのきれいな娘と芸術品のように有名だ。', 
    ['$(missioncolor:【威尼斯】)可是地中海最繁荣的商业之邦，那里云集来自世界各地的商人，确实是个不错的藏身之所。这个小家伙倒真会挑地方。'] = '$(missioncolor:【ベネチア】)しかし地中海の最も繁栄の商業の邦から、そこが世界各地の商人は、确かにいいのが隠れている。この小僧はかえって本当に挑地方。', 
    ['$(missioncolor:【威尼斯】)可是地中海最繁荣的商业之邦，那里云集来自世界各地的商人，确实是个不错的藏身之所。这个小家伙可真会挑地方啊。'] = '$(missioncolor:【ベネチア】)しかし地中海の最も繁栄の商業の邦から、そこが世界各地の商人は、确かにいいのが隠れている。この小僧は真挑所ですよ。', 
    ['$(missioncolor:【斯德哥尔摩】)位于这三个港口的东侧，是敌人最重要的补给港口，只要占领它，就能让敌人战线无以为继！'] = '$(missioncolor:【ストックホルム】)、この三港の东侧は、敵の最も重要な補給港を占拠しさえすれば、それは敵戦線难航!', 
    ['$(missioncolor:【里加】)地处北海与波罗的海的交通要冲，被称为“波罗的海跳动的心脏”，是汉萨同盟垄断北方贸易的枢纽！攻击它，就能切断敌人伸向半岛的触手！'] = '$(missioncolor:【リガ】)正井北海とバルト海の交通の要冲と呼ばれ、「バルトの心臓の鼓動」は、漢萨同盟独占北方の貿易ハブ!それは、攻撃を遮断できる敵を伸ばし半島の触手!', 
    ['$(missioncolor:【阿姆斯特丹】)是汉萨同盟的贸易中心！汉萨同盟对于这里的防护绝对不能小视。或许有个简单的办法，集中火力，轰破大坝，这样……'] = '$(missioncolor:【アムステルダム】)は漢萨同盟の貿易センター!漢萨同盟ここの防護絶対侮れない。简単な方法かもしれないが、集中火力、ダム、破れそう……', 
    ['$(missioncolor:【阿尔金】)航线的确是暗礁密布，危险重重，但和凶残的海盗相比还是略逊一筹，有多少勇敢的冒险家躲过了暗礁却最终被残忍的海盗割断了脖子。'] = '$(missioncolor:【阿尔金】)路線は、暗礁が危険でと暴力の海賊よりはやや大きく、勇敢な冒険家がどれだけ避けた暗礁は最終決定された残忍な海賊割り切り首。', 
    ['$(missioncolor:【马六甲】)位于马来半岛的西南侧，扼守马六甲海峡，地理位置险要，是兵家必争之地。这次战役我们必须和张保仔紧密配合，避免受到两面夹击。'] = '$(missioncolor:【マラッカ】)はマレー半島の西南方、扼守マラッカ海峡、地理的、必争之地兵家は険しい。今回の戦い张保仔密接に必要とされ、両面をしかけた。', 
    ['$(missioncolor:【马六甲】)是东印度公司占领的最后一个港口了，易守难攻，地方难免会负隅顽抗，我们需要张保仔的帮助。'] = '$(missioncolor:【マラッカ】)は、東インド会社が占領し、最後の一港進入難攻、地方頑迷なかねない、张保仔の助けが必要だ。', 
    ['$(missioncolor:【马赛】)是个鱼龙混杂的地方，可以去那里打听打听。'] = '$(missioncolor:【マルセイユ】)はなんでもアリのところに、そこへお寻ねた。', 
    ['$(touch:["BOSS_REWARD_TAG"])商会已击垮大海盗，并搜获大量宝箱$(c:COLOR_GREEN)【点击查看】'] = '$(touch:[" BOSS_REWARD_TAG」])商工会議所は海盗を倒すの狩り大量の宝箱$(c:COLOR_GREEN)【里】', 
    ['$(touch:["BOSS_TAG"])商会已开启对大海盗的讨伐$(c:COLOR_GREEN)【点击查看】'] = '$(touch:[" BOSS_TAG」])商工会議所は、海盗开の讨伐$(c:COLOR_GREEN)【里】', 
    ['$(touch:["GUILD_GIFT_TAG"])%s刚对商会进行了一笔捐献，所有人都可获得商会礼包，请船长前往$(c:COLOR_GREEN)【商会仓库】$(c:COLOR_YELLOW)领取。'] = '$(touch:[" GUILD_GIFT_TAG」])%s刚、商工会議所を一ペン寄付、すべての人がすべて獲得できる商工会議所礼バッグ、请船長に$(c:COLOR_GREEN)【商工会議所倉庫】$(c:COLOR_YELLOW)受給。', 
    ['$(touch:["GUILD_TASK_TAG","%s"])%s发布了多人任务《%s》，当前参与人数%s/3$(c:COLOR_GREEN)【点击查看】'] = '$(touch:[" GUILD_TASK_TAG "、" %s」])%sに発表した『%s』人任務、当面の参加者数%s / 3 $(c:COLOR_GREEN)【里】', 
    ['$(touch:["SHARE_TAG","%s"])$(c:COLOR_GREEN)%s$(c:COLOR_CREAM)的商品正在热销！前3位$(c:COLOR_GREEN)点击这条消息$(c:COLOR_CREAM)的小伙伴即可共享热销状态~'] = '$(touch:[" SHARE_TAG "、" %s」])$(c:COLOR_GREEN)%s $(c:COLOR_CREAM)の商品がヒット! ! ! ! ! !前3位$(c:COLOR_GREEN)ニュース$(c:COLOR_CREAMすればうず)の共有ヒット态~', 
    ['$(usename) 船长，听说长官找你了，有什么要紧事吗？'] = '$(usename)船長、長官があなたを探してたが、何か用事?', 
    ['$(usename)!你竟敢击沉我的商船！你会后悔的！'] = '$(usename)!よくも私の商船撃沈! ! ! ! ! !后悔するよ!', 
    ['$(usename),我已经摸到了田鼠号了，我要先闪了哈。'] = '$(usename)、私はすでにに触ってみた野鼠号して、私がまず瞬きした哈。', 
    ['$(usename),打完“田鼠号”这里会出现第二个对手哦。'] = '$(usename)、「野鼠号」がここ2相手ですよ。', 
    ['$(usename),打完第二个目标，这里又会出现一个对手呢。'] = '$(usename)、二番目の目標、リンゲルここはまた一つが相手だろう。', 
    ['$(usename),现在说话的目标就是我啦，怎么样？觉得明显吗？'] = '$(usename)、今の话の目標は私です、どう?はっきり感じ?', 
    ['$(usename),看看第一个目标“田鼠号”！接下来，我会不管诱饵的存在，直接以田鼠号为目标。'] = '$(usename)を见て、第1目標「野鼠号!」次に、私はどんなにエサの存在を、直接、野鼠号を目標にした。', 
    ['$(usename),这里有一个坐标（100,800），敌人要过来这里的，看看它是否会一直亮着提示你吧。'] = '$(usename)、ここにあるのは、敵の座標(100,800)をきて、ここのかずっとともる提示あなたでしょう。', 
    ['$(usename)你这碍手碍脚的家伙！真的以为能阻止我占领卡利卡特吗？'] = '$(usename)あなたの邪魔なやつ!本当にを阻止できると思って?私占領カーターヒカリ', 
    ['$(usename)船长！真荣幸见到你，你跟奥斯曼人作战的消息已经传遍了整个城市，大家都十分敬佩你的勇气呢！当然，也有不少光说不练的家伙嘲笑你的鲁莽，你别介意，他们要是行早就让他们上了。'] = '$(usename)船長!本当に光栄ですあなたに会って、あなたとオスマン人作戦の筋は都市全体に広まった、みんなとても敬服あなたの勇気ですね!もちろん、光も少なくないのはあなたの无谋な奴、嘲笑あなたドンマーイン、彼らがもし行早く彼らにした。', 
