    ['1562年，浙江倭寇平息后，福建倭寇日甚，因兵将怯懦，戚继光受命领兵6000入闵，视福建倭寇情形决定先捣毁横屿倭寇。横屿之战中，戚继光智令将士以稻草填壕，遂打破横屿。'] = '1562年、浙江、福建省倭が終わった後、倭日が兵は、戚继光弱いより兵6000入ミン、福建倭様子をまず横り>飯嶋しみ倭。横り>飯嶋戦で、将兵戚继光智令を埋め、藁を破る堀り>飯嶋遂横。', 
    ['1568年，弗朗西斯•德雷克与表兄霍金斯代理5艘贩奴船前往墨西哥受到风暴袭击，船只受到严重损坏。'] = '1568年、フランシス・ドレークと従兄弟ホーキング斯代行5隻贩奴船さに袭われ、メキシコに向かう嵐ひどく毀損船。', 
    ['1577年，德雷克再次从英国出发，乘着旗舰“金鹿”号直奔美洲沿岸，一路打劫西班牙商船，后在追击中逃往南方，在风暴中来到西班牙人也未曾到过的地方，这片汪洋大海，直到今天还被我们称为“德雷克海峡”。'] = '1577年、英国から出発し、再びドレーク金鹿」号に乗って売場「まっすぐ米州沿岸、一路恐喝後、スペインの商船の追撃で韓国側は、逃避岚でスペイン人も来なかった、これまでのところ、片洋上今日まで私の「ドレーク海峡」と呼ばれる。', 
    ['1588年7月，英西两国正式开战，英军在弗朗西斯•德雷克建议下采取古老的火船战术，向敌方舰队发起突击。战后英国成为海上霸主，德雷克被封英格兰勋爵……'] = '1588年7月、英西両国の公式開戦、英国軍はフランシス・ドレーク提案で最古の火を船に、敵の艦隊戦術突撃を。戦後、英国に海上覇者ドレーク封じイングランド勋爵……', 
    ['1591年，经宰相柳成龙举荐，47岁的李舜臣出任全罗左道水师节度使。当时，日本正积极着手进行侵朝战争准备，李舜臣临危受命，到职后加强海军建设，并建造铁甲“龟船”，为反侵略战争做好准备。'] = '3.20年间、経宰相柳成龍提請、47歳の李舜臣(イ・スンシン)発足全羅左道水軍伝道師。当時、日本が積極的に侵略戦争の準備に着手して、朝到职後、李舜臣(イ・スンシン)より危きを強化し、海軍建設建造鉄甲「亀甲船」は、反侵略戦争の準備。', 
    ['1592年4月，日军水陆并进，占领大半个朝鲜半岛。在陆地屡战屡败的情况下，李舜臣部连战连捷。日方水陆并进计划受阻，利用朝鲜党争使计离间，李舜臣被革职下狱。重新被起用后，李舜臣重整舰队鏖战日军，一心坚持抗战。'] = '1592年4月、日本軍占領両用、あごひげ大半の朝鮮半島。陸地で連戦連敗の状況で、李舜臣(イ・スンシン)部连战连捷。計画に支障が生じ、日本両用あごひげを利用して北朝鮮を引き離し、党争计下狱李舜臣解職された。再起用された後、李舜臣(イ・スンシン)振り撒き艦隊の覇権をめぐって激しい競争を繰り広げ、一心坚持抗戦日本。', 
    ['1592年，日本关白丰臣秀吉将日本国内群雄战乱平息，随即把目光投向了一水相隔的朝鲜国，希望将羸弱的朝鲜国纳入自己的权利版图。因为朝鲜国方面的求助，也因为唇齿相依的关系，中国明万历皇帝决定加入战争，援助朝鲜抵抗如日中天的日本。连番激烈的战事在朝鲜国境上进行，而作为对日本方面的物资补给及战事局势有着决定性影响的海上航区争夺战，亦在朝鲜沿海不断打响。'] = '1592年、日本は日本国内関白秀吉が、すぐもみ消し群雄戦乱に視線を向けた北朝鮮の国ぶり、松浦を希望した北朝鮮両国傍点を自分の権力構図だ。北朝鮮の国側の助けも、唇歯の関係、古今中国明万历皇帝決定加入の戦争、北朝鮮支援抵抗中天の日本。戦場に炸裂の激しい、北朝鮮の国境で、日本側の物资の补给やの戦場に決定的な影響情勢の海上で、北朝鮮航区争奪戦、亦沿海が始まった。', 
    ['15级海盗'] = '15級海賊', 
    ['1635年亨利·摩根出生在威尔士的一个大户人家的庄园，后作为契约工人前往加勒比海，很快在牙买加岛应征成为英军士兵。'] = '1635年生まれヘンリー・モーガン、ウェールズの大戸の家の荘园として、后契约労働者はカリブ海、すぐジャマイカ島に応募して英国軍兵士。', 
    ['1645年，郑芝龙、郑鸿逵兄弟在福州奉明唐王朱聿键为帝，年号隆武，郑芝龙被册封为南安候，负责南明所有军事事务，一时间权顷朝野，短短的几个月时光是郑芝龙政治生涯的顶峰。'] = '1645年、郑芝龙、郑鸿逵兄弟は、福州奉明唐王朱聿键を帝、年号隆武、郑芝龙封され南安候は、すべての軍事実務担当)、権あの顷の与野党、わずか数ヶ月时间は郑芝龙政治生活の頂上。', 
    ['1689年，英国再次和法国开战，威廉·基德应征入伍，不仅在战争期间成功维持美国与英国之间的贸易航道，并屡建战功，成为战斗英雄，受英国女皇嘉奖。威廉·基德志得意满、意气风发，于不久后成婚。'] = '1689年、英国とフランスが再び开戦、ウィリアム·キッド軍入隊対象は、戦争期間維持に成功し米国と英国の間の貿易の水路を百に、戦闘の英雄、英国女王の受章した。ウィリアム·キッド志得意満、意気は、やがて御成婚。', 
    ['1698年，威廉·基德打着法国的旗号劫掠了一艘船籍为亚美尼亚的商船——奎达商人号，消息传回伦敦，威廉·基德被认定为海盗。从成功商人到战争英雄，且最后沦为恶贯满盈的海盗，欲望与贪婪使威廉·基德变得多面。'] = '1698年、ウィリアム·キッドを掲げたフランスのある船籍1隻はアルメニアの商船——奎は商人号、ニュース送信ロンドン、ウィリアム·キッド海賊と認定された。商人は成功し、最後まで戦争英雄に転落恶贯满盈の海賊、欲望と貪欲させるウィリアム・キッドが多くなり面。', 
    ['16世纪世界上最好的商船之一，这种船运载贵重货物，运费很高。它们实力强大，能抵御海盗的侵袭，因此一些商人认为没有必要给这种船运载的货物上保险。'] = '16世紀の世界で一番の商船の一つで、この船に積ま贵重な貨物、送料が高い。それらの実力が、海賊の強力を防ぐため、一部の商人にする必要はないと考えるように船に積まれた货物保険。', 
    ['16岁，华裔葡萄牙人。天真烂漫的少女，聪慧热情，有温暖人心的力量。祖父是劫富济贫的海盗、父亲是正直勤恳的海商，对自己该走哪条路一直摇摆不定。'] = '16歳、中国系ポルトガル人。天真烂漫な少女、勝気热、暖かい心の力だ。祖父は義賊の海賊、父は正直に、自分の真面目海商どの道を行ってぐらついてきた。', 
    ['16级海盗'] = '16級海賊', 
    ['1715年7月，一艘西班牙宝船在佛洲外海被飓风打沉。为了迎娶玛利亚，改善贫困的生活，萨姆·贝拉米决定出海打捞沉没的西班牙宝船，可惜萨姆都什么都没有找到。'] = '1715年7月、1隻のスペイン宝船は仏すほかハリケーンをれ沈んだ。結婚するためのマドンナ、貧困生活、サム·クレイグ・ベラミー出航する沈没のスペインの宝船、もったいないサムも何も见つからない。', 
    ['1717年萨姆·贝拉米成功掠夺英籍大型贩奴船－维达号，并以之为旗舰，借由维达号的重装武力，成为当时北美洲东岸海域最令人闻风丧胆的海盗之一。'] = '1717年サム·クレイグ・ベラミー成功略奪に入る大型贩奴の船—维达号し、之をフラッグ、维达号のリフォーム武力、当時北米東岸海域の最も引くの海賊の一つ。', 
