    ['“一官”郑芝龙'] = '「官」の郑芝龙', 
    ['“一步天堂，一步地狱”果然……不同……凡响。'] = '「一歩一歩、地狱の天国」やっぱり……違う……実にすごい。', 
    ['“上帝的山谷”已经被海盗糟蹋得面目全非，看不到往昔的繁华了。'] = '「神様の谷」は、海賊に堕落しない昔の繁华街。', 
    ['“世界的尽头”就在眼前了，启程！'] = '「世界の果て」はもう目の前に、旅立ち!', 
    ['“世界的尽头”就在西南方的大洋深处，那里是一片蛮荒的所在，未知的危险潜藏在蔚蓝大海之中。起锚，觐见海洋女神！'] = '「世界の果て」は、南西の大洋の奥に、そこはチャンスの所在は、未知の危険が潜んだ青い海の中錨を揚げる、元海の女神!', 
    ['“亨利王子透露出关于七海霸主信物的消息，前往【伊斯坦堡】找到巴巴罗萨。'] = '「ヘンリー王子に七海覇者についてのニュースで、神仏に向かうファルコン】【カッフェーをやけに羅萨。', 
    ['“公牛号”'] = '「雄牛号」', 
    ['“公羊号”'] = '「公羊号」', 
    ['“冈依沙瓦号！”那可是莫卧儿最大型的运宝船！看到那些护卫船么？如此严密保护，船上的宝物一定难以想象！做好准备！'] = '「冈田依沙瓦号!」それは莫臥妍兒最も大型の运の宝船!その船を護衛するか?この船の宝物、厳密な保護一定想像する!準備!', 
    ['“冒险号”竟然打起了莫卧儿王朝的大型运宝船“吉达号”的主意，击退海盗，可是有不菲的酬劳的。'] = '「冒険号」をなんと莫臥妍兒王朝の大型运宝船「吉达号」のアイデアを撃退し、しかし、海賊が相当の報酬の。', 
    ['“十八芝”是南中国海实力最强的海盗团伙，几乎所有经过的船只都深受其害，如果能协助官府进行打击，应该对沿海的贸易稳定有极大的帮助。'] = '「十八芝」は、南シナ海最強の海賊組織を経て、ほとんどすべての船舶が被害に遭って、役人、協力しなければならない打撃、沿海の貿易の安定のために役に立った。', 
    ['“协议达成，速回'] = '「合意が、速回', 
    ['“协议达成，速回【里斯本】--亨利王子”，这是怎么回事？我们才刚刚把汉萨同盟给收拾了就达成协议？回去里斯本看看吧。'] = '「合意が、速回【リスボン】——ヘンリー王子」、これはどういうことか。私はようやく漢萨同盟を収拾した合意は?帰ってみようか。リスボン', 
    ['“南海侠盗”张保仔'] = '「南海张保仔恋焦がれる」', 
    ['“友谊”号'] = '「友情」号', 
    ['“叹息桥号”，一艘威尼斯炮船！还带了水手护卫船！财大气粗的家伙还真是谨慎，看来，不解决掉水手护卫船是很难登上“叹息桥号”做“交易”的呢。'] = '「ため息桥号」で、1隻のベネチア砲船!セーラー服も护卫船!目撃さのやつは、どうやら、慎重に落ちないセーラー解決は難しい「護衛船桥にため息号」「取引」のだろう。', 
    ['“吕贝克的耶稣”号的近战能力很强，船甲坚固，但是没有远程攻击能力，尽量远离它。'] = '「吕贝克のキリスト」号の近战能力が强く、船が、甲顽丈長距離攻撃能力、なるべくそれから离れた。', 
    ['“吕贝克的雄鹰号”是汉萨同盟最大的商船，也是北欧最强大的战舰。我们要击落这只雄鹰，宣告他们的时代已经终结。'] = '「吕贝克のスーパー・イーグルズ」号は漢萨同盟の最大の商船も、北欧の最强の戦舰。私たちだけ、撃墜スーパー・イーグルズ宣告彼らの時代は終わりだ。', 
    ['“吸烟的青蛙”'] = '「喫煙の蛙」', 
    ['“命运号”果然在“白棉布”手中，前往【牙买加】找到亨利·摩根接下关于“白棉布”的悬赏。'] = '「运命」号はやはり「白手ぬぐい」の手に、【ジャマイカ】ヘンリー・モルガンをうけとる「白い手ぬぐい」の悬赏。', 
    ['“地球如是环，忽鲁模思则是宝石”，这里就是风景甚佳的霍尔木兹了。'] = '「地球如是环、ピタリ鲁模思考は宝石」、ここは、景色のホルムズたパス。', 
    ['“安全”的对手'] = '「安全」のライバル', 
