    ['“怪盗”威廉·基德'] = '「怪盗キッド」のウィリアム・・・', 
    ['“接受女王的赏金任务，马上返航【里斯本】，商议下一步行动吧。'] = '「女王の赏金を受け、任務をすぐに帰還【リスボン】次の行動を相談しましょう。', 
    ['“斗牛犬号”'] = '「闘牛犬号」', 
    ['“无敌舰队”排成几路纵队，全速向英国战舰紧逼。“命令各舰队不惜一切代价靠近战舰，用钩子钩住敌舰！”“无敌舰队”总司令西顿尼亚大声喊叫着。'] = '「無敵艦隊」の長蛇の列に、数路全力英国戦艦圧迫。「命令各艦隊の構えで、接近戦舰フックの端に住んで巨艦!」「無敵艦隊」西食军総ペンシルベニア叫んだ。', 
    ['“朱迪思”，把他们抓来当奴隶，这样我们才能向女王交待。'] = '「朱迪思」、彼らを捕まえて、奴隷のように供述こそ女王。', 
    ['“欢迎航海家们参加每日竞赛，优胜者将被授予尊贵的头衔……”这个布告上说的是……'] = '「歓迎航海家たちが参加し、毎日コンテスト优胜者に授与される尊いの肩書きを……」この布告で言ったのは……', 
