    ['一切准备就绪，准备返回里斯本'] = 'すべての准备に、リスボン', 
    ['一切听您的，船长。终于有工作了！船长，我在十几艘船上工作过，虽然它们都沉没了，但我敢保证绝对和我没有任何关系！快给我个任命吧，咦？那艘船怎么没有桨？'] = 'すべてのお闻き、船長。やっと仕事が! ! ! ! ! ! !船長、私は十数隻の船に勤め、それらは沈没したが、私は绝対保証すると私とは何の関係もない!さあ、私の任命でしょう、え?その船が櫂?', 
    ['一切船只，无论属国、船型、商贾兵盗，只要经过我们领海，就必须交出税费，若有不从者，杀无赦。'] = 'すべての船、いくら属国の朝、船型と、早速兵盗さえすれば、我々の領海を経なければならない税金を出せば、ない、ない。勅杀サーヴァント', 
    ['一劳永逸'] = '末永く', 
