    ['一团糟总比落入阿拉伯人手里好吧，我还想好好的当我的印度总督呢。别说了，快去吧。'] = '乱闘にアラブ人の手よりいいでしょう、私はよく私の移り変りインド総督だろう。やめろ、早く行きましょう。', 
