    ['一小箱钻石，闪烁着令人目眩的光芒'] = '小さな箱のダイヤモンド、めまいほどの光に光っていた', 
    ['一小袋钻石'] = '小さい袋のダイヤモンド', 
    ['一小袋钻石，闪烁着令人目眩的光芒'] = '小さい袋のダイヤモンド、めまいほどの光を輝かせた', 
    ['一年四季散发着清新的香气，令人心旷神怡，是制作【香水】的好材料。'] = '一年中、清新の香りが漂っている気持ち良い、制作【香水】のいい材料だ。', 
    ['一年四季气候宜人，曾是罗马皇帝的避暑圣地，城内随处可听到动人的意大利民谣。'] = '気候は、一年中のローマ皇帝の避暑地に、城中の随所のイタリア民謡闻。', 
    ['一座位于西非阿尔金湾的岛屿，岛的周围被暗礁包围，土地贫瘠且缺少锚地，不宜定居。'] = '一席は西アフリカの阿尔金湾の岛、島の周囲にされ、土地が痩せて暗礁に囲まれ、不足は锚地に定着した。', 
    ['一座浮现在原始森林中的玛雅遗迹。'] = '一つは、原始森の中に浮かぶマヤ遺跡。', 
    ['一座浮现在原始森林中的玛雅遗迹，其中最大的杰作是五个巨大的金字塔神殿。神殿建造在沼泽环绕的丘陵上，传说这里能听到圣灵之声。'] = '一つは、原始森の中に浮かぶマヤ遺跡のうち、最大の杰作は五つの巨大なピラミッド神殿。神殿を建て、沼に囲まれた丘陵地帯で、伝闻こえる音ここ圣霊。', 
    ['一建补给按钮'] = '建て補給ボタンを押した', 
    ['一张地图！还标注了目的地，如果没猜错的话，这一定是张藏宝图，虽然不知道是谁留下的，但我们不妨走一趟，也许能找到意外的惊喜呢！'] = '地図一枚!表示目的もし、もし間違えたら、これはきっと、張藏宝图誰か知らないが、私の残したといふゆっが见つかるかもしれない、意外のサプライズですね!', 
    ['一往无前'] = 'ひたむき', 
    ['一无所获的萨姆·贝拉米为了不空手回到爱人身边，在1716年1月离开佛洲，来到加勒比地区加入本杰明·霍尼戈的海盗团。'] = '何のサム·クレイグ・ベラミーのめのめしないためには、爱人そば1716年1月に、仏を離れ済州ベンジャミン・カリブ海地域加入霍尼戈の海賊団。', 
    ['一星奖励'] = 'yearsインセンティブ', 
