    ['一次老船长的旧友前来拜访，告诉阿尔弗雷德·扬，老船长尚有后人活在世上，只是下落不知，阿尔弗雷德·扬得知此消息后毅然决定跟随船队出海，寻找老船长继承人。'] = '初めて老船長の旧友をお訪ねして、アルフレッド・扬、老船長がまだ子孫がこの世に生きている、ただ行方知らず、アルフレッド・扬このニュースを知った船団に従って敢行し出航し、後継者を探して老船長。', 
    ['一次，多索·贝利欧面对艳遇不屑一顾，原来他早已心有所属，现在之所以一心寻宝，便是为了娶到自己的梦中情人。'] = '1回、多く间流・ペレ欧州は、彼はすでに小骚到处留情にらむ心に所属し、今が一心宝探しは、结婚するために自分の梦に爱人。', 
    ['一波三折'] = '凡そ', 
    ['一点也不，我们是一种人，都有梦想、渴望自由，即使是不同肤色、不同地域，但命运会指引我们走到一起。'] = '少しも、われわれは一种の人も、梦がある、渇望の自由、たとえ違う、肌の色が異なる地域で、运命が私たちと一绪に歩くアプまで。', 
    ['一百多年前，普利茅斯曾被法国人烧毁。'] = '百年前に、フランス人〔プリオシン焼失した。', 
    ['一直往东走，如果不偏离航向会到达开普敦。'] = '東ずれなければ、ケープ・タウンの方向に到着した。', 
    ['一直往北就会到达中国了。'] = 'ずっと北中国に着く。', 
    ['一种产自东南亚的香料，果实呈八角形，味道微辣带甜，晒干磨粉后可以做成【咖喱】和【茴香酒】。'] = '一种の香料、東南アジア産果実が八角形、少し辛い甘い味を持って、干し磨粉の後を作成できる【カレー】と【フェンネル酒】。', 
    ['一种以【葡萄】为原料西班牙香槟酒，气泡细腻丰富，口感比法国香槟更加柔和，略带面包发酵的酸甜香气。'] = '一つは【ぶどう】を原料に、スペインのシャンパン気泡の豊富な、繊细な口当たりのフランスよりさらにシャンパンが柔らかく、ややパン発酵の甘酸っぱい香り。', 
    ['一种包含金属铁的矿石，锻造【刀剑、洋枪、武士刀】等武器时都会用到。'] = '一种の金属鉄の鉱石含まれ、刀剣锻冶【、洋枪、武士の刀】などの兵器でも使う。', 
    ['一种古老的器物，人们将黏土捏制成形后，高温烧制成实用的陶器。'] = '一种の古い器物を、人々は粘土で作った後、握る形高温に陶器実用の陶器。', 
    ['一种可以将声音扩大放出的神奇乐器。'] = '一种の拡大は声の神秘楽器。', 
    ['一种含铜矿石，提取出的金属铜可以用来打造【铜器】或各式武器，如【盾牌、甲胄、大炮】。'] = '一种の含み、銅鉱石を抽出できる金属の銅を铜器】や【いろいろ武器、例えば【盾、兜や野砲】。', 
    ['一种含锡矿石，提取出金属锡后，可以制作【锡烛台】。'] = '一种の含ま锡矿石を抽出できる金属錫後、制作【錫烛台】。', 
    ['一种吸食香烟的工具，一般用竹子制成。'] = '一种の吸うたばこの道具、一般用竹で作られた。', 
    ['一种味道清甜的水果，喜欢生长在温暖湿润的土壤中。'] = '一种の味清甜の果物が好き、生育暖かい湿った土の中。', 
    ['一种小巧的香料植物，花色鲜艳，芳香四溢，在干燥炎热的环境下生长的最好。'] = '一种の香料の植物、小さく色鲜やかで、芳香の表札は、乾燥した环境が暑下生长。', 
    ['一种常见坚果，分布广泛，可以用来榨油。'] = '一种の分布、ナッツ、よくできる広く油。', 
    ['一种常见餐后甜酒，以【柠檬】的外皮为原料制成，在意大利南部的拉古萨湾地区较为流行。'] = '一种のありふれリキュール、【レモンの皮を原料】では、イタリア南部の古萨湾地域が大流行した。', 
    ['一种热带水果，喜欢生长在温暖干燥的山地，果肉香味浓郁，酸甜可口，一次吃太多可能会口舌发麻。'] = '一种の熱帯果物が好き、生育暖かい乾燥の山地、果肉が濃く、甘酸っぱい香り、一度食べすぎがしびれた。年増可能', 
    ['一种热带水果，果肉柔软且甘甜多汁，但并不是所有人都喜欢这种味道。'] = '一种の熱帯果物、果肉が柔らかくて甘い汁をあまりしないが、すべての人がこの味が好きだ。', 
    ['一种热带水果，肉质甜软，外壳坚硬，表面有坚硬的凸起。'] = '一种の熱帯果物、肉質が甘い柔らかく、硬い壳が、表面の坚いポチ。', 
    ['一种生长在热带的香料，气味芳香清凉，味道辣中带苦。'] = '一种の成長は、熱帯の香料、においの香り、味辛い凉で苦。', 
    ['一种用【蚕丝】制成的衣料，不仅柔软光滑、色泽绚丽，还带有让人迷醉的高贵光泽。'] = '一种の用【绢】で作った衣類だけでなく、なめらかな色を帯び、また、呆気ないっと高貴なつや。', 
    ['一种稀有的天然矿物，带有美丽的透明光泽，是打造【宝石首饰】的好材料。'] = '一种の珍らしい天然鉱物、美しい透明な光沢を作る宝石は、【アクセサリー】のいい材料だ。', 
    ['一种粮食作物，可以用来制造营养丰富的豆制品，但食用太多的话，常常让人忍不住释放出令人尴尬的气味。'] = '一、食料作物が栄養豊かな大豆制造が、食べ过ぎると、しばしば人放出来の匂い。', 
    ['一种精巧的民间工艺，质地坚韧的【红木、花梨木】都是雕刻复杂作品的上等材料。'] = '一种の精巧な民間工芸、银の坚忍の【大気や所属】は彫刻复雑な作品の上等な材料だ。', 
    ['一种红色的硬木，带有天然形成的花纹，材质坚硬耐磨，适合打造贵重家具，或【木雕、木器、巴厘木雕】等工艺品。'] = '一种の赤色の缝は、天然の形成の柄、材質をカバー、硬いに贵重な家具や【木彫、木器、バリ島木彫】など工芸品。', 
    ['一种营养丰富但是咬起来非常吃力的水果，含糖量较高的甘蔗通常用来生产【朗姆酒、黑糖、蔗糖】。'] = '一种の栄养豊富でもとてもシイ噛みの果物、糖度が高いサトウキビ通常用【ラム酒、生産黑糖、ショ糖】。', 
    ['一种质地很软的金属，常用来打造【银饰】。与黄金一样，白银一直是财富的象征。'] = '1この地の金属、柔らかく常用来银饰摂【】。と、黄金のように、白银は富の象徴だ。', 
    ['一种身体扁长的鱼，喜欢生活在寒冷的海水里，肉质白细鲜嫩，口感清淡不腻，可以提炼【鱼油】。'] = '一種の身体の鱼が好きで、生活を添厳寒の海水の中に、白い细い、肉質とろける食饱きない、あっさり抽出できる【魚油】。', 
    ['一种软体海洋生物，种类非常丰富，外壳又硬又厚，螺肉十分有弹性。'] = '一种のソフトウェアの海洋生物、种类が豊富で、坚くて厚い壳が、弾力のあるタップ肉。', 
    ['一种辣味蔬菜，能增进食欲，也是制作【咖喱】的主要原料。'] = '一种の辛さが、野菜、食欲も制作【カレー】の主原料。', 
    ['一种透明物质，最初从火山喷出的酸性岩中凝固而得，制造技术纯熟后，常用来吹制【玻璃器皿】等工艺品。'] = '一种の透明物質が、最初は火山の喷出の酸性岩で凝固し、製造技術の常用来熟した後、吹きガラス器制【】など工芸品。', 
    ['一种铜质重型武器，装上弹药后可以射出较远的距离，火力范围广，威力十分强大。'] = '一种の铜质重火器装着できる、弾薬を射から遠く離れた距離、火力の範囲が広く、威力が強い。', 
    ['一种雕刻工艺，一般选用质地细密坚韧、不易变形的【牛皮】进行创作。'] = '一种の雕刻工芸、一般纺糸細密兴头坚忍、不易変形の【皮】创作した。', 
    ['一种风化岩石，被称为“世界第八大奇观”。'] = '一种の风化岩と呼ばれ、「世界第八ショー」。', 
    ['一种黄色的热带水果，味道酸甜可口。'] = '一种の黄色の熱帯果物、甘酸っぱい味。', 
    ['一等一的男爵哦'] = '一等の男爵よ', 
    ['一等子爵'] = '一等子爵', 
    ['一等男爵'] = '一等男爵', 
    ['一网打尽'] = '一網打尽', 
    ['一群史前坟墓，位于爱尔兰首都都柏林北50公里处，主要有三座坟墓：纽格莱奇墓、诺斯墓、道斯墓，是欧洲最重要的史前巨石文化遗址之一，其建筑具有社会、经济、宗教和葬礼的用途。'] = '一群先史墓、アイルランドの首都ダブリンの北50 km地点で、主に三つの墓は、ニュー・奇墓、ノース墓、道は墓は、欧州で最も重要な先史巨石文化遺跡の一つで、その建物は社会、経済、宗教と葬式の用途。', 
    ['一群史前坟墓，欧洲最重要的史前巨石文化遗址之一。'] = '一群先史墓、欧州の最も重要な先史巨石文化遺跡地の一つだ。', 
    ['一群废物，竟然让他们溜过来了！'] = '一群の廃物が、彼らを抜け出して来た!', 
    ['一群衣衫褴褛的朝圣者向我们袭来，是什么勇气让这些武器落后的家伙驾驶着小船冲向我们？从远处的浓雾中驶来几艘战舰，看来幕后黑手即将出现。'] = '一群のみすぼらしい身なりの探す巡礼に袭は、これらの兵器何勇気立ち遅れたやつて放た運転ボート私?遠くの雾で、どうやら来数隻の戦舰に送り込んだ。', 
    ['一群衣衫褴褛的海盗出现，是什么勇气让这些病恹恹的家伙驾驶着小船冲向我们？从远处的浓雾中驶来几艘战舰，看来幕后黑手即将出现。'] = '一群のみすぼらしい身なりの海賊は、何が彼らの勇気我やつて放た運転ボート私?遠くの雾で、どうやら来数隻の戦舰に送り込んだ。', 
    ['一艘敌舰进入卡利卡特！'] = '1隻の敵にカーターヒカリ! ! ! ! ! !', 
    ['一艘残血的敌舰回到队伍请求支援，魏臻发现了你。'] = '一隻の敵残血支援チームに復帰要請を発見した魏臻あなた。', 
    ['一艘逃亡的非洲船被击沉，任务失败'] = '一隻の船が亡命アフリカ撃沈され、任務の失败した', 
    ['一袋金币'] = '金货一袋', 
    ['一袋金币，散发着金闪闪的光芒'] = '金货一袋、金闪闪の光が漂っている', 
    ['一言为定！'] = '一言を定!', 
    ['一言为定，我会尽我的一切力量协助你。'] = '一言は、私のすべての力の協力あなた。', 
    ['一起投资建设'] = '一绪に建設投資', 
