    ['不是商会之星不能领奖'] = '受賞できない商工会議所の星', 
    ['不是所有布伦希尔德都有她的齐格弗里德。'] = 'ヒル次官補はすべての布がナポレオン徳を彼女の齐格フリー徳。', 
    ['不是！不是海盗！当时政府正为印度洋上的海盗发愁，我是为国效力！为国效力！'] = '違う! !海賊は! ! ! ! ! !当時、政府はインド洋での海賊悩んで、私は国のため!国のため!', 
    ['不止一座港口叫圣乔治。'] = '一つだけ呼ぶ港ジョージ。', 
    ['不止你哥哥，你还深受许多百姓爱戴。'] = '止まらない兄さん、あなたは多くの庶民愛された。', 
    ['不用在意，看轻你的人终将为他们的轻浮付出代价……（轻声）至于他为什么不向我们动手，自然是因为……'] = 'そういう気に、あなたの人をやがて彼らの軽薄代価……(小声で)彼がなぜ我々に、自然の手は……', 
    ['不用找了，在游戏里加尔各答是印度东岸唯一的港口。'] = '不用探し、ゲームでカルカッタはインド東岸唯一の港。', 
    ['不用找了，女神之誓应该已经不在此处，我们进攻汪直之时，有一支船队已经悄悄离开此处朝$(missioncolor:【大阪】)去了。'] = '不用探したなら、女神の誓はもうここに、私たちの攻撃の時、ワン直がすでに1船団そっとここを離れ朝$(missioncolor:【大阪】)へ行った。', 
    ['不用拍马屁！不过也没说错，我因为在战争中的出色表现得到女皇嘉奖，志得意满，结婚生子，直到在伦敦认识贝洛蒙特勋爵。'] = '不用世辞!しかしもなかったので、私は间违いは戦争中の活躍が女帝赏、志得意満と結婚し、ロンドンで認識まで、贝洛バーモント勋爵。', 
    ['不用斥责这位小兄弟，我的确是用过一些手段。'] = '不用叱るこの坊主、私は确かに使った一部の手段だ。', 
    ['不用着急，慢慢来，先从英军士兵开始。'] = '焦らずに、ゆっくりと、英国軍兵士から先に始めた。', 
    ['不用装扮，我本来就是商人！只要经商的利益确实落入我的钱包，我现在就可以动身。'] = '不用扮装は、私はもともと商人!経常利益のさえ确か私の财布には、私は今お出かけ。', 
    ['不知何时才能找到关于族人的消息，哎……'] = 'いつについてのニュースを族、へえ……', 
    ['不知死活的奴隶，居然趁机反抗！'] = '生死の奴隷か、なんと反抗绝命! ! ! ! ! !', 
    ['不知死活，我们的忍耐可是有限度的，要逃命趁早！'] = '知らないけど、忍耐の限界があるのなら、早く逃げ! ! ! ! ! !', 
    ['不知道是不是我的错觉，我总感觉幸运女神要远离我们了。'] = '私の错覚かどうか分からない、私の感じた幸運の女神たちから离れなければならない。', 
    ['不知道，可能中国人的饮食和我们真的很不同呢，总之我们只管找食材，【马尼拉】的【荔枝】是吧？'] = '知らない、中国人の食性と本当にとても违うか、とにかく分った食材を探し、【マニラ】【ライチ】でしょ?', 
    ['不祥的预兆'] = '不吉の前兆', 
    ['不祥的预兆，赶回'] = '不吉の前兆、帰った', 
    ['不等了,全速前进。'] = 'まで、全速力で走りました。', 
    ['不管别人如何看，我对您是佩服的，大叔。'] = '他人がどう见ても、私はあなたに、おじさんは感心した。', 
    ['不管如何，“魔鬼之手--佛得角”就在西南方，第一步的计划，就是征服这片让先辈闻之色变的海域，到佛得角去！'] = 'ともあれ、「悪魔の手——佛得角」は、第一の南西の計画は、征服の先代のように色の海域に行き、佛得角! ! ! ! ! !', 
    ['不管如何，他都不该出现在这条航线上，到【普利茅斯】找到德雷克，必须让他给一个说法！'] = 'とにかく、彼はそこに、この航路で、【】〔プリオシンを見つけなければならない、ドレークに一说! ! ! ! ! !', 
    ['不管怎么样，当务之急就是帮助这片曾经美丽的土地恢复原来的面貌吧。'] = 'とにかく、最も急がれるのがこの地を助ける美しかった土地の姿を取り戻すだろう。', 
    ['不管怎么样，肃清了盘踞在比绍的海盗，总算让新航线安全一些了，努力让比绍成为崭新的贸易港口吧。'] = 'とにかく、粛清した比绍に巣くうの海賊、ようやく新航路の安全の一部になったように、努力比绍斩新な貿易港だろう。', 
    ['不管怎么说，这看起来是个做生意的好地方，让我们到市政厅办理贸易许可证吧。'] = 'なにしろ、これは商売のいいところまで、市役所で貿易許可証だろう。', 
    ['不管怎样，我们必须做好应对的准备，敌人可是很快就会反扑回来的呢。'] = 'とにかく、私に備えなければならない敵の準備、しかしすぐ帰って反撃のだろう。', 
    ['不管是上流社会的贵妇人，还是放浪形骸的市井女子，她们下午茶的谈资里总不会缺少这样一个名字--“黑男爵”巴塞洛缪·罗伯茨。这个据说是有史以来最绅士的海盗王，有着俊朗的相貌和高雅的谈吐，胡子永远保持干净整齐，喜欢穿着华丽的红色外套和戴着红色羽翎装饰的宽檐帽。行动儒雅端庄，不酗酒，甚至喜欢喝清茶，还每天坚持在他的船长室做祷告，就像每一个在圣保罗教堂祷告的教徒一般谦卑虔诚。而除了良好的做派，他为手下散漫凶悍的海盗制定了“海盗10诫”，还有他果敢准确的指挥能力更是为人所津津乐道。'] = '上流社会の贵妇人であれ、それとも放浪とかく物象の市井の女子は、彼女らの午後茶のネタで総は欠かせないという名前である「黒男爵」バルセロナ・ロバーツ洛动。これは史上最高の紳士は、海賊の王俊朗の容姿と上品な言叶遣い、ひげを、永远にきれい好き整然と派手な赤いジャケットと赤いハネ装饰の幅铁马帽。行动は、案外、端正酒さえ饮のお茶が好きで、毎日彼の船长室做不祈祷、まるで一サンパウロでは教会の祈祷の教徒一般敬虔に谦虚。良好な流仪では、彼は部下の王者として猛威散漫海賊作成した「海賊10诫」、そして彼の正確な指揮能力も果敢に中部大。', 
    ['不管现在还是未来，科学和宗教都可以共存。'] = '现在も未来も、科学と宗教も共存できる。', 
    ['不能任命相同职业的航海士'] = '任命できない同じプロの航海士', 
    ['不能任由阿芒德的人胡作非为，出发，驰援巴塞罗那！'] = '放置できない阿穂先徳の人、むちゃを出発し、向かっバルセロナ!', 
    ['不能再被增援'] = 'てはいけない増援', 
