    ['不能参加'] = '出場できない', 
    ['不能取消'] = '取り消すことはできない', 
    ['不能含有非法字符'] = '含まない不法キャラクタ', 
    ['不能在接受悬赏任务的港口放弃任务'] = '受けない懸賞任務の港湾あきらめ任務だ', 
    ['不能在活动时间外修改时间'] = 'イベントは、時間外改正時間', 
    ['不能容忍粗鄙的海盗们继续破坏这座美丽的城市。进攻！'] = '海賊たちは容認できないとの污れ続けるこの美しい都市だ。攻撃!', 
    ['不能开始'] = 'できないから', 
    ['不能拆解编入舰队中的船'] = '編入艦隊の船を分解できない', 
    ['不能接受'] = '受け入れることはできない', 
    ['不能接收并回赠'] = '受信できてお返し', 
    ['不能放过这些多管闲事的，干掉他们！'] = '逃さないこれらのおせっかいの、ひたすら彼ら!', 
    ['不能更新信息'] = '更新できない情報', 
    ['不能犹豫，机会稍纵即逝！必须在他们完成集结前进攻！全员准备，到了跟摩尔海盗宣战的时候了！'] = '迷い、チャンスはおらず!彼らは必ず完成前攻撃集結! ! ! ! ! !全員準備と宣戦布告のときムーア海賊! ! ! ! ! ! !', 
    ['不能给敌人喘息的机会，趁着敌人慌乱的机会，直取对方中军旗舰！'] = '敌の機会を与えることはできない、敌に乗じて息を切りかけチャンス取り、直相手軍フラッグ!', 
    ['不能让他们完成包围，一定要撕开他们的阵线。'] = '彼らは必ず完成に囲まれ、彼らのラインを裂いた。', 
    ['不能让他们继续攻击平民，再损失3艘平民船就无法完成撤退任务了。'] = '彼らは引き続き攻撃できない庶民、再損失3隻の船が完成できない庶民撤退役目。', 
    ['不能让敌人靠近卡利卡特'] = 'できない敵ヒカリカーター', 
    ['不能让暴行继续。'] = '暴行させることはできない。引き続き', 
    ['不能让运输货船逃离，击毁2个炮塔，最后攻击彼得松•霍因。'] = '輸送船は、2つの炮塔使いこなさ脱出し、最後の攻撃がピーター松・か弱く。', 
    ['不能让这些家伙进入港湾，截击他们！'] = 'こんな奴に港湾、迎撃彼ら!', 
    ['不能购买那么多委任次数'] = 'そんなに購入できない委任回数', 
    ['不能迁移到原本的据点港口'] = 'もともとの拠点移転できない港', 
    ['不能进行一键升级'] = 'アップグレードしない一ボタンを押した', 
    ['不能领取其他阵营声望物品'] = '受給できない他の陣営の威光物品', 
    ['不能领奖'] = '受賞できない', 
    ['不行了，船舱已经进水，快靠近主舰!'] = 'だめ、船室は、早く近づく取主艦!', 
    ['不行！不能允许如此暴行的存在，哪怕是以国家的名义，立即驰援突围的这位朋友。'] = 'だめだ!この暴行の存在を许し、たとえは、国家の名義で、直ちに包囲の友人に向かった。', 
    ['不行，改变方向，朝着另一个珊瑚礁群前进，抵达那边，我们才能甩开他们。'] = 'だめ、方向を変えて、もう一つのサンゴ礁进に到着し、我々こそ、あちらを。', 
    ['不行，魔鬼之手——$(missioncolor:【佛得角】)本身危机重重，我们不能为了一点点金币以身犯险。'] = 'だめよ、悪魔の手——$(missioncolor:【佛得角】)そのもののために危機を重ね、我々は少し身を犯手当金货。', 
    ['不要与护卫船过多纠缠，绕过去消灭【海盗斥候】'] = '船とは、過多護衛つきまとう过去消滅【海賊斥候】', 
    ['不要再往南走了，南方没有港口了。'] = '二度と南へ歩いて、南方港がないた。', 
    ['不要吃我'] = '食べない私', 
    ['不要听那些原住民诽谤我们的总督大人！'] = 'それらの原住民たちを誹謗の総督大人!', 
    ['不要在椰子树下闲逛，会被熟透的椰子砸到。'] = '下は、椰子のうろつく熟れた椰子のにした。', 
    ['不要在王宫面前晃来晃去的。'] = '王宮前でグラグラする。', 
    ['不要忽视女人在政治中的隐性作用。'] = '女はない政治の発現の役割だ。', 
    ['不要意气用事！现在风向有利于我们，敌方船速不快，我们尽量推延时间，让属下准备突击快船，我自有妙用。'] = '意地!今、風向有利船速不快を敵、なるべく时间を一旦、傘下の準備、私の自己妙用突撃ご覧。', 
    ['不要担心伙计，只要在非洲以东，就不用担心海盗的问题，那些懒惰的家伙才不会费尽心力跑得那么远来抢劫呢。'] = '心配しないで、アフリカではエドムの店員は、海賊の問題を心配し、あれらの怠け者のやつがないほど远走りコー心力来強盗だろう。', 
    ['不要指着月亮起誓，它是变化无常的。'] = '月がないと誓を指し、それは无常変化する。', 
    ['不要松懈！对方气势汹汹的过来了！'] = '油断ない! ! ! ! ! !意気盛んな相手で来た!', 
    ['不要着急，休息，休息一会儿。'] = '焦らず、休み、しばらく休息。', 
    ['不要让水手们在城里惹事！'] = 'セーラーたちは、町のない你偏!', 
    ['不要轻敌！也永远不要低估马其顿士兵的战斗意志！利用敌人的弱点，我们才有机会取胜。'] = '油断しないで!も絶対評価マケドニア兵士の戦闘意志!敌の弱点を利用してこそ、チャンスが勝った。', 
    ['不见得吧，在你心中肯定宝藏更为重要。'] = 'そうでしょうか、あなたの心の中の肯定的宝がより重要だ。', 
    ['不许人们私下交易，对每一单贸易都收取高额的税收。却不肯付工钱给农民和工人。把他们当成奴隶使用！'] = '私的な不可取引、1単貿易が高額の税金を受け取った。払おうと云うのに、労働者と農民。彼らを奴隷使用!', 
    ['不许看！'] = 'を见ない!', 
    ['不说红胡子，现在你的目标是阿芒德，听闻他最近在$(missioncolor:【亚历山大】)屯以重兵，那里的监狱是关押重要犯人的地方，拉比斯说不定在那里，我们一起去看看。'] = '言わず赤ひげ、今あなたの目標は阿穂先徳、尔来彼は最近$(missioncolor:【アレキサンドリア】)屯は重兵、そこの監獄に収監されたところは、重要な犯人かもしれないが、そこは、私たちと一绪に行ってみた。', 
    ['不超过2艘水军死亡'] = '2隻を超えない水軍が死亡した', 
    ['不足%s个，无法合成'] = '不足%s個、合成できない', 
    ['不足20个，无法合成'] = '不足20個、合成できない', 
    ['不足5个，无法合成'] = '不足5つ、合成できない', 
    ['不过么，我记得当时亨利王子和我们尊贵的女王定下的协议是，英国官方将不侵犯贵国在南方的权益，但这不能约束个人行为啊！'] = 'しかし、私は覚えているヘンリー王子と当時我々の尊厳の女王の決めた合意は、英国の公式が不可侵貴国は南方の権益が、個人の行為の取り締まりよ!', 
    ['不过他们还算明智，知道我们是块难啃的骨头，并没有向我们下手。'] = 'しかし彼らは賢明で知り难し、ブロックの骨をかじりしない手に。', 
    ['不过你们记住，你们是以私掠船的名义，因为女王现在还不想正面和汉堡发生冲突呢，祝你们好运吧！'] = 'しかし、あなたたちは、あなたを覚え、個人名義のすれすれ船から女王は今正面衝突とハンバーガーたくないね、皆さん运でしょう!', 
    ['不过即便如此，$(missioncolor:【阿尔金】)依旧是航海家们趋之若鹜的港口，海盗们抢掠的天堂。阿尔金连接南北，各路人马都在此地停泊补给，我们可以向过往的航海家打听拉比斯的消息，不过……'] = 'それにしても、$(missioncolor:【阿尔金】)は相変わらず航海家ら戦国の港、略奪海賊たちの天国だ。阿尔金南北連結、各スタッフもここに停泊できる補給、过去の航海家闻のニュースは、しかし……', 
    ['不过多索·贝利欧的打算并不是成为一名航海家，而是梦想在大海这座宝库中发掘一处宝藏，从而获得大量的财富，而多索·贝利欧最初出海，便是听说某小岛有海盗的宝藏。'] = 'しかし多间流・ペレ欧州のつもりになっては一人ではなく、梦航海家海はこの宝库で発掘一カ所宝、大量の富を、多间流・ペレ欧出航し、最初はある岛は海贼の宝だ。', 
    ['不过好消息就是，我们赢得个南方整个未知世界的开拓权，而这正是我想要的！'] = 'しかしそれは、我々の側を未知の世界全体の開拓権、これこそ私の欲しい!', 
    ['不过如果你们肯帮我凑齐食材的话，等美食节结束我一定上你们的船。'] = 'しかしもし私コンディそろったら、美食节食材などが一定で君たちの船だ。', 
    ['不过我想请你们帮忙，因为小生意不受重视，市政厅一直扣押我的经营许可。'] = 'しかし私から手伝ってください、小商売を重視して、人気のない市庁押収私の経営許可。', 
    ['不过本地人不肯卖【糖胶】给我，能不能请你们到【文莱】帮我采购一些？'] = 'しかしネイティブ売ら【糖】私にできてください【ブルネイ】私を助けて購買一部?', 
    ['不过海军实力虽然提高，但朝鲜党争激烈，肯定会给日方可趁之机。'] = 'しかし海軍の実力を高めるには、北朝鮮が党の争いが激しく、きっと日本側に隙に。', 
    ['不过要到船厂去建造【三桅卡拉维尔】，我们需要赚到10000银币！加油吧！'] = 'しかし船場まで行く建造【三桅カラオケウィル】、私が稼いだ10000銀貨!顽张りましょう!', 
    ['不过迭戈·桑切斯半生都被霉运之神笼罩，他加入的船队不是遇上风暴，便是遇上鲨鱼，后来已经很少有船长敢招募他。'] = 'しかしディエゴ・サンチェス半生がジンクスの神に覆われ、彼が加入した船団は岚が、まっぷたつにだに、后はもう少ないサメがこすれ船長公募彼。', 
    ['不过，以目前我们的实力，与强大的奥斯曼帝国正面抗争时机尚未成熟，所以，我们需要想办法扩充我们的势力版图。'] = 'しかし、現在我々の実力と、强大なオスマン帝国の正面抗争タイミングが成熟していないので、私が、何とか拡充我々の勢力構図だ。', 
    ['不过，你别指望休息了，达伽马把果阿的驻军都调过来了，这场恶战可是随时打响呢。'] = 'しかし、あなたが望む休息を、ガンマ線果阿の駐留米軍は、この戦いてきたけどね。いつでも鳴り響い', 
    ['不过，你需要为【威尼斯】的港口繁荣做些投资，那样，我们才会为你提供所有的便利！很公平，不是么？'] = 'しかし、あなたは【ベネチア】何かの港の繁栄、投資のように、私はすべての便宜を提供する! ! ! ! ! !公取委は、のではないか?', 
    ['不过，我的消息称，马六甲土司可还不死心呢，他又募集了一支舰队，企图夺回马六甲！为了长久的航线安全，必须彻底消灭他呀！'] = 'でも、私の筋によると、マラッカ入りトーストはあきらめないだろうと、彼は募金した一派艦隊を奪還しようとするマラッカ!長年の航路の安全のために、彼は必ず一掃し!', 
    ['不过，法国人的船通常不会有太多火炮，用火炮把那些擅长摆姿势的骑兵解决掉！这船就逃不出我们的手掌了。'] = 'しかし、フランス人の船が、通常は多砲で自走砲はあれらのポーズが得意の骑兵解決!この船は逃げない。我々の手の平た', 
    ['不过，看在你们帮忙的份上，或许你可以到汉堡去，我听说汉萨同盟的商人可是出了名的杂货商，嗯，他们大小通吃，从不挑肥拣瘦！'] = 'しかし、君たちの部分で、手伝いに行くことができるかもしれません、ハンブルク聞い漢萨同盟の商人でも名の雑货商、うん、彼らの大きさは、通吃挑肥拣瘦!', 
    ['不错不错，当年我也是通过竞技加入军队，后来就带着人到新大陆袭击西班牙的地盘，掠夺大量财宝。'] = '悪くない私も、同年を通じて加入軍競技で、その后は人を連れて新大陆攻撃にスペインの所、大量の财宝を略奪。', 
    ['不错么，看起来你还知道这个图纸怎么用，不管怎么说，总算你有一艘看起来像点样子的船只了。'] = 'いいですか、あなたはこの図面を知っては、なにしろ、ようやくあなたが一隻の船舶みたい时様子した。', 
    ['不错，传说七海霸主信物就是七枚克拉肯之眼，克拉肯之眼能够减轻风浪的侵袭。至于七颗克拉肯之眼聚在一起的效果，没人知道。毕竟还没有任何人能称霸七海。'] = 'いいね、伝七海覇者の目印が七枚カラットケンの眼に、カラットケンの眼を減らすことができる。波浪の七粒斟酌カラットケンの眼が集まっての効果は、わからない。なにしろまだ谁が七海を制覇した。', 
    ['不错，当年光是魔鬼之手--佛得角就牺牲了无数先驱者才将其征服的。'] = 'いいね、その悪魔の手だけは——佛得角无数の先駆者を犠牲にしては征服の。', 
    ['不错，成为四等男爵才会开放设置四船舰队的权限，前往各个港口投资或是完成精英战役可以提升你的贡献度，四等男爵指日可待。'] = 'いい、四等男爵に開放設置四船艦隊の権限が、港への投資や完成できるエリート戦闘あなたの寄与度、しくじら四等男爵。', 
    ['不错，这个报酬不算低了。辛西亚要是知道这个消息肯定乐疯了。我们赶紧将它任命到舰队吧，有了它，远洋贸易肯定能事半功倍。'] = 'いいね、この报酬は低かった。辛アリマシアルこのニュースを知ったらきっと楽狂った。私はそれまでにあわてて任命し、舰队だろう、きっと间剧遠洋貿易。', 
    ['不闻机杼声，惟闻女叹息。'] = '机杼音が、惟かぐ女ため息。', 
