    ['他们说的也不无道理……哦，我是说，他们太不讲道理了，这下你可以跟我们上船了吧？'] = '彼らの言うのも無理ではない……ああ、私は、彼らの理屈がない、これであなたが我々と乗りこんでただろう?', 
    ['他叫马合谟沙，不过他不愿意和陌生人打交道，除非你们能给他的交易所带来生意。'] = '彼は马を呼び合谟沙、しかし彼は望まない限り、見知らぬ人とのつきあいにあなたが彼の取引所に商売。', 
    ['他可是个有名的硬骨头，要小心对付。'] = '彼の有名な硬骨头対処、気をつけなければならない。', 
