    ['他掳掠人口，当做奴隶贩卖！这种罪恶的行径，连海洋女神都不会饶恕他！'] = '彼掳掠人口、奴隷として贩売!この罪悪の行為、海洋の女神も許さない!', 
    ['他是个穷小子，又输了钱，据说跑到【布宜诺斯艾利斯】去找事做了，他这种游手好闲的人怕是只会闯祸。'] = '彼は贫乏し、また负け、お金まで走る【ブエノスアイレス】というに虱ったかりやった、彼はこのぐうたらの人だけ。恐らくインタービュー', 
    ['他是唯一一个被冠以“伟大”称号的海盗王，也是奥斯曼帝国的海军元帅。他无情的摧毁敌人的舰船，却把获得的财富无私的分给穷苦的人民。他把一生献给了他要保卫的领土和人民，其名字在爱琴海永世流传。他就是地中海之王--巴巴罗萨·海雷丁！'] = '彼は唯一の「伟大」の称号の海賊王も、オスマン帝国の海軍元帥。彼は无情な敵の艦船を得た富は、贫乏な人民の无私配った。彼は生涯を捧げた保衛の領土と人民は、その名前で、エーゲ海永世広まった。彼は地中海の王——やけに羅萨·海レディング!', 
