    ['你以为我想吗？在印度洋一直找不到海盗，补给消耗一空，不袭击这艘船我们将无法生存！'] = 'おれが思ったか?インド洋で、补给見つからない海賊襲撃、消耗売り切れないこの船に私は生きられないのよ!', 
