    ['你们可真是软弱，依我说，不但要击沉敌人的舰队，还要把城里的反抗者全部杀掉！那样才能一劳永逸！看我的吧！'] = 'あなた达は本当に弱い仆だけで敌の舰队撃沈、城内の反抗者全員殺す!そうしてこそ末永く!私の见ましょう!', 
    ['你们可能不知道，欧洲人也想插手此处，还成功过一段时间，但不久前已经被当地居民联合华人势力赶跑了。'] = 'あなた知らない、欧州人も手も、成功したいここしばらくの时间が、先日は現地住民連合华人勢力を追い出した。', 
