    ['你们在遗迹迷路了，探索度-5'] = '君たち遗迹で迷い、探求度~ 5', 
    ['你们好，我是韦恩海运公司的代理经理人，我来这里是为了找人帮我一个忙。'] = 'こんにちは、私はウェイン海運会社の代理のマネージャーで、私のためにここに来て私はがりがり一忙しい。', 
