    ['你们都笑什么！多美妙感人的故事，我看哭过好多次呢。'] = '皆さんは何を笑って! ! ! ! ! !多くの美しい感動のストーリーを见、私泣いたでしょう。', 
    ['你们需要霍金斯，而我需要这条贸易航线，我们的利益是一致的。这样，届时我的舰队会封锁这片海域，你们负责直接攻入大本营，你看如何？'] = 'あなたは私が必要で、ホーキングこの条貿易ルートで、我々の利益は一致する。そう、私の艦隊を封鎖するこの海域は、直接ゴールをベースキャンプ、どう?', 
