    ['你可回来了！这么多年以来，你可是我们第一个深入奥斯曼人腹地战斗，还能全身而退的人呐！至于红胡子的追缉令，谁在乎呢？反正威尼斯人一直都抵制我们去东边经商的啦。'] = 'あなたが帰ってきた!こんなに年以来、君は我々の第1深くオスマン人奥地も戦闘、全身で退の人ねぇ! ! ! ! ! !赤ひげの斟酌を追う令、谁に気にかけますか?どうせベネチア人ずっとボイコットへ登ら東側のよ。', 
    ['你可回来了！霍金斯那家伙变本加厉，现在已经把魔爪伸到南方去了！'] = 'あなたが帰ってきた!ホーキング斯あいつを増して、今は南に行った魔の手伸! ! ! ! ! !', 
    ['你可回来了，虽然看起来亚丁人还是不肯出兵援助，但有你回来，还是踏实多了呢！'] = 'あなたが帰ってきて、见ない人は亜丁出兵支援だが、あなたが帰ってきたか、心強いだろう!', 
