    ['你可知道他的商队带回的财富有多少？如果你有他的一半，我保证你也可以为所欲为！哈哈哈哈！'] = '知ってる彼の队商の富を持ち帰るが多少?もしあなたは彼の半分を保証することもやり!ハハハハ!', 
    ['你向商会之星致敬后受到激励,增加%s点体力!'] = 'あなた、商工会議所の星を受け、敬意を駆増加%s時体力!', 
