    ['你在北海做了这么多大事，我想，你的爵位在晋升到二等男爵后，你就可以拥有一支完整的舰队了。'] = 'あなたは北海たくさんの大事、私、あなたの爵位が昇進から二等男爵の後、あなたは保有できる一派の完全な艦隊ました。', 
