    ['你将要选中A级以上航海士，是否确认'] = 'あなたが選挙でA級以上の航海士かどうか、確認した', 
    ['你就尽管呈口舌之利吧，待会被炮火轰得别哭爹喊娘科可别来求我！现在去$(missioncolor:【市政厅】)提升普利茅斯的繁荣度，我需要一些物资来完成我的舰队补给，你的小船也需要调整。'] = 'あなたは言い争いも上程されるだろう、利広を打って砲火也做泣く叫んで娘の科で求私!今行く$(missioncolor:【市庁】)〔プリオシンの繁栄度、私が一部の物資で私の艦隊补给も、あなたのボートの調整が必要だ。', 
    ['你就是$(usename) 吧。'] = 'あなたは$(usename)だろう。', 
    ['你就是$(usename)船长？真是出乎意料的年轻！我听说你的事迹，看来我们可是有相同的目标和敌人呢！'] = 'あなたは$(usename)船長?実に意外な若い!私の話を聞いて、あなたたちが同じの目標と敌ですね!', 
    ['你就是亨利王子推荐的那位航海家么？我是新任命的印度总督--达尔布克基！'] = 'あなたはヘンリー王子の推薦のあの航海家?私は新任命のインド総督——が基に!', 
    ['你就是想偷懒，不过我们的人手确实有些不足，这也没什么办法。'] = 'あなたが、我々のサボる人手不足で、これは少しもないのです。', 
    ['你就是葡萄牙的代表，那个孤身打破维京人防线的家伙么？真是看不出来呢！'] = 'あなたはポルトガル代表の、あの無依託打破人ラインのやつヴぃ?本当に見えないでしょう!', 
    ['你就是迪亚士所说的那个跟屁虫水手？难道又想跟在我屁股后面到卡利卡特去么？'] = 'あなたはディアスの言うその東マリノス?また、私とお尻まで行く后ろミカエリスカーター?', 
    ['你就是郑芝龙的儿子郑成功？说话还真是不客气，我怎么就红眉毛绿眼睛了？！'] = 'あなたは郑芝龙の息子の鄭成功。话はまた本当にどういたしまして、私は赤眉緑の目した?! ! ! ! ! !', 
