    ['你当前并不处于该海域'] = '今はあなたが同海域', 
    ['你当选为本日“公会之星”期间，极大的激励了公会成员，为公会发展做出了杰出贡献，共获得%s金币，%s朗姆酒，请再接再厉！'] = 'あなたはこの日「公労当選の星」期間中、大きな励ました組合員は、労組の発展に貢献し、通算%s %sラム酒、小判、どうぞ心機一転!', 
    ['你怎么知道，不过我们船队可不光是转运货物的商船队，海上的风浪和刀枪姑娘你能受得了么？'] = 'どうして知ってるのが、私たちだけではすまさ船団積み替え貨物の商船队に、海上の波と銃刀姫君で?', 
    ['你怎么这么快就来了，那些乌合之众还真是废物。'] = 'どうしてこんなに早く来た、烏合また本当に廃物。', 
    ['你总算回来了，我的孩子，你令我骄傲。上帝保佑，我们葡萄牙终于又出现了一位先驱者！'] = 'あなたがようやく帰ってきて、私の子供で、あなた私を自慢。神の加护は、我々がまた出たポルトガルついにある先駆者!', 
    ['你想想，拥有一只自己的船队自由自在地在海上航行，那种感觉真是太棒了！'] = 'ほら、自分の持つ船団自由自在に海上を航海感覚は本当にすばらしかったです。', 
    ['你成功购买了%d%s'] = 'あなたの成功に購入した%d %s', 
    ['你成功购买了%s'] = 'あなたの成功に購入した%s', 
    ['你我说，我们是不是忘记了什么事情？'] = '私とあなたは、私を忘れたか何か?', 
    ['你战败了。'] = 'あなたに败れた。', 
    ['你所指可是横屿之战？横屿四面水路险隘不易通行，我也是让将士们手持稻草填壕，才能大破横屿倭寇。'] = 'あなたの指さすでも横り>飯嶋戦。横り>飯嶋四方水路险隘不易通行、私も将兵たちが埋めてこそ、藁堀り>飯嶋倭大横。', 
    ['你所说的运奴船，就是正在远去的那一艘吗？'] = 'あなたの言う运の奴が、遠ざかっている船1隻のそれか?', 
    ['你手下的航海士稍嫌稚嫩，交给我培养吧，我保证，你再见到他们时一定会惊讶他们的蜕变。'] = 'あなたの部下たちの航海士、少々幼い私に任せましょう、私の保証を育成、あなたは二度と会うときはきっと惊き彼らの変身。', 
    ['你才无知！这种关键的时刻懒得和你打嘴仗了，海峡对岸的$(missioncolor:【马达加斯加】)是他们负隅顽抗的最后基地，我们必须将其拿下！'] = 'あなたこそ无知!このカギの瞬間、ろくすっぽ口あなたと海峡対岸の$(missioncolor:【マダガスカル】)は彼らの最後の基地に応じよう、我々はそので!', 
    ['你把斧头扔向天空，天空会痛吗？'] = 'あなたの斧を投げ空、空が痛いのか?', 
    ['你拒绝了%s的好友请求'] = '%s君を拒否した亲友の請求', 
    ['你拿下了奥斯曼人的重镇——【亚历山大】，这份功劳足以让你成为一名真正的高阶骑士。高阶骑士可以拥有三艘舰船，这下可以扩充你的舰队了。'] = 'あなたで栄えた——オスマン人アレクサンダー】、【この手柄になるほどあなた一人の真の高レベルの骑士。高レベルの骑士保有できる艦船3隻、これであなたの艦隊が拡充した。', 
    ['你搜索太频繁，请稍候再操作'] = 'あまり频繁に検索、少々お待ちください再操作', 
    ['你搜索太频繁，请稍候在操作'] = 'あまり频繁に検索、少々お待ちください、操作', 
