    ['你放心，我绝对不会坐视不管的。'] = '安心して、私は绝対座視しないのだ。', 
    ['你是一位仁慈而睿智的船长，能和你一同战斗时我的荣幸。'] = 'あなたはある慈悲で、贤の船長君と一緒に戦闘で私の光栄です。', 
    ['你是什么人，怎么会满身伤痕落在大海里差点淹死？'] = 'あなたは何人、どうして伤まみれ落ち、海に溺れそう?', 
    ['你是从西方的大秦来的吗？'] = 'あなたの大秦西洋から来たのか', 
    ['你是休达海战中发动奇袭的那位 $(usename) 船长？我是汉娜一名火炮手。不过如你所见，海军和大部分傻瓜船长都不肯接收女船员！如果你愿意要我，我很乐意效劳！'] = 'あなたは休は海戦での発动のあの$(奇usename)船長?私はハンナ一人自走砲手。しかし例えばあなたが会って、海軍と大半のバカ船長譲り合って受信女船員!もし私が、喜んで押し切る!', 
    ['你是法国人吗？听说法国会吃蜗牛。'] = 'あなたはフランス人ですか?フランスが聞いた。食べ蜗牛', 
    ['你是船长，自然是你说了算。$(missioncolor:【马拉开波】)、$(missioncolor:【加拉加斯】)和$(missioncolor:【牙买加】)都有亨利•摩根的重兵把守，你好好考虑下吧。'] = 'あなたは船長、自然はあなたに大声。$(missioncolor:【马拉开波】)、$(missioncolor:【カラカス】)と$(missioncolor:【ジャマイカ】)がヘンリー・モルガンの重兵守って、あなたを考えましょう。', 
    ['你是荷兰人吗？那这里不欢迎荷兰人。'] = 'あなたはオランダ人か?ここは歓迎オランダ人だ。', 
    ['你是葡萄牙人？那这里不欢迎你。'] = 'あなたはポルトガル人?ここはあなたを歓迎した。', 
    ['你是谁？快离开这里，不然我的炮火会将你的帆船打成碎片！'] = 'あなたは谁?早くここを出て、私の砲火はあなたの帆船サモトラケ!', 
    ['你有任务在身，不宜饮酒闲谈，快去完成任务吧！'] = 'あなたが任務は、内心飲酒雑談、早く行き任務を終えましょう!', 
    ['你有没有听说过【蒂卡尔神殿】？'] = '君は聞いて【ジャコメッティカール神殿】?', 
    ['你有没有注意到他旗帜上的标志和德雷克家徽上的徽记一模一样？'] = 'あなたに気が彼の旗にのロゴやドレーク家纹の上の徽记そっくり?', 
    ['你有船在改造中'] = 'あなたの船が、改造中', 
    ['你来晚了，信息已被其他人接收'] = 'あなた遅くなって、情報が他の人に受信', 
    ['你来晚了，热销已结束'] = 'あなた遅くなって、ヒットが終わった', 
    ['你来的正是时候，我们正需要一位足够强大的勇士！几年前，不知从哪冒出来一个叫卢卡斯的家伙，将零散无序北欧海盗组织起来，四处劫掠我们的商船。'] = 'あなたが来た时、我々は十分な必要のある強力な勇士!数年前、がどこから出た奴だ、ひとつルーカス零細無秩序北欧海賊組織立ち上がって、あちこちの商船ある。', 
    ['你查找的名字不存在，请确认后再查'] = '君の名前を検索、存在確認後の再调べてください', 
    ['你根本什么都不懂！我看到掠夺者的旗帜——那是我父亲的船队！'] = 'あなたは何も知りません!私は略奪者の旗を见——それは父の船団!', 
    ['你每天最多只能送出10点体力'] = 'あなたは毎日せいぜい届け10時体力', 
