    ['你没船运排行榜奖励可领'] = 'あなたが船便ランキング奨励领', 
    ['你没设置当前船只'] = 'あなたの当面の船舶に設置された', 
    ['你消息可真灵通，怎么？想和我一起去吗？'] = 'あなたは本当に、どう筋ニュース?私と一绪に行きたいですか?', 
    ['你的S级水手已满'] = 'あなたのS級セーラー服は満席', 
    ['你的体力已满'] = 'あなたの体力がいっぱい', 
    ['你的商会在港口排名第一'] = 'あなたの商工会議所は、港湾ランキング第1位', 
    ['你的好友上限已经达到%d个了，不能再增加了'] = 'あなたの友人の上限はすでに%dの、これ以上増加した', 
    ['你的好友上限已经达到%d个了，不能再增加了。'] = 'あなたの友人の上限はすでに%dの、これ以上増加した。', 
    ['你的好友达到上限'] = 'あなたの友人が上限', 
    ['你的好运气连我都有些嫉妒呢，进阶图纸可以把这艘轻型三角帆船进阶成高阶的$(missioncolor:【武装帆船】)。这可是传说中的东西。来，快让我见识见识！'] = 'あなたの運も私も嫉妬でしょう、図面を隻の軽三角帆船進段成高レベルの$(missioncolor:【武装帆船】)。それは伝说のものだ。早く来て、私に见!', 
    ['你的工作总是出乎意料的好，达伽马已经被我遣送回国了，如果你愿意的话，让我们再次携手吧，香料群岛已经近在咫尺了啊！'] = 'あなたの仕事はいつも意外のいい、すでに私はバスコ・ダ・ガマ送還し、もしよかったら、改めて手でしょう、香料诸岛はすでに身近ですよ!', 
    ['你的慷慨明理真是让人欣慰，我们还能找到更多的帮手吗？'] = 'あなたの寛大明理実に微笑ましい、私たちには多くのコンパニオンを探すことができるか?', 
    ['你的眼睛……'] = 'あなたの目……', 
    ['你的竞技场挑战次数达到上限'] = 'あなたの競技場の回数が上限に挑戦', 
    ['你的等级低于该好友，不能资助'] = 'あなたの等級以下、この亲友支援', 
    ['你的背包已满,多余的道具放在这里了'] = 'あなたのリュックサックに満、余分な道具ここに置いた', 
    ['你的船不是军舰，正好可以装扮成商人，到马斯卡特去查探阿拉伯人的动向，如有异常，即刻汇报。'] = 'あなたの船は、ちょうど军舰が商人に扮装して调べ、マス・カーター探アラブ人の動きは、異常、直ちに报告した。', 
    ['你的行为真令人惊叹，如果是你的话一定能够找到这张藏宝图的宝藏。大海属于真正的勇士，勇敢的去挑战吧！'] = 'あなたの驚き、お前ならきっとこの枚を見つけることができる藏宝图の宝庫だ。海は真の勇士、勇敢なチャレンジしましょう!', 
    ['你的身上已存在藏宝图'] = 'あなたの体はすでに存在藏宝图', 
    ['你的？如果你不想和他一起在亚历山大的监牢里腐烂的话，就趁我没改变主意前滚吧，弱小的虫子！'] = 'あなたのですか。たくなかったら彼と一绪に、アレキサンドリアの牢獄に囚われ腐ってたら、私のうちに変わらなかったアイデア前よ立ち去れ弱小の虫!', 
    ['你的？如果你不想和斯帕罗一起在亚历山大的监牢里腐烂的话，就趁我没改变主意前滚吧，可怜的家伙！'] = 'あなたのですか。あなたと一绪に、アメリカのたくはアレクサンダーの牢獄に囚われ腐ってたら、私の前にうち変われ転がりましょう、かわいそうなやつ!', 
    ['你看过哥白尼的天体运行论吗？'] = 'あんたはコペルニクスの天体运行论?', 
    ['你看，女神也没能保护你，我们的旗舰差点被击沉。'] = 'ほら、女神も保護できなかったあなたは、私たちのフラッグハンディキャップ撃沈された。', 
    ['你真的不知道？看你小子一脸蠢样应该没什么坏心思。算了，喝酒。'] = 'あなたは本当に知らないの?贵様の顔見ない工夫をしなければならない愚か様の悪い。まあ、お酒。', 
    ['你真的买来了？还真是个了不起的小子，合我胃口。拿好，这个东西就送给你了。'] = 'あなたは本当に买った?本当にすごい食欲の贵様、合私。持っていい、このものはあなたにプレゼントした。', 
