    ['呵呵，不能说不能说，除非你拿出几瓶马赛产82年的【茴香酒】，否则我是不会告诉你的。茴香酒可是好东西啊，当年我偷偷拿会长的收藏畅饮一番，现在都记得那个香味……对了，我只能说那是个好东西，看你的样子是个航海家吧，这对于你来说有莫大的好处。'] = 'ほほほ、言わないとできない限り、あなた何本マルセイユ産82年の【フェンネル酒】、さもなければ私は教えないのだ。フェンネル酒でもいいものね、同年こっそり持って会長の所蔵ちまうよ、今もその香りを覚えて……が、私はそれはいいもので、お前の様子を见航海家でしょう、これはあなたにとって大きなメリットがある。', 
    ['呵呵，人心难测啊，人心难测……'] = 'ほほほ、人情人心惨よ、惨……', 
    ['呵呵，你自己好好想一下吧，我先出去走走。'] = 'ほほほ、あなた自身によく考えてみましょう、私は先にぶらぶら歩く。', 
    ['呵呵，如果不是看在你父亲的份上，我调开了舰队，你怎么有可能击败阿芒德那个蠢货，虽然他的野心迟早会把他自己烧毁。'] = 'ほほほ、见ない、あなたの父の部分で、私の転勤が开いた艦隊、どうして可能で、阿穂先徳あの马鹿は彼の野心はいつか自分を全焼した。', 
    ['呵呵，小妞，口号倒是喊得响亮，待会可别往吓哭了！'] = 'ほほほ、小妞スローガンを叫び、それて、高らかにびっくりしないで泣いた!', 
    ['呵呵，年轻人，这是工匠公会的信物。工匠公会是七海中闻名的中立组织。有了这个就能够请动那群臭脾气的老家伙帮忙改造船只了。'] = 'ほほほ、若者は、职人公労の目印だ。职人公労は七海で有名な中立機構だ。これはその群が请动臭い奴の老ごね手伝った改造船。', 
    ['呵呵，我找到玛利亚时才明白，她并不在意在海难中丢失的财富，只在意我能从海难中平安归来……'] = 'ほほほ、私に見つけマリア分かって、彼女は気になった中で失われた富海難だけ、私が気になるから、無事帰還海難で……', 
    ['呵呵，没什么。新消息，红胡子打算占领亚平宁，精锐尽出，他的后防必定空虚。我们可以趁这个机会干掉驻守老巢$(missioncolor:【伊斯坦堡】)的阿芒德！'] = 'ほほほ、いやだ。新しいニュース、赤髭を占拠し亚平宁つもり、精鋭尽、彼の後方には必ず空虚。我々がこの机会にふるいねぐらmissioncolor绞($:【伊アニカ・ソレンスタムファルコン】)の阿穂先徳!', 
    ['呵呵，没什么，你自己想好就行，我只是随便说说。'] = 'ほほほ、いや、自分でいいたい、私は。', 
    ['呵呵，没想到吧，今天的你就好比当年的我，你放心，我不会让你轻易死掉的。'] = 'ほほう、まさか、今日のあなたが同年の私、あなたを安心させ、私はあなたを簡単に死んだのだ。', 
    ['呵呵，现在你拥有了任命两艘船组成舰队的权限，随着爵位的提升，你会得到更多的特权，其中的好处你以后自然会明白。'] = 'ほほほ、今贵方に任命した2隻の船が構成艦隊の権限が、爵位の引き上げ、あなたが多くの特権、うちのメリットあなた以後自然わかるだろう。', 
    ['呵呵，自由？“不自由，毋宁死”是你们这些贵族老爷们的荒唐信念，我们只想活下去。'] = 'ほほほ、自由?「死」はむしろ自由で、これらの贵族のとんでもない信念を突いて生きて、ただ。', 
    ['呵呵，越是高级的船，能升的星级越多，可不要因为这艘小船而忘记自己的目标啊。'] = 'ほほ、上级の船が、リットルの星が多ければ多いほど、このボートから自分の目標を忘れよ。', 
    ['呵呵，这可是“女神的恩赐”，从那次灾难之后，我就一直将这枚克拉肯之眼当做假眼。'] = 'ほほほ、これでも「女神の恵み」は、あの災難の後、私はずっとこの個カラットケンの眼を偽の眼だ。', 
    ['呵呵，这是冒险家协会为了鼓励勇敢的冒险者探索大海，每天都会推荐一名航海士给初出茅庐的冒险家，现在先将新加入的航海士任命到船上。'] = 'ほほほ、これは冒険家協会を励ますため勇敢な冒険者探求の海に、毎日一人の航海士の推薦を駆け出しの冒険家で、今は、まず新加入の航海士船に任命。', 
    ['呵，你所谓的感谢就是在英西大海战中让西班牙舰队覆灭吧。'] = 'ああ、君のいわゆる感は、英西の海戦でスペイン艦隊を招くことさえあるだろう。', 
    ['呵，贵族华丽的袍子上都沾满了血和泪，年轻人，你的行为的确可嘉，听说你一直在寻找去前往世界尽头的凭证——女神之誓的碎片，我这里刚刚好有一块，可以将其赠送。'] = 'ああ、贵族でも派手な袍にまみれた血と涙の若者、あなたの为に、たしかに闻きしゅしょうあなたが探しに行く世界の果ての証拠——女神の誓の破片、私がここにちょうどいい、プレゼントすることができる。', 
    ['呼哈！继续前进！'] = 'ハァ哈!前进を続ける!', 
    ['呼，这里的海盗真是比沙子还多呢。'] = 'ハァ、ここの海賊は砂より多いですか。', 
    ['命运号'] = '运命号', 
    ['命运号的消息'] = '运命号のニュースです', 
    ['命运号血量>50%'] = '运命号吸う> 50%', 
    ['命运女神编织丝线，万物都在丝线上运行。'] = '运命の女神、万物が糸纺绢糸で運行。', 
    ['和'] = 'と', 
    ['和其他品种的咖啡相比，里约咖啡虽然口感较为粗糙，但胜在高产，不失为一种大众咖啡。'] = 'と他の品目のコーヒーより、リオコーヒーは口当たりが荒く、しかし勝は、一つの大衆送りこんコーヒー。', 
    ['和小麦相比，大麦不适合做面包，但可以用来酿造【啤酒、伏特加、威士忌、琴酒】。'] = 'と小麦に比べ、麦适しますが、パンが醸造【ビール、ウォッカ、ウィスキー、长髪】。', 
    ['和平使者'] = '平和の使者', 
    ['和平的条件'] = '平和の条件', 
    ['和我不用客气，希望我回来时能够带来好消息。'] = '私とどういたしまして、私の帰りに希望をもたらすことができる朗報だ。', 
    ['和拉比斯心生间隙'] = 'とトラより心生ギャップ', 
    ['和敌方保持一定距离，被“希腊火”喷到可不是开玩笑的'] = '敵の距離とされ、「ギリシャ火」にスプレーの冗談じゃないんだ', 
    ['和纯伏特加相比，葡萄酒简直就是淡果汁。'] = 'と比べ純ウォッカのワイン、まるで淡いジュース。', 
    ['和罗安达一样，这里也是由航海家迪亚士发现的。'] = 'とルアンダのように、ここも、航海家ディアス発見された。', 
    ['和贝拉米联手击退政府军，并且保护贝拉米旗舰。'] = 'と連携し、政府军を撃退クレイグ・ベラミー保護クレイグ・ベラミーフラッグ。', 
    ['咖啡豆产自牙买加蓝山山脉，这种咖啡拥有所有好咖啡的特点，味道浓郁香醇，口感顺滑。'] = 'ジャマイカ蓝山豆産山脈、このコーヒーをすべて持っているのが特徴で、コーヒーを浓い味がある、食感がサラサラ。', 
    ['咖喱'] = 'カレー', 
    ['咦！这个港口水网密布，快赶上威尼斯了。'] = 'えっ!この港に水网群がって、早くベネチアました。', 
    ['咦，船长你在说啥，问我今后的打算，噢，不用您担心，就算我比较倒霉，但我不会放弃我的梦想。'] = 'えっ、船長のあなたは、私は今後のご心配なく、ああ、ついてないが、私が、私が私の夢を諦めない。', 
    ['咦？你们不是汉萨同盟的商船，本海域严禁汉萨同盟以外的船只经过，速速离开。'] = 'えっ?君たちは漢萨同盟の商船、本海域厳禁漢萨同盟以外の船舶が、速速去った。', 
    ['咦？前面好像有什么比赛？'] = 'えっ?試合前に何か?', 
    ['咦？大叔您也知道拉比斯？'] = 'えっ?あなたも知っているおじさんより斯?', 
    ['咦？大叔您说什么？发生什么事了，怎么人们都在四散奔逃？'] = 'えっ?あなたは何かおじさんどんな事が発生しました、どうして人々が散っ奔逃?', 
    ['咦？进阶图纸？有了这个图纸我们就可以把一艘星级船只随机进化成高阶船。'] = 'えっ?\'図面?この図面を船1隻星临机進化高レベル船。', 
    ['咳~咳~~我才是船长！嗯，我说伙计们，敌人港口的第一道防线已经突破了！让我们趁胜追击！'] = '咳咳~ ~私こそ船長!ええ、私は店員たち、敵が港の第一線を突破した!我々の隙勝追撃!', 
    ['咳~咳~（热闹的酒馆安静了下来）。请问这里有赋闲的航海士找活干吗？我是 $(usename) 船长！我需要一些能干的家伙跟我到巴塞罗那对付摩尔海盗！'] = '咳咳~(にぎやかな居酒屋静まる)。すみません、ここが中高年の航海士探し活なに?私は$(usename)船長!私が一部のやり手の奴仆からバルセロナ対処ムーア海賊!', 
    ['咳、咳，拉比斯的话虽然…但也没有错，每年由于撞上浮冰而沉没于北海中的船不可胜数。我们最好改变下阵型，用护甲较高的装甲舰和突击舰将旗舰护卫在最中间。'] = '・咳咳よりは、ば……しかしも間違いではないが、毎年熊坂で沈没于北海流氷の船は勝数。私たち、変えたほうがいいでフォーメーションを护の甲の高い装甲舰と突撃艦はフラッグ护卫真ん中。', 
    ['咳、咳，拉比斯的话虽然…但也没有错，每年由于撞上浮冰而沉没于北海中的船不可胜数。我们最好改变下阵型，用护甲较高的装甲船和近战船将旗舰护卫在最中间。'] = '・咳咳よりは、ば……しかしも間違いではないが、毎年熊坂で沈没于北海流氷の船は勝数。私たち、変えたほうがいいでフォーメーションを护の甲の高い装甲船と近ベットはフラッグ护卫真ん中。', 
    ['咳咳……咳咳……好像失败了呢。'] = 'エヘンエヘン失敗したらしいね。', 
    ['咳咳……并不是我不信任你们，但这批货物对我很重要，你们必须在市政厅压一笔保证金。'] = 'エヘンあなたは私の不信が、次の貨物は私に対してとても重要で、君たちは必ず市庁圧一ペン保証金。', 
    ['咳咳，多谢您，善良的船长。强盗，该死的强盗！他们掳走了我们所有人，把我们当成奴隶，进行惨无人道地虐待。我趁他们不备，跳海逃生。要不是您，我这条命就……呜……'] = '、お咳、善良な船長。強盗、人でなしの强盗!彼らをさらおた私たちのすべての私たちは、奴隷を虐待、残忍に。私の隙を尽くし、彼らの海を跳び避难。じゃ、お命が……グスッ……', 
    ['咳咳，差点忘了还有这回事。辛西亚，现在去交易所把存货出售，换取继续强化所需的银币吧。'] = '咳も、そんなことを忘れていた。今行く辛西、在库を売り、売却取引を継続して強化するに必要な銀貨だろう。', 
    ['咳，喝多了莫名其妙帮人跑了趟腿。对了，戴肯叔叔，您帮我看下，这个锤子是什么？'] = 'ああ、飲みに行った嫌味なされ走った脚。ケンは、おじさん、お见てくれの下で、この槌は何ですか。', 
    ['咽喉之争'] = '喉の争い', 
    ['哀嚎之城'] = '悲鳴の城', 
    ['品阶：'] = '品段:', 
    ['哇哦！这么一大笔钱！命运真是不公平，我怎么就不是个大富商呢？'] = 'うわっ!こんなに大金!运命は不公正ではない、私は大豪商?', 
    ['哇！竟然是一名不错的航海士！'] = 'わあ!一人はなんといい航海士!', 
    ['哈伯特'] = '哈ベルト', 
    ['哈伯肖'] = 'ハーバー肖', 
    ['哈利路亚！'] = 'ハレルヤ!', 
    ['哈哈哈！幼稚！有什么能比掠夺来钱更快？我虽然败给了你，但为了葡萄牙的荣耀，我无怨无悔！'] = 'はっはっは!幼稚!何よりも早く来てお金が略奪?私はあなたのために敗れたが、ポルトガルの栄光、私で过ごす!', 
    ['哈哈哈！这就是对抗葡萄牙的下场。'] = 'はっはっは!これが対抗ポルトガルの退場した。', 
    ['哈哈哈，当你直面过死亡之后，宝藏金币又算得了什么呢？不过是尘土里的一粒尘埃，海浪中的一滴水珠罢了。'] = 'あははははは、あなたの直面死亡した後、财宝金货、なんでしょうか?しかし一粒の尘の中には、波の水滴尘だ。', 
    ['哈哈哈，我虽然在金钱方面不够敏感，但这是我的会计师辛西亚的强项，她在千里之外就能嗅到金币的味道。'] = 'は、は、は、私は金銭面が足りない敏感だが、これは私の会計士辛の強みと、彼女は千里の外货の味が埋。', 
    ['哈哈哈，斯堪的纳维亚已经是我的囊中之物！现在，我们该干正事了！'] = 'は、は、は、すでにスカンジナビアは私の食い物!今、私たち正事やる! ! ! ! ! ! !', 
    ['哈哈哈，目的？这一片海域都在我的掌控之下，自东印度公司出现之后抢走了我的货物，伤害了这里的子民，我不过想还这片海域清净罢了。'] = 'は、は、は、目的?この海域はすべて私の支配の下には、東インド会社が後を奪われた私の貨物を伤つけた、ここの民が、私はこの海域と清浄だ。', 
    ['哈哈哈，难得还有人念我的好，我心甚慰，我心甚慰啊！'] = 'は、は、は、せっかく読んで私のいい人も、甚だ快心の心、甚だ快よ!', 
    ['哈哈！欢迎来到【萨格里什】，你在巴塞罗那的战绩已经随着海风飘到我这老耳朵里了呢！有啥我能帮得上忙的？'] = 'ハハ!ようこそ、【萨格里ニコフ】、あなたはバルセロナの戦績は海が私にこの老耳にね!が私に手伝えることが?', 
    ['哈哈！痛快的战斗！真令人精神舒爽啊，老师，尽管把剩下的都派出来吧！'] = 'ハハ!痛快な戦い!実に精神のけるあ、先生、ず、残りの派遣も来てください!', 
    ['哈哈，一个女儿家多管闲事，口气还如此狂妄！来人啊，给我把她……'] = 'ハハ、娘の家は、このおせっかい息生意気な!誰か、私は彼女を……', 
    ['哈哈，不是这样的，我能说这是因为我娶了我叔叔的女儿吗？他是加勒比地区英军指挥官。'] = 'ハハ、そうじゃないの、私はこれは私が私の叔父の娘と結婚したか?彼はカリブ海地域英国軍指揮官。', 
    ['哈哈，他跑不掉啦！'] = 'ハハ、落ちないよ!', 
    ['哈哈，你以为摩尔人的战船从哪里来？【突尼斯】是北非重要的工业港，海盗所驾的【三桅卡拉维尔】就是在这里制造的！'] = 'ハッと思って、あなたのムーア人のベットはどこからくるの?【北アフリカのチュニジア】は重要な港で、海賊が工業矜の【三桅カラオケウィル】は、まさにここで製造する!', 
    ['哈哈，你以为摩尔人的战船从哪里来？【突尼斯】是北非重要的工业港，海盗所驾的【三桅卡拉维尔】就是在这里制造的，投资市政厅可以解锁船厂。'] = 'ハッと思って、あなたのムーア人のベットはどこからくるの?【北アフリカのチュニジア】は重要な港で、海賊が工業矜の【三桅カラオケウィル】は、まさにここで製造の投資による、市役所の明。', 
    ['哈哈，你又输了！'] = 'ハハ、あなたはまた负けて! ! ! ! ! !', 
    ['哈哈，你这个不服输的气势还真像你的父亲。你说得没错，我就是虫子，一只懦弱的虫子……这个信物你拿好，记住，一定要亲自保存好。'] = 'ハハ、あなたこの负けず嫌いの勢いはまるであなたの父。おっしゃるとおり、私は虫が一匹、臆病の虫……この目印ていったら、必ず覚えて、直接保存した。', 
    ['哈哈，兄弟们来支援了'] = 'ハハ、兄弟たちに支援した', 
    ['哈哈，再见啦！'] = 'ハハ、さよなら!', 
    ['哈哈，冲着宝物我也要完成试炼啊，我也早已迫不及待啦！'] = 'ハハ、私も宝物完成试练ですね、私もすでにせっぱつまってよ!', 
    ['哈哈，原来是这事儿，这很简单，我的远房叔叔就是女王的顾问呢。我这就带您去见他。'] = 'ハハ、なるほど、これはとても简単で、私の远いおじさんは女王の顧問のだろう。私はこれでご彼に会った。', 
    ['哈哈，又击沉一艘！货物归我们啦！'] = 'ハハ、1隻も撃沈さ! ! ! ! ! !貨物われわれのよ!', 
    ['哈哈，增援又来了'] = 'ハハ、増員が来た', 
    ['哈哈，年轻人，生活本就是不公平，你要做的是去适应它。这个世界才不会在意你的抱怨，你要在自我感觉良好之前先有所成就。'] = 'ハハ、若者、生活は不公正な、お前のはそれに适応する。この世界があなたの愚痴を気にしないで、あなたは自分でよく感じまで先が成就。', 
    ['哈哈，我会的。祝你们好运！'] = 'ハハ、私の。祈ります! ! ! ! ! !', 
    ['哈哈，我刚在码头听说英国海军才赶到汉堡来，他们还真是不紧不慢。'] = 'ハハ、私は闻いたばかりで、英国海軍埠頭に駆けつけ、彼らは本当にハンバーガーおっとり。', 
    ['哈哈，我喜欢这情景！'] = 'ハハ、私の好きな光景!', 
    ['哈哈，我无法拒绝命运的召唤……我同意，来【酒馆】喝一杯吧，敬自由！'] = 'ハハ、私は拒否できない運命の召唤に……私に同意し、来【居酒屋】饮みましょう、敬自由!', 
    ['哈哈，收获果然丰厚，辛西亚你干得不错。'] = 'ハハ、収获はやっぱり手厚、辛アシ君がいい。', 
    ['哈哈，正是德雷克海峡，说起来这一伟大发现我还得感谢西班牙人。'] = 'ハハ、まさにドレーク海峡、そもそもこの偉大な発見はスペイン人に感谢。', 
    ['哈哈，没错，我的确是犯了天大的错误，那就是错信了你这个懦夫、叛徒！要不是你的蛊惑……'] = 'ハハ、そう、私は确かに犯した過ちを与えよ、それは间违いの信じたあなたのこの成り金や裏切り者!あなたの残照じゃ……', 
    ['哈哈，猜对了！我保证这是最后一次……糖人的味道不太吸引人，我想收购一些香料混进去。'] = 'ハハ、即席! ! ! ! ! ! !これは私が保证し最後の……糖人の味不太人、私の入った。買収香料混', 
    ['哈哈，谢谢你，我相信我一定会找到老船长继承人，一定！'] = 'ハハ、ありがとう、私きっと探し当てて老船長、後継者必ず!', 
    ['哈哈，这个消息大概会让达尔布克基那家伙头痛咯！原来背后支持敌人的竟然是威尼斯人！'] = 'ハハ、このニュースがたぶんように基あいつ头痛よ!なるほど背後支援の敵はなんとベネチア人!', 
    ['哈哈，那我记住了，如果是你这样的“入侵者”，我会坚持不持寸铁，“和平”的抗争来取得胜利吧！现在，让我们面对真正的恶魔吧。'] = 'ハハ、それを覚えたのは、あなたのような「クラッカー」は、私に寸铁ず、「平和」の抗争で勝利ましょう!今、私は本当の悪魔だろう。', 
    ['哈哈，阿芒德，你可小心别被炮弹轰在了屁股上！'] = 'ハハ、阿穂先徳が、気をつけて打った砲弾が尻に!', 
    ['哈哈，鲨鱼被我抓住了！嚯！鲨鱼肚子里居然有%s本【%s】和%s个【%s】，真是好运气。'] = 'ハハ、私がつかめたサメ! ! ! ! ! !嚯!サメお腹が%s本【%s】と%sつ【%s】、運がよかった。', 
    ['哈夫尔'] = 'haff爾', 
    ['哈密顿岛'] = '哈密トン島', 
    ['哈尔.安德森'] = 'ハウル。アンダーソン', 
    ['哈尔伯特'] = 'ハウルベルト', 
    ['哈弗斯王朝都城，地处地中海地区的中央，拥有长达1300公里的海岸线。'] = 'ハーバーード斯王朝の都、地中海地域の中央、正井保有1300キロの海岸線。', 
    ['哈德孙湾'] = '哈徳孙湾', 
    ['哈德孙湾位于北冰洋边缘海，伸入加拿大东北部内陆的大海湾 。北经福克斯湾与北冰洋相通，东北通过哈德孙海峡与大西洋相连，向东南伸出部分是詹姆斯湾，是一个近乎封闭的内陆浅海。以英国航海探险家哈德孙的名字命名。'] = '哈徳孙湾北極海端に、伸入カナダ東北部の内陸の大湾岸。朝経フォックス湾、北極海と通じ东北通哈徳孙海峡や大西洋につながり、向东南部分は詹姆斯湾伸ばし、閉鎖の内陸沖合いに近い。イギリスの航海の探検家の孫の名前。', 
    ['哈扎尔'] = '哈ゆえ爾', 
    ['哈拉尔德'] = 'ハラルド徳', 
    ['哈拉帕'] = 'サハラパスカル', 
    ['哈比'] = '中央', 
    ['哈洛斯'] = '哈洛斯', 
