    ['哈瓦那是加勒比海上的明珠。'] = 'ハバナはキャリビアンベイ海上の名手。', 
    ['哈迪斯的隐身头盔'] = 'ハーデスヘルメットの身', 
    ['哈迪斯蒂'] = '・・', 
    ['哈里安·该顿'] = 'ハリーの安・同食', 
    ['哈里森'] = 'ハリソン', 
    ['哈！对方提出单挑决斗？我来接受挑战！'] = '哈!相手が単挑决闘?私を受け入れて挑戦!', 
    ['哈！那些是你的战船？我还以为是肥美的鳕鱼呢！嗯，我现在就要穿过直布罗陀海峡，如果你们能拦住我的话！'] = '哈!それらはあなたのベット?私はと思ったのか肥美鱈! ! ! ! ! !ええ、私は今通り抜けなければジブラルタル海峡、あなたが私を投げつけたら!', 
    ['哈！靠这些不堪一击的船能拦住我？满帆，准备突击！'] = '哈!これらの船で耐え難いこと私に引っかか?満帆、突撃用意! ! ! ! ! !', 
    ['哈，是阿芒德的手下，肯定是私自离队趁机劫掠打秋风之人，正找不着人出气呢，这些家伙正好！'] = 'ケンは、阿穂先徳の部下、任意脱退はきっとある打秋风绝命の人、正见つからない人ね、ちょうど愤こいつら! ! ! ! ! !', 
    ['哈，来到琉球啦？这里在中国古代被称为“蓬莱”、“瀛洲”，被中国古人认为是海外仙境，是一个非常美丽的地方。'] = '哈、琉球とか?ここは中国古代の「蓬莱と呼ばれる」、「瀛す」、中国は、古人は海外のワンダーランドはとても美しい所だ。', 
    ['哈，这老头兀自没搞清楚状况，你的传记已经开启啦。'] = 'はぁ、この爷僕わからない状況で、あなたの伝記はすでに开とか。', 
    ['响应求助'] = '助けに応じ', 
    ['哎……我可怜的族人，他们明明过着与世无争的生活，却要被侵略者屠戮。我的身体流淌着印加的血脉，我一定要拯救他们。'] = 'ねぇ……私のかわいそうな族、彼らの生活していたのに、大地は侵略者屠戮されなければならない。私の身体に流れるインカの血筋を、私は必ず彼らを救う。', 
    ['哎呀，你也没很厉害呀，连旗舰都差点被击沉。'] = 'あら、あなたもすごいよ、売場も撃沈されそうだ。', 
    ['哎，也不知道这么做对不对。'] = 'ねえ、も知らないのに、いやだ。', 
    ['哎，热那亚年轻的小伙子们都去做水手了。'] = 'おや、ジェノアの若い男たちがやったセーラー服。', 
    ['哎，说了你也不懂！药引就是……大理石屑，好像很难找的样子……不过麦加的有出售【石雕】的，我买一些让我敲下石屑就好了。'] = '「おや、あなたも分からない!薬を……大理石の屑は、まるで探しの姿……しかしメッカにある石造の売却【】の、私を买って私の下で石を叩いたフケがいい。', 
    ['哎？我怎么跑马赛来了？哦，对了，貌似是有个老人家让我帮他买$(missioncolor:【茴香酒】)带回$(missioncolor:【巴士拉】)，头好晕，赶紧带回去睡一觉。'] = 'え?私はどうした?走りマルセイユあ、そうだ、老人らしいのが私は彼missioncolor:【买$(フェンネル酒】)missioncolor持ち帰っ$(:【バスラ】)、头がふらふらする、さっさと持って帰って寝た。', 
    ['哟，亲爱的船长，没想到你的速度还是很快的。'] = 'よ、亲爱なる船長、まさかあなたのスピードも速い。', 
    ['哥伦布'] = 'コロンブス', 
    ['哥伦布一直因为新大陆是印度。'] = 'コロンブスの新大陸からはインドだ。', 
    ['哥伦布是意大利人，但他代表西班牙出海。'] = 'コロンブスはイタリア人が、彼の代表スペイン海。', 
    ['哥伦布是马可·波罗的狂热粉丝。'] = 'コロンブスはマーク・ポロの熱狂的なファンだ。', 
    ['哥伦布的儿子是殖民地的第一位总督。'] = 'コロンブスの息子は植民地の初の総督。', 
    ['哥伦布的弟弟带人建立了圣多明各城。'] = 'コロンブスの弟を持った人の聖ドミニコ城。', 
    ['哥伦布第三次航海就是从塞维利亚出发的。'] = 'コロンブスの第3次航海はビヤを出発した。', 
    ['哥伦布说我们是印度人，然而我根本不知道印度在哪儿。'] = 'コロンブスはインド人で、しかし全く知らないインドはどこだ。', 
    ['哥本哈根'] = 'コペンハーゲン', 
    ['哥本哈根，一个有着维京血统的城市，更是“维京之子”的大本营！'] = 'コペンハーゲン、一つはバイキング血統の都市、更に「バルハラ・ライジングの息子」のベースキャンプ!', 
    ['哥特人'] = 'ゴシック人', 
    ['哥白尼是个虔诚的修士，他不认为日心说违背圣经。'] = 'コペルニクスは敬虔な修士、彼とは思わない日心说聖書に反する。', 
    ['哦不！这是魔鬼的印记！'] = 'ないよ! ! ! ! ! !これは悪魔の落款!', 
    ['哦！抱歉'] = 'よ!申し訳ありません', 
    ['哦，你总算来了！好吧，我承认，我们之前错了！谁也没想到 阿尔伯特·希勒 竟然是想自己霸占整个北海！'] = 'ああ、やっと来た!いいでしょう、私を认め、私たちの前に間違った!谁もまさかアルベルト・希勒はなんと自分全体占拠北海!', 
    ['哦，我很抱歉！'] = 'あ、申し訳ありません! ! ! ! ! !', 
    ['哦，我真不想离开这个美丽的地方，眼看着美味的水果即将成熟却要离开，真是让人痛苦呢。'] = 'ああ、本当に私を离れたくないのがこの美しい地方が、みるみるおいしい果物が成熟しは、本当に人を離れなければならない苦痛だろう。', 
    ['哦，是他……然后呢？'] = 'ああ、彼は……それから?', 
    ['哦，看来自由航海联盟举办的竞技比赛又拉开帷幕了。每位到达20级的航海家都可以参与进来。想当年我就是在竞技场中结识了获得连胜的你父亲，真是热血澎湃的岁月啊。'] = 'ああ、どうやら自由航海連盟主催の競技でまた幕ました。到着1人当たり20級の航海家も参加できる。私はスポーツ万能、競技場で知り合った連勝のお父さん、本当に热血こみ上げ歳月のね。', 
    ['哦，那它到底有什么用途呢？'] = 'ああ、それはいったい何の用途だろうか。', 
    ['哦？一个中国人，在雅加达很少见到中国人。'] = 'ね?中国人は、ジャカルタ少ない中国人に会った。', 
    ['哦？你也和阿芒德有仇怨？该死的阿芒德，凭着一艘坚固的新船，抢走了我发现的宝藏。还轻视我们女人，说大海是男人的世界，女人连船和宝藏的保不住，还是回家抱孩子什么的，气死我了！'] = 'ね?あなたもと阿穂先徳が仇怨?人でなしの阿穂先徳、1隻の堅固な新船を奪われた、私の宝を発見。私は、女は軽視海は男の世界、女の船や宝蔵のさえ守れ、それとも帰って子供を抱いて、むかむか私なんて! ! ! ! ! !', 
    ['哦？你们也和阿芒德有仇怨？要教训阿芒德，算上我一个！'] = 'ね?君たちもと阿穂先徳が仇怨?なら、教訓に阿穂先徳一!', 
    ['哦？你倒是对自己很有自信。嗯……这个任务交给你也不是不行，不过希望你们不要拖我们皇家海军的后腿！'] = 'ね?あなたは自分自信がある。うん……この任せあなたもだめ、しかし引きずってほしい我々レアル・海軍の後足!', 
    ['哦？你想去那种鬼地方？条件。'] = 'ね?そんなあなたに行きたいん?条件。', 
    ['哦？我倒是挺佩服你的勇气！不过既然想让我帮你，那得答应我收拾阿芒德，并帮我找回命运号！'] = 'ね?私はとてもあなたの勇気に感心して! ! ! ! ! !しかしどうせあなたさせたい、それに応じる収拾し、阿穂先徳を取り戻してくれ运命号!', 
    ['哦？挑战么，那就来吧！没有什么可以阻挡我！'] = 'ね?挑戦じゃ、来う!私は何を防げる! ! ! ! ! !', 
    ['哦？这个漂亮的姑娘可不是个简单的角色，先把她$(missioncolor:【任命】)到副舰吧；经商也是每个舰队壮大必须的一环。'] = 'ね?このきれいな娘じゃ、まず簡単な役は彼女を$(missioncolor:【任命】)から副艦う;商も毎月艦隊の一環として成長しなければならない。', 
    ['哦？这可不是等价交换，我可是花了大价钱的。'] = 'ね?これは等価交换、私でも花の大値段。', 
    ['哪怕是最低级的船舶宝物对于现在的我而言也是不可多得的提升，我们现在就去看看到底能兑换什么宝物吧。'] = 'たとえ最低级の船舶の宝物は今の私にとってもかけがえのないアップ、いったい何を见ましょう。両替宝物', 
    ['哪里冒出来的小鬼！自寻死路！'] = 'どこの小僧をふき! ! ! ! ! !、破滅へ!', 
    ['哪里来的家伙胡乱嚷嚷，不会是阿芒德的同伙吧？准备好我的火炮……'] = 'どこの奴は、やたらに騒ぐのは阿穂先徳相棒のでしょうか?私の自走砲を用意し……', 
    ['哭泣的果阿'] = '泣いた果阿', 
    ['哲巴尔'] = '哲バコ', 
    ['哼哼，从今以后，斯堪的纳维亚就是我的了！我要把无数商品倾销到奥斯陆来，我要夺走他们手中的每一个金币，再让他们积压着的货物变得一文不值！哈哈！'] = 'うなり声、これから、スカンジナビアのは私の! ! ! ! ! ! !私は无数の商品に来て、私のダンピングオスロを彼らの手から一金货、また彼らの貨物が滞っている値しない!ハハ!', 
    ['哼哼，算了，不谈这个了。既然好不容易把女神之誓碎片凑齐，就让我们庆祝一番如何？ '] = 'ブンブンしない、まあ、このした。どうせせっかく女神の破片を誓そろって、お祝いはどう?', 
    ['哼！你有什么好……好怕的，不过是海盗而已。'] = 'ふん!何かいい……怖いのは、海賊だけだ。', 
    ['哼！你知不知道你惹了多大的麻烦，还一副无所谓的样子。'] = 'ふん!あなたを知らないのがあなたを怒らせ、面倒は平気な様子。', 
    ['哼！倒没想到你挺有几分天赋，这么快就赚了不少钱，当年我在加勒比海从事海上贸易可没这么容易。'] = 'ふん!まさかあなたは幾分倒れお似合い才能、こんなに早くお金を儲けて、同年私はカリブ海従事海上貿易がそう簡単だ。', 
    ['哼！希望将军您的行动也要快些，别到时候被我们先攻下汉堡！'] = 'ふん!ご希望の将軍の行動も早くその先に、我々が攻めハンバーガー!', 
    ['哼！我知道你担心什么，放心，我肯定会带你去到“世界的尽头”。'] = 'ふん!君、心配安心、私きっとあなたを持って行くから「世界の果て」。', 
    ['哼！看来正如郑公子所言汪直与丰臣秀吉有着关系，肯定是汪直余孽带着女神之誓投靠丰臣秀吉去了，追上去！'] = 'ふん!どうやら鄭公子がとおりワン直と豊臣秀吉は、肯定的な関係はワン直余孽女神の誓を連れて行き、蹂躙した豊臣秀吉追いかけて!', 
    ['哼！真实？这个世界没有真实！'] = 'ふん!リアル?この世界の真実がない!', 
    ['哼，不自量力！'] = 'ふん、身の程知らず!', 
    ['哼，不要以为亨利王子对你不错我就不敢对你怎样，马上离开这里，耽误王子大计你我都担待不起。'] = 'ふん、ヘンリー王子、あなたはとてもいい、あなたはどのように、すぐにここを出て、あなたと私も取りかえ王子の大計担待払えない。', 
    ['哼，决不能放走他，用力打使劲抽！'] = 'ふん、決して银时、吸い彼力ん! ! ! ! ! !', 
    ['哼，原来如此，怪不得我上次功亏一篑。'] = 'ふん、なるほど、私前回精魂。', 
    ['哼，可恶的家伙，我会去找亨利王子证实，不过，你就祈祷霍金斯不要再遇到我吧！'] = 'ふん、畜生奴、ヘンリー王子を探し、でも、あなたは祈祷ホーキング斯二度と私に会ってましょう!', 
    ['哼，正义？真是可笑的字眼，什么是正义你真得明白吗？年轻真好，可以无所顾忌地自以为是。算了，霸主信物就在我手中，既然你想击败我，那就来吧。'] = 'ふん、正义?本当におかしいの言叶、何が正義あなた本当にわかりますか?いいことに、若い光景独善的。まあ、覇者の目印は、私の手で、あなたと私、それは来るでしょう。', 
    ['哼，没看出来你还是个挺有钱的船长嘛'] = 'ふん、なかったのですよ。お金持ちの船長', 
    ['哼，红眉毛绿眼睛的我们实力还可以吧。'] = 'ふん、赤眉绿の目は私たちの実力がいいでしょう。', 
