    ['好吧，那你以我葡萄牙特使的名义，先去北方以寻求结盟的名义来寻找其它的女神之誓。这里有我的推荐信，你拿着它先到$(missioncolor:【伦敦】)试探一番吧。'] = 'いいでしょう、あなたは私のポルトガルの特使の名目で、先に行って北方で片づけるの名義を求めて他の女神の誓を探した。ここが私の推荐君、これを持って先に$(missioncolor:【ロンドン】)探りましょう。ひと', 
    ['好吧，那你听好了，卡瓦略·雷耶斯。我们不会像老师一样教导你，但是会像伙伴一样和你并肩作战。如果你愿意的话，就加入我们吧！'] = 'いいでしょう、あなた、卡瓦略・レ。私たちは先生のように教えが、仲间のようにあなたと並んで作戦。もしよかったら、私たちに加入しましょう!', 
    ['好吧，那我可就不客气了……哈哈，终于可以鸟枪换炮了……现在先将新船设置进入舰队。'] = 'じゃ、私は遠慮なく……ハハ、ついに鸟枪换炮できる……今は新しい船に艦隊に設置された。', 
    ['好啦好啦，我们会给【市政厅】投资一笔钱让你们维修港口的。'] = 'はいはい、を【市庁】投資大金修理しろの港。', 
    ['好啦好啦，药材齐啦！'] = 'はいはい、薬剤斉啦!', 
    ['好大一块礁石，我们可别撞上去了！瞄准！让我炸掉它！'] = '大きな禿岩礁が、ぶつけた!照準!私の爆発!', 
    ['好大一条鱼！抓住它兄弟们就能美餐一顿了！准备撒网！'] = '1条鱼!兄弟たちはそれを待つ! ! ! ! ! ! !ローブ準備! ! ! ! ! !', 
    ['好大的炮'] = '大炮の', 
    ['好大的雾！没有瞭望镜，我什么也看不清，只能祈祷迷雾快快散去。'] = 'いい大の雾!私は瞭望镜は、何もわからないことを祈るしかない、早く晴れ雾。', 
    ['好好想想吧，是走上血与火的霸者之路，还是就此退出！'] = 'よく考えて、窓ぎわには血と火の覇者の道か、脱退!', 
    ['好好留意一下，附近可能有玛雅人的遗迹。'] = 'よく注意可能、付近のマヤの遗迹だ。', 
    ['好想运几头骆驼回欧洲去。'] = '君に数头运ラクダヨーロッパに。', 
    ['好望角'] = '希望岬', 
    ['好望角也叫风暴角，经常有杀人浪出现。'] = '希望岬の名前も暴風の角を、よく殺人の浪が出た。', 
    ['好望角到印度的航线发现后，波斯湾的贸易逐渐衰落。'] = '希望岬からインド航路の発見後、徐々に衰退に停泊中の貿易。', 
    ['好望角是葡萄牙国王命名的。'] = '希望岬はポルトガル王と名付けられた。', 
    ['好望角是非洲大陆的最南端。'] = '希望岬は、アフリカ大陸の最南端だ。', 
    ['好望角有许多危险的海洋生物'] = '希望岬は多くの危険の海洋生物', 
    ['好望角的东南方是牧人湾。'] = '希望岬の東南は蒙湾。', 
    ['好望角经常起雾'] = '希望岬よく雾', 
    ['好望角航道开通后亚历山大已无复往日荣光。'] = '希望岬の水路開通後アレキサンドリアが無復かつて栄光。', 
    ['好望角被称为世界上最危险的航海地段的主要原因是？'] = '希望岬と呼ばれ、世界で最も危険な航海地点の主な原因は?', 
    ['好望角连通着大西洋与哪个海域？'] = '希望岬とつながっていた大西洋どの海域?', 
    ['好样的！哎，你终究还是没有找到你的父亲，我为此感到悲伤。'] = 'すごい!ねえ、あなたはとうとう见つからないあなたのお父さん、私のために悲しい。', 
    ['好消息是这次我和你们一起去！还等什么，快出发吧！'] = '朗報は今回、君たちと一绪に!なども、早く出発しましょう!', 
    ['好深的心机。我想，霍金斯和国王权杖也在你手中吧。'] = '良い深いジャン・クリストフの。思うに、ホーキング斯と国王权杖も、お前の手でしょう。', 
    ['好的船长'] = '良い船長', 
    ['好的，将这艘$(missioncolor:【轻型三角帆船】)加入到舰队，我们即刻出航！'] = 'はい、この隻$(missioncolor:【軽三角帆船】)に加入し、出航!すぐ艦隊', 
    ['好的，我马上就去【马斯卡特】，但愿你们的老朋友也能够缓过来。'] = 'はい、私はすぐに行き【マス、カーター】あなたの友人が来ても遅い。', 
    ['好的，船长。其实我心理预期是15帝国钻石币，没想到您这么痛快地就答应了，您放心，我……'] = 'はい、船長。実は私は心理的な期待15帝国ダイヤモンド造幣と、こんな痛快なお返事をいたしました、安心して、私は……', 
    ['好的，那真是麻烦大叔了，我现在就购买新船扩大舰队。'] = 'はい、それは本当に迷惑おじさん、私は今新しい船購入拡大艦隊。', 
    ['好运'] = '幸', 
    ['好运的年轻人，你刚好进爵为五等男爵获得进阶轻型三角帆船的权限，现在又有了进阶图纸，我们当年可没有你这么好的运气啊。'] = '幸运の若者、あなたはちょうど召しあげ\'五など男爵を軽三角帆船の権限が、今また俳优たちが、その図面にこんなにいい运势ですね。', 
    ['好运还是不幸？'] = '幸か不幸か。', 
    ['好！为了能够找到父亲，我无所畏惧。'] = 'いい!父のために、私を見つけることができる所なし。', 
    ['好！年轻人，有气魄！“白棉布”杰克的势力盘踞在$(missioncolor:【哈瓦那】)、$(missioncolor:【梅里达】)和$(missioncolor:【巴拿马城】)，希望能听到你们胜利的消息。届时，我会赐予你们丰厚的赏金。'] = 'いい!若者は、覇気!「白い手ぬぐい」のジャックの勢力に巣くう$(missioncolor:【ハバナ】)、$(missioncolor:【梅里达】)と$(missioncolor:【パナマシティ】)、勝利のニュースて聞こえた。皆さん、私から授かった赏金豊かだ。', 
    ['好！霍金斯，我一定会制裁你！'] = 'いい!ホーキング、私はきっと制裁あなた!', 
    ['好，资金还很充裕，我们一步到位。哈哈哈哈……'] = 'よし、資金は、いきなり余裕がある。ハハハハ……', 
    ['好，资金还很多，我们一步到位，哈哈哈哈……'] = 'よし、資金も多く、いきなり、ハハハハ……', 
    ['好，这个港口已经是我们的囊中之物了！'] = 'よし、この港はすでに私たちの食い物! ! ! ! ! ! !', 
    ['如你所愿，年轻人，希望我的同行能够给你带来帮助。'] = 'あなたが、若者、私の同行があなたに役に立つ。', 
    ['如你所见……这里的情况糟糕透了，海盗洗劫了商铺，我们计划重开港口，但是连足够的货源都没有了。'] = 'あなたの所见……ここの場合、最悪、海賊が略奪した店舗計画再開が、港の十分な供给もなかった。', 
    ['如您所言！的黎波里的防御力量比突尼斯更强大，敌人果然将这里作为了基地。'] = '桥本おっしゃるとおりで!トリポリの防御力よりはもっと强く、チュニジア敌としてはやっぱりここ基地だ。', 
    ['如来佛'] = 'やめ', 
    ['如果 蒲丽雅 说我愿意援助，那我就愿意援助咯，不过，我只能让我的人帮忙建设城防炮台，我的舰队正跟马六甲的苏丹交战呢！'] = 'もし蒲丽雅は私の支援、じゃあ私は望まね、でも、私の支援は私の人に手伝って城防砲台建設、私の艦隊とマラッカのスーダン交戦だろう!', 
    ['如果你们能到【汉堡】向消息灵通的阿尔伯特·希勒打听一下海盗的动向，并且消灭他们，我想你们肯定能赢得我们女王的青睐。'] = 'もしあなたが【ハンバーガー】、消息筋のアルバート・希勒海賊の動向を闻く、そして彼らを灭、私たちがあなたをきっと女王の人気。', 
    ['如果你们能协助我们皇家海军击败那些见利忘义的家伙，我想女王会接见你们的。'] = 'もし私が協力を破っ见利忘义ロイヤル・海軍それらのやつ、私があなたの接見女王。', 
    ['如果你坚持的话，我很乐意向达尔布克基大人转达你的意思。'] = 'もしあなた坚持すれば、喜んで向达尔大人に基あなたの意味を伝えた。', 
    ['如果你想反悔，最好现在说。'] = 'たければ、今は思い直す。', 
    ['如果你抱有希望的话！这个可恶的海角把我的舰队给毁了！我休整后就回航了，我听说达伽马的船队也在这附近，你要小心他！'] = 'あなたならば希望! ! ! ! ! !この畜生の岬、私の艦隊を台無しにした!私はゆったりした後、回航聞いた船団はバスコ・ダ・ガマはこの近くに、あなたも気をつけなければならない!', 
    ['如果你这么想，就是本末倒置了，难道你所做的一切，就是为了得到朝廷的承认？那我真是看错你了。'] = 'もしそう思うが、本末転倒、まさかあなたのやったことは、朝廷の承認を得るために?それを见た私は本当にあなたを间违えた。', 
    ['如果在海上遇到龙卷风，不知道会被吹到哪里。'] = '海上にすれば、竜巻、知らないのがどこまでに吹かれた。', 
    ['如果山不走过来，那我就走过去。'] = 'もし山がやってきて、あれは私は歩いた。', 
    ['如果我们完全用欧洲人的方式生活，那我们还是自己吗？'] = 'もし私たちが完全に用のヨーロッパ人の方式を、それは自分の生活?', 
    ['如果我们绕着太阳转，为什么我不会头晕呢？'] = 'もし太陽を回る転、どうして私はめまい?', 
    ['如果我因为带回这美妙的商品而成为里斯本最有名的会计师，我可一定也不会意外呢！'] = 'もし私この素晴らしい商品を持ち帰って最も人にリスボンの会計士、私も意外ですね!', 
    ['如果我真是小女生，就不可能在大海之上遇上狂风暴雨时，还能对其他水手指挥若定并且安全度过暴风雨。'] = 'もし私が、本当に小さい女の子は不可能だが、海の上に強風と大雨は、まっぷたつに、他のセーラー服を指揮し过すれば安全に岚。', 
    ['如果我能在竞技场里取得胜利，那么对于我的探索和影响力一定会有所帮助，那么，去试试看吧，听说奖励还非常丰厚呢！'] = 'もし私が、競技場で勝利して、それでは私の探求と影響力はきっと役に立つ、それなら、やってみましょう、インセンティブはとても豊かですね!', 
    ['如果是平常我肯定臭骂你，但是现在老娘没有力气，你要去谢谢俞红袖小姐，是她救了我们。'] = 'いつもならば私きっとあなたを骂倒が、今力がない、あなたなんかに行くユ红袖さん、ありがとうございました。私は彼女を助けた', 
    ['如果有人问玛丽，是否惧怕绞刑架，她会哈哈大笑后告诉你：“绞刑并不可怕，如果没有绞刑，那么胆小如鼠的人都能成为海盗了！”'] = 'もし、闻か绞刑架マリーを恐れ、彼女がげらげら笑って、「后あなたは恐ろしい、絞首刑なかったら、胆小如鼠絞首刑の人もが海賊!」', 
    ['如果没有背后政权的支持，没有任何一个公司能够做到东印度那样的程度，说到底东印度公司不过是皇宫贵族们的走狗罢了。'] = '背後に政権の支持がなかったら、どの会社ができる程度の東インドのように、あくまで東インド会社は皇居の贵族たちの走狗だ。', 
    ['如果能够选择，没人会选择当奴隶而不是主人。'] = 'もしが選択できる人がいないし、奴隷は主人をでた。', 
    ['如果船长您不是面带狂笑留着口水看着箱子中的蓖麻说出这番话，我一定会相信您的。'] = '船長はかきけすようにお連れは面箱の中の蓖麻生やして唾を見て発言し、私はきっとあなたの信じた。', 
    ['如果距离足够近，请让我带领水手向敌舰发起【突击】！'] = 'もし距离を近くさせてください、十分私にセーラー服を率いる巨艦発議【突撃】!', 
    ['如果距离足够近，请让我带领水手向敌舰发起突击！'] = 'もし距离を近くさせてください、十分私に突撃を率いる巨艦セーラー! ! ! ! ! !', 
    ['如果过几天的话我一定会考虑，但最近广州在举办美食节，正是我大显身手的时候。'] = 'もし数を考慮したら必ず私が最近、広州、开催美食节こそ、私の大活跃するの时。', 
    ['如果遭遇海盗是无法避免的事，那么也许大多数人会宁肯遇上的是黑男爵的手下。因为只要放弃抵抗，就不会有比损失财物更不幸的后果。'] = 'もし遭っ海賊は避けられないのかもしれないことなら、多くの人がなるのは黒男爵の部下だ。抵抗すれば、あきらめない被害物件よりもっと不幸な結果だ。', 
    ['如果问每一个商船的船长，谁才是他们最畏惧的海盗王，无疑“黑胡子”爱德华·蒂奇的名字会无数次被反复提起。这个曾经参与过英西海战，在欧洲、非洲和新大陆之间的“金三角”航线上大发其财的海盗王，以他残忍及果敢的行动让所有贸易船主不寒而栗，甚至连军舰，都不愿意遇上这个可怕的海上魔鬼。'] = 'もし问一商船の船長、谁が彼らの最も恐れていた海賊王、「黒ひげ」エドワード・ジャコメッティ奇の名前を何度も缲り返した。これがかつて参加した英西海戦は、欧州、アフリカと新大陆の間の「金三角」路線にかっとその財の海賊の王、彼の残忍と果敢な行動すべての貿易の船主さえ、ぞっとする、軍艦を望まないこの恐ろしい魔物の海上だに。', 
    ['如获至宝'] = '引き込まれるよう', 
    ['妇女'] = '女性', 
    ['妇女是使世界不至毁灭的支柱，男人则设法推动历史向前发展。'] = '女性は灭の世界の支柱を明瞭に、男はなんとか歴史を前进。', 
    ['妖刀村正'] = '妖刀村正', 
    ['妮可'] = '妮可', 
    ['委 任'] = '委任', 
