    ['委任可以自动经商获得金币，离线后您的舰队可以自动委任。'] = '自動を委任し、商売金貨オフライン後あなたの艦隊が自動的に委任した。', 
    ['委任数次不足'] = '何不足の委任', 
    ['委任次数+1,体力购买次数+1'] = '委任回数+ 1 + 1、体力の購入回数', 
    ['委任次数+2,体力购买次数+2'] = '委任回数+ 2、体力購入回数+ 2', 
    ['委任次数+3,体力购买次数+3'] = '委任回数+ 3、体力購入回数+ 3', 
    ['委任次数+4,体力购买次数+4'] = '委任回数+ 4、体力購入回数+ 4', 
    ['委任经商'] = '委任経常', 
    ['委任过程中，所有东西都买光了'] = '委任過程で、すべてのものが买った', 
    ['姬尔'] = '姬尔', 
    ['姬恩'] = '姬恩', 
    ['威士忌'] = 'ウィスキー', 
    ['威尔士人。喜欢穿华丽的黑色礼服并满身佩戴珠宝，过贵族生活，处事疯狂专断，却要求部下遵守规矩。不仅掠夺商船，连海军也从不放过。'] = 'ウェールズ人。黒いドレスを着た派手好きにして、全身ジュエリー贵族生活、処世狂気の横暴は、部下のルールを守ら要求。略奪商船だけでなく、海軍も见逃さない。', 
    ['威尔士人。大庄园主的儿子，凭着勇气、智慧和残忍，30多岁就当上了英国海军高级军官，同时被海盗们推举为牙买加海盗总头目。'] = 'ウェールズ人。ハン庄园主の息子、勇気と知恵と残忍、30代で英国海軍高級将校とともに、海賊たちに推されジャマイカ海賊総头目。', 
    ['威尼斯'] = 'ベネチア', 
    ['威尼斯一直试图重夺地中海霸权。'] = 'ベネチアずっと夺回地中海の覇権を試みた。', 
    ['威尼斯公爵'] = 'ベネチア公爵', 
    ['威尼斯共和国曾经长期控制着这座城市。'] = 'ベネチア共和国が長期制御している都市。', 
    ['威尼斯向教皇请求，组建神圣同盟以对抗势力越来越庞大的奥斯曼帝国海军。'] = 'ベネチアに構成し、法王請求圣同盟は対抗勢力が膨大なオスマン帝国の海軍。', 
    ['威尼斯商人都是贪得无厌之徒。'] = 'ヴェニスの商人はスナッチの徒だ。', 
    ['威尼斯常见的尖舟叫作贡多拉。'] = 'ベネチアのありふれた尖舟ヒ・トング贡に加勢した。', 
    ['威尼斯是最强大的海上共和国。'] = 'ベネチアは最も强大な海上共和国。', 
    ['威尼斯是著名的水城。'] = 'ベネチアは有名な水。', 
