    ['年纪轻轻便思虑过重，会有少年白头的危险。你们不是在寻找女神之誓碎片吗？我可以告诉你们它在谁的手上，可是这个人心狠手辣，实力强劲，你须得向我证明自己，我才会告诉你这个人是谁。'] = '若くして大人が過度に、少年の白頭の危険。君たちは、女神の破片を探して誓?私が皆さんそれは谁の手に、しかしこの人とても残酷、あなた、強豪返礼に、私はやっと自分にこの人は谁だ。', 
    ['年轻人不要着急，现在正是冒险家协会发放奖励的时刻，免费的东西不要白不要，我们一起过去领取吧。'] = '若者焦って、今こそ冒険家協会の発給インセンティブの瞬間、無料のものでないと、白い过去受給だろう。', 
    ['年轻人你要想清楚，你这样做不仅会得罪亨利王子，还会与荷兰人为敌。'] = '若者のあなた、よくこうたいあなただけでなく、ヘンリー王子ファーガソン・マンチェスター・ユナイテッドとオランダの人為的な敵だ。', 
    ['年轻人，“邪恶的号角奏响，海水无法熄灭的火焰降临”，我们还是暂避锋芒为好。'] = '若者が、「悪のラッパができ、海水が消えるの炎」やっぱり、進入をかわす。', 
    ['年轻人，你们竟然还在码头大摇大摆！难道不知道吗？你们突袭伊斯坦堡的消息已经传开了，听说巴巴罗萨正率领他的庞大舰队往回赶呢！'] = '若者は、君たちが、埠頭]!まさか知らないんですか?君たちの奇襲、ニュースが伝わったのは、やけに羅サルトルを率いている彼の巨大な艦隊ポルジェ追い出されですね!', 
    ['年轻人，你先别忙着拒绝，我知道你在寻找着什么东西。一种散发着粉色光芒，氤氲着神秘气息的名叫古兰圣珠的宝石对不对？'] = '若者が、あなたに忙しい、あなたを拒否し、何かを探す。一种の轮郭を放つて、ピンクの光という神秘の息吹クラン聖珠の宝石でしょう?', 
    ['年轻人，你现在的样子真像你的父亲。宿命，是否会归于一线呢……'] = 'あなたの今の若者に、あなたの父の様子がまるで。宿命、复帰するかどうかの一線だろう……', 
    ['年轻人，你现在这艘小船当旗舰确实有些勉强，不过没关系，在之前战斗中获得的金币是可以用来强化船只装备的，你只需要进入舰队进行$(missioncolor:【装配研究】)，就能极大提升火炮的威力。'] = '若者、あなたは今このボートは少し无理がフラッグ、でも大丈夫、前に戦闘で得た金货は強化できる船舶装備の、あなたに必要なだけの艦隊を$(missioncolor:【組み立て研究】)には、大きな自走砲の威力を引き上げた。', 
    ['年轻人，你看我说的没错吧，大学者安度因的弟子，自然不简单……'] = '若者が、私のいったとおりでしょう、大学者が筑の弟子、自然は简単ではない……', 
    ['年轻人，你这又是何必呢？这样的性格将是你在日后航程中的阻碍。'] = '若者に、これはまたわざわざあなた?あなたのような性格は、今後の航海中の妨げ。', 
    ['年轻人，在北海，对于舰队来说最危险的并非是海盗，而是随处可见的浮冰。'] = '若者は、北海艦隊にとって、最も危険なのは、海賊のではなく、あちこちの流氷。', 
    ['年轻人，快走！“邪恶的号角奏响，海水无法熄灭的火焰降临”！'] = '若者が、急げ!「悪のラッパができ、海水が消えるの炎」!', 
    ['年轻人，我们刚从海盗手中缴获的金币可以升级船只装备，只要进入舰队进行$(missioncolor:【装配研究】)，应对之后的战斗可能会轻松一些。'] = '若者たちは、最初からの金货が海賊载以グレードアップすれば、船舶装備に艦隊を$(missioncolor:【組み立て研究】)、対応可能后の戦いが少しは楽になる。', 
    ['年轻人，我来给你介绍一下。这是西印度公司总督彼得松·霍因。此次前来，是为商谈联手对抗东印度公司的事情。你有没有带来迪欧·霍阿将军的消息？'] = '若者に、绍介した。これは西インド会社総督ピーター松·か弱く、。今回は、手を相談対抗の東インド会社のこと。あなたはリディアにか弱くオリックス·阿将軍のニュース?', 
    ['年轻人，我自然是要控制整个印度洋了。我可不是黑斯廷斯那个蠢货，一味的强硬只会带来无止境的反抗，而当海盗入侵，统治者无能为力，实力大减，而我再以救世主的身份出现……'] = '若者が、私は自然を制御するインド洋た全体。私は、あの马鹿ばかりヘースティングスの強硬に无限の抵抗だけに、海賊の侵入を取り直す統治、実力に大きなマイナスで、もう一度、救世主として……', 
    ['年轻人，新消息称阿芒德的地盘——$(missioncolor:【突尼斯】)最近有些异动，说不定与拉比斯有关……'] = '若者が、新筋は阿穂先徳の所——$(missioncolor:【チュニジア】)最近、ちょっと異动よりかもしれないとは関係……', 
    ['年轻人，有消息称阿芒德的地盘——$(missioncolor:【突尼斯】)最近有些异动。拉比斯说不定就在那里。'] = '若者は、筋は阿穂先徳の所——$(missioncolor:【チュニジア】)最近少し異动。トラよりはそこかもしれない。', 
    ['年轻人，没时间感慨了。卢卡斯的旗舰就在前方。让我们突击过去给他点颜色看看！'] = '若者が、时间ない感慨をした。ルーカスのフラッグが前方。私は彼に突撃过去时色!', 
    ['年轻人，这仅仅是一门最初级的火炮，对于你的战力提升不太显著。你需要宝物精华来对它进行升阶。'] = '若者が、これはただ一门の最も初级の自走砲、あなたの戦力を著しくない。あなたが宝物エッセンスをして升段。', 
