    ['想要穿行中国东南沿海，没有郑家的保护令旗，是一件非常危险的事。你不知道那些神出鬼没的海盗啥时候就会出现在你的船上。'] = '中国の東南沿海咲き誇るたい、郑家の保護令旗は、大変危険なことだ。あなたの知らない、神出鬼没の海賊いつがあなたの船だ。', 
    ['想要进行谈判，即刻'] = '交渉をしようと、直ちに', 
