    ['想追击我？先过了我盟友这关吧。'] = '私と追撃?この先にあった私の盟友関だろう。', 
    ['意为“在水面上跳跃的船”。因其外观船体狭长，速度轻快而著称，深受航海家们的喜爱。'] = '意为「水面上ジャンプの船」。、その外観船体の细长い国、軽快で有名で、スピードが航海家たちの好き。', 
    ['意外之财'] = '意外の財', 
    ['意外奖励：'] = '意外なインセンティブ:', 
    ['意大利人。原本是威尼斯的医生，看到了药品贸易的可观利润后做起了海商，但因摩尔海盗的劫掠损失惨重。擅长节约开支却不擅长创造财富。'] = 'イタリア人。もともとはベネチアの医者、见えた薬品貿易の利益を海商始めたが、海賊のあるムーアの損失を被った。得意、节约は苦手な富を生み出した。', 
    ['意大利人。威尼斯的吟游诗人，穷困潦倒的日子里和一个老水手出海寻找出路，喜欢在甲板上用曼陀林弹奏哀伤的情歌。'] = 'イタリア人。ベネチアの吟游诗人、困穷の日に海と老マリノスに活路を求めて、甲板で好きなマンドリンを弾く哀しみのラブソング。', 
    ['意大利人。家族是佛罗伦萨财阀，父亲因商业丑闻入狱后家道中落，吉安带着弟妹生活，在众人的冷嘲热讽下一直为了恢复祖辈的荣耀而努力。'] = 'イタリア人。家族はフィレンツェ、財閥の父親がビジネススキャンダル投獄以来零落を持って、吉安義弟の生活が、人の冷笑の下まで先祖の栄光を回復するために努力した。', 
    ['意大利人。标准的意大利美男子，优雅健谈、魅力四射，晋升之路十分顺遂，三年就当上了大副。是海上有名的单身贵族，因为太过完美总是被怀疑取向。'] = 'イタリア人。基準のイタリアの美男子で、优雅におしゃべり、魅惑的に、昇進の道は、三年に後藤にうきた。海上の有名な独身贵族は、いつもあまりに完璧疑われた趣向だ。', 
    ['意大利人。波隆那大学的问题学生，因为讥讽政局被开除。退学后开始做水手，被誉为“海上政治家”，一直将船作为一个小型社会模型来研究。'] = 'イタリア人。波隆その大学の問題のため、皮肉学生政局除籍された。中退後から、セーラー服と呼ばれた「海上政治家」としては、船の模型小型社会を研究した。', 
    ['意大利人。生于水手之乡热那亚，是地圆学说的坚定信奉者，他坚称从欧洲往西航行，横穿大西洋是抵达东方国度的最近路途。'] = 'イタリア人。セーラー服の郷、生まれはジェノアに丸い说の信奉者を固めながら西ヨーロッパから、彼の航海は、大西洋を横断到着东の国の最近の道のり。', 
    ['意大利人。维克多的童年好友，对维克多英俊的容貌不屑一顾，经常讽刺挖苦，实际上却非常珍惜这份友谊，经常帮维克多摆平暗处的敌人。'] = 'イタリア人。モレノさんの幼馴染みのハンサムなルックス、モレノさん、よく嫌味見下し皮肉が、実は、よくこの友情を大切にして敌の里摆平陰地モレノさん。', 
    ['意大利人垄断了胡椒贸易，促使葡萄牙人开拓了前往印度的新航线，使之成为风靡欧洲的香料。'] = 'イタリア人を独占し、ポルトガル人胡椒貿易を開拓したインドの新航路に、欧州の香料を風靡した。', 
    ['意大利人撰写的炼金术知识大全，有人按照上面步骤实验但总是失败，可能哪里搞错了？'] = 'イタリア人の錬金术、知識大全通り実験上の手続きが、いつも失敗し、どこか间违った', 
    ['意大利人撰写的玻璃制作工艺说明，作者是为哥特式教堂制作彩色玻璃的技师。'] = 'イタリア人に書いたガラス工芸说明を、著者はゴシック教会制作カラーガラスの技師だ。', 
    ['意大利人，军人出身，觉得军队中的生活太过拘束而毅然下海。向往驾着破船自由驰骋在地中海的生活，是个没心没肺、天真率直的人。'] = 'イタリア人、軍人出身で、軍の中の生活を思うあまりに穷屈で下海を敢行。憧れて自由を駆け回っ矜宝船地中海の生活は、没心没肺、无邪気で率直な人。', 
    ['意大利天才里奥纳多·达·芬奇绘制并撰写的医学书籍，详细绘制了人体结构，有点可怕。'] = 'イタリアの天才で、余りレオナルド・ダ・ヴィンチの医学書籍を執筆し、詳細に描いた人体構造、ちょっと怖い。', 
