    ['成就界面'] = '成就インタフェース', 
    ['成就：'] = '成就:', 
    ['成果不错啊，英国红茶到现在依旧是畅销品！跟着商船出海即安全又有钱挣，是一个不错的工作。后来发生了一件事，我放弃了这个工作……'] = '成果が悪くなくて、英国の红茶今までは畅销品!跟着商船出航安全でお金を稼ぐのは良い仕事。その後で発生した一件の事、私はこの仕事を放棄した……', 
    ['成熟，当务之急是想办法如何在汉萨同盟的垄断下争得北海的利益。'] = '成熟し、何とか急務はどう、漢萨同盟の独占で北海の利益を作り上げる。', 
    ['我'] = '私', 
    ['我——奥斯曼海盗之王，会亲手把你们一起解决掉。'] = '私——オスマン海賊の王、君たちと一绪に落ちて逃げ道を解決する。', 
    ['我……我的月饼……全毁了……。'] = '私は……私の月饼……全半壊した……。', 
    ['我、你、你们……啊……不要打我英俊的脸……'] = '私、あなた、あなた……あ……ハンサムな顔を殴らないで……', 
    ['我、我没、没醉，也就是穿梭几个大漩涡的事，等、等着啊。'] = '私を、私は、酔も、シャトルいくつかの大涡のこと、など、などだ。', 
    ['我一定会回来的！'] = '私はきっと帰ってきた! ! ! ! ! !', 
    ['我一定会找到老船长继承人，一定会！'] = '私はきっと、後継者を見つけ老船長は必ず!', 
    ['我一定能甩开你们的！'] = '私はきっとあなたを振り切った! ! ! ! ! !', 
    ['我一直不太明白，黄金宝石不也是普通石头吗？'] = '私はよくわからないが、黄金の宝石も普通の石?', 
    ['我丈夫三年前去跑生意，之后再没回来。'] = '3、私の夫に跑生意後に戻って来なかった。', 
    ['我不会跟你争夺这个荣誉的，不过“风暴角”可不是一个让人欢乐的名字，它让我们看到了更广阔的世界，为何不叫它“好望角”呢？'] = '私はあなたと争い、この栄光の「暴風の角」は一人の名前で、歓楽をもっと広い世界を见た、なぜ「喜望峰」か?', 
    ['我不太清楚圣乔治是什么意思。'] = '私にはよく分からないジョージはどういう意味だ。', 
    ['我不如地狱，谁入地狱。'] = '私は地狱、谁か入狱。', 
    ['我不懂你们为什么要定居下来，到处迁徙不好吗？'] = '私には分からないあなたがなぜ、あちこちに定着移動が悪いの?', 
    ['我不是将军，也不是海盗，我只是我自己。'] = '私は将軍でもなく、私はただ、自分の海賊。', 
    ['我不管，你答应过我要替我找回命运号的，否则别想我带你去世界的尽头。'] = '私も、あなたと约束した私が私の运命を取り戻すと、さも号の私へ連れて行って世界の果てだ。', 
    ['我为我的伙伴骄傲！只可惜，现在只剩下我和大副安东尼奥了……'] = '私は私のパートナー自慢!ただ惜しいだけ、今私とうきだけが残ったサンアントニオ……', 
    ['我为我的族人对你们所犯下的罪行道歉。'] = '私は私の族が君たちの犯した罪の謝罪。', 
    ['我之前对于正义的理解太肤浅了，从你们身上我们看到真正的正义，希望你们能把光复正义的智慧传授予我！'] = '私の前は正義の理解は、浅薄すぎるあなたに本当の正义を、お光復正義の知恵伝授与私!', 
    ['我也明白，但我不愿就此抛却任何一艘曾经陪伴我的船。我已经提升到爵位到三等男爵，可以进阶【轻木帆船】，让它以全新的姿态伴随我们继续战斗。'] = '私もわかる、私がこれをほうり出してたくないいかなる一隻の船がつきそい私。私はすでに三等にまで引き上げ、爵位男爵关键木帆船】【軽い、私、新たな姿に伴う戦い続ける。', 
    ['我也是一名水手，船上才是我的家。'] = '私も一人のセーラー船こそ、私の家。', 
    ['我也是这么想，如果我真的打捞了沉船，一定可以将玛利亚迎娶进门，但是没有一个人找到那些宝藏，见鬼，包括我！'] = '私もそう思うならば、私は本当に沈没引き揚げた、かれはマリアが、一人であらう、その宝をひるがえし、私!', 
    ['我也正有此意，因马尼拉海盗的埋伏，我们损失了不少人手，如果几位能协助我们，双方合力一举剿灭陈祖义，真是感激不尽。'] = '私もこの意味があるが、マニラ海賊の待ち伏せ、少なく、損失を被った。人手すれば、双方の協力数知り合いたち陈祖义剿灭合わせて一挙に、本当にありがたい。', 
    ['我也知道这很困难，但我不会放弃，除非有一天我也死去。'] = '私も知っているが、これとても困难を放棄しない限り、私はある日私も死んだ。', 
    ['我也觉得十分奇怪，难道是霍金斯从某些特殊渠道弄来的装备？'] = '私もとてもおかしいとは、ホーキングは、いくつかのチャンネルで特殊装備?', 
    ['我也觉得很很奇怪，但现在也不好突然上前发问，只能静观其变。'] = '私もとてもおかしいが、今突然、お母様も悪い质问がなされるしかない。', 
    ['我亲爱的船长，感谢你用勇气和牺牲为我们带来这场重要的胜利！'] = '私の亲爱なる船長、ありがとう用の勇気と犠牲をわれわれにこの重要な胜利!', 
    ['我从小就在长辈的关照下经营海上贸易，父母去世时我答应过他们，不让他们失望。'] = '私は小さい时から、よろしく目上の下で経営海上貿易、親が亡くなった時私と约束した彼らは、彼らに失望した。', 
    ['我从小就想见识到世界各地所有珍稀的货物，海上的风险都吓不到我的。'] = '私は小さい顷から见たいから世界各地の貨物をすべて珍しい海上のリスクがびっくりして到私の。', 
    ['我从没去过更远的地方，还是部落里最安全。'] = '私は一度も行ったことも、遠くのところに最も安全。', 
    ['我从没见过一个人的眼睛像他一般贪婪和冷漠，如果 马丁·金 无法说服他不再贩卖同胞，那么霍金斯迟早会卷土重来！'] = '私は一度も见たことのない人の目は彼の一般强欲と冷たさ、もしマーティン・金説得できないなら、彼は人身売買同胞ホーキング斯遅かれ早かれ捲土重来!', 
    ['我从船头搜到船尾，终于找到%s个【%s】，和这件古老的宝物【%s】，再看看有没有其他东西吧！'] = '私は船首から船尾狩り、やっと见つけ%sつ【%s】と、この古い宝物【%s】、再か他のものだろう!', 
    ['我以那个暴戾的家伙是我的同胞为耻！而我千里迢迢赶来也绝不是为了躲在舷墙后看热闹，请允许我，加入防御部队吧！'] = '私はその想像の奴は私の同胞を耻!私からはるばるもないためには隠れ、艦橋壁を见物させてください、私に加入し、防衛部隊ましょう!', 
    ['我们不像海盗只在乎掠夺，要得到开展贸易的许可需先获取信任，让我们到【市政厅】为港口的繁荣做些贡献吧！'] = '私たちは、海賊に受ける略奪、貿易の許可を得なけれ、まず信頼から【市庁】港の繁栄を贡献ましょう!', 
    ['我们不关心历史，我们只关心未来。'] = '我々は、関心の歴史だけに関心を未来。', 
    ['我们不崇拜钱和权力，只崇拜最优秀的猎手。'] = '我々は、お金と権力崇拝だけ崇拝の最も优秀な狩人。', 
    ['我们不想向贪婪的国王交税。'] = '私の欲に税金たく国王。', 
    ['我们不是强盗'] = '私たちは强盗', 
    ['我们不生产粮食，我们只是大自然的搬运工。'] = '我々は、食糧生産我々は自然の少し考えろ。', 
    ['我们不能再让他背负更多的责任，请给他庇护。'] = '彼はより多くの责任を背负って、彼に庇護ください。', 
    ['我们也比在突尼斯的时候更强大！打起精神，让敌人看看我们舰队的实力吧。'] = '私たちは、チュニジアのときよりも、もっと强く!元気にさせて、敌の舰队の実力だろう。', 
    ['我们亏欠赛维·达·汉太多了，当初他试图通过与殖民者贸易来保护部落，但却遭到了我们的驱逐。'] = '我々がクラシック次元·激賛・漢すぎて、彼を通じて当初試みと入植者保護貿易来部族されたが、私たちの追放。', 
    ['我们会向你证明我们的信誉，但你必须为你无礼道歉。'] = '私たちがあなたたちの信頼を立証しなければならないが、あなたがあなたのために无礼を謝罪。', 
    ['我们击败卢卡斯是仅仅因为是因为正义而已，并不求其他回报，如果是我的父亲在这里，他也一定会做和我的一样的事情。'] = '私は下しルーカスだけではない、正義だけ他の見返りに求すれば、ここは私の父は、彼も必ずやると私のと同じ事だ。', 
    ['我们刚刚从商会兑换了些物资，不过还需要水手宝物来武装自己才行。毕竟在丛林遗迹之中，处处充满了危机。'] = 'いま両替し、商工会議所が、何の物資も必要で、ようやく自分のセーラー服の宝物武装行。结局、ジャングルの遗迹の中で、処に満ちた危機。', 
    ['我们到了，英国最负盛名的出海港口之一—普利茅斯。'] = '私たちに、英国の最も有名な海の港の一つ——〔プリオシン。', 
    ['我们原住民的烟草在你们那里很受欢迎。'] = '私はあなたの原住民タバコそこが人気だ。', 
    ['我们可以买一些货物到【文莱】去售卖。'] = '我々が买貨物【ブルネイ】行き贩売。', 
    ['我们可以去【亚丁】附近的海面转转，那些私掠船一定就潜伏在不远处。'] = '我々が行く【亜丁】近くの海面すれすれ船、あれらのコキコキ私きっと昏迷に潜んで。', 
    ['我们向%s商会发起了商会战，本次商会战将持续24小时。'] = '%s商工会議所に挑戦した今回の商工会議所の戦、商工会議所戦24時間。', 
    ['我们向%s商会发起了商会战，本次商会战将持续30分钟。'] = '%s商工会議所に挑戦した今回の商工会議所の戦、商工会議所戦で30分続けた。', 
    ['我们在东南亚还有未解锁的港口,'] = '我々は、東南アジアの港、まだ未解除', 
    ['我们在北海还有未解锁的港口,'] = '我々は北海また未解除の港、', 
    ['我们在印度洋还有未解锁的港口,'] = '我々は、インド洋の港、まだ未解除', 
    ['我们在地中海还有未解锁的港口,'] = '我々は地中海の港、まだ未解除', 
    ['我们在非洲还有未解锁的港口,'] = 'アフリカでも未解除の港、', 
    ['我们好像比预期到的早了些，这么空着手过去拜访彼得松·霍因有些失礼。这样，辛西亚去采购些礼物，其余人就地解散，好好休息一天，一天后在此集合。'] = '我々のように予想より少し早い、こんなに空に过去访ピーター松·か弱く、ちょっと失礼。そう、辛アリマシアル購買にプレゼントし、残りの人即座に解散し、ゆっくり休んで一日一日を、この集合。', 
    ['我们对佛得角的地形不熟悉，与其等着被伏击，不如直接进击海盗的大本营--比绍，收拾掉敌人，才能安心的进行贸易呢。'] = '我々は佛得角の地形、など知らないされ、直接连続サラウンドアラック数より进撃海賊の本山である比绍始末、安心してこそ、敌の貿易だろう。', 
    ['我们已有同盟商会了，需要解除原有同盟后再请求缔结同盟关系'] = 'が、我々の同盟商工会議所が従来の同盟再請求解除後締結同盟関係だ', 
    ['我们已经击败了%s，成为%s霸主，试着去挑战其他海域吧！'] = '私たちはすでにで破ったs %、%s覇者に行ってみて、他の海域に挑戦しましょう!', 
    ['我们已经击败了对手%s,提升了名望和地位，赶快领取奖励迎接新的挑战吧！'] = '私たちはすでにで制し%s、昇進した地位名望と、さっさと受給奨励新しい挑戦を迎えましょう!', 
    ['我们已经在东印度建立了自己的公司。'] = '我々はすでに東インド会社を作ったのだ。', 
    ['我们已经完成了目标，让我们去'] = '私たちはもう完成した目標を行った', 
    ['我们已经完成了老希勒的使命，回到【汉堡】向他复命，不知道会得到什么奖励呢？'] = '私たちはもう完成した老希勒の使命を彼に戻って【ハンバーガー】地球が得られるか、知らない奨励?', 
    ['我们已经获得了15枚竞技星徽了，这有什么用？'] = '我々は15個の競技星纹しました、これは何に使いますか?', 
    ['我们已经获得了最先进的战舰，让我们去'] = '私たちは、最先端の戦艦行った', 
    ['我们应该靠近遗迹【%s】了，沿海岸线进行搜寻，点击遗迹访问遗迹'] = '近づくべき遺跡【%s】、海洋、沿海州をクリック遺跡訪問遗迹だ', 
    ['我们当然可以成为伙伴，加入我的船队怎么样？'] = '我々はもちろん仲间になり、私の船団はいかがですか。', 
    ['我们得想办法对付那些强大的炮塔。'] = '我々の何とか対処あれらの强大炮塔。', 
    ['我们必须尽快“靠近”被俘的商船才能营救他们。如果商船进入霍尔木兹海峡，我们就没法追上了。'] = '「なら早く近づく」捕虏の商船が彼らを救出。もし商船にホルムズ海峡、我々はできに追いついた。', 
    ['我们必须给他们一个教训。'] = '彼らに必要の教訓だ。', 
    ['我们必须赶快到【第乌】去。'] = 'すぐにしなければならない【第烏】行く。', 
    ['我们必须阻截敌人，让苏菲尽快摆脱对方，只要回到港口，她就安全了！'] = '戦わなければならない敵から脱し、ソフィー相手にすれば、港湾、彼女は安全! ! ! ! ! ! !', 
    ['我们快回【圣乔治】去吧。'] = '早く回【セント・ジョージ】行きましょう。', 
    ['我们快回【大阪】去吧。'] = '早く回【大阪】行きましょう。', 
    ['我们把货物都给你们，有好酒，好肉，好鱼！我们投降！'] = '私は、货物の皆さんに良い酒、よい肉、鱼!我々投降!', 
    ['我们收到撤退回来船只的信息，赶过来支援你们！'] = 'われわれの船舶情報、撤退帰って駆けつけ支援! !', 
    ['我们攻下了文莱，陈祖义那边一定已经有所防备了，接下来的行动必须更加小心才行'] = '我々が攻めて陈祖义ブルネイ、きっともうあっちが備えなければならないし、次の行动をさらに注意', 
    ['我们攻占了敌方商会据点，望大家再接再厉。'] = '我々は敵攻略拠点を抜かず、みんな商工会議所。', 
    ['我们是为郑和的遗物而来。'] = '私たちは郑和の遺物で来た。', 
    ['我们是从中国来的。'] = '私は中国から来た。', 
    ['我们是太阳的子孙。'] = '我々は太阳の子孙。', 
    ['我们是威尼斯在亚得里亚海上唯一的竞争对手。'] = '我々はベネチアはアドリア海で唯一のライバル。', 
    ['我们是经过伟大的女王允许的。'] = 'われわれは偉大な女王の許可を経た。', 
    ['我们有了新的船只，并且在与敌人的战斗中学习到了新的舰队阵型！您需要进行新的配置，那样对战斗有极大的帮助。'] = '私たちが、そして新しい船舶、敵との戦いに新しい艦隊フォーメーション勉强し! ! ! ! ! !あなたが、そんな新しい配置、戦闘のために役に立った。', 
    ['我们有足够的航海士信物了，试试信物招募吧。'] = '我々が十分な航海士、目印した试公募神仏だろう。', 
    ['我们本来就打算向贵军请求援助，如此最好。'] = '我々はもともと、贵軍の援助を要請した。この最高', 
    ['我们来决一死战吧！'] = '私の一騎打ちましょう!', 
    ['我们来得及时，否则这一切都可能会被破坏殆尽，这也更坚定了我阻止达尔布克基的决心，不要耽误时间了，继续驰援$(missioncolor:【泉州】)。'] = 'ほう、そうにすべてが破壊されかねないが、これも私の决意を阻止するには尔の决心を取りかえしない时间、引き続き向かっ$(missioncolor:【泉州】)。', 
    ['我们正在洽谈合作的事宜，自从东印度公司溃败之后，这片海域愈发混乱了起来，盗贼四起，我正想请彼得松先生帮助我们清缴海盗，保护我的国家。'] = '我々が商談協力について、東インド会社が胎動後、この海域はますます混乱して、盗贼が沸き上がり、私と松さんを助けてください清缴ピーター海賊、保護私の国。', 
    ['我们正好缺一个像火药一样烈的火炮手，将【汉娜】任命为'] = '私たちはちょうど一つ欠けて火薬のように烈の自走砲手は、任命【ハンナ】', 
    ['我们每一次战役靠的可不是幸运女神的眷顾，靠的是实力，东方有句话说的很好，兵来将挡水来土掩，无论陈祖义设下什么陷阱，最终我们都会获胜！'] = '1度だけじゃ戦闘の幸運の女神の摂理なのは、実力、东方のいいという言葉が、水来土掩兵来将挡、いくら何陈祖义新設の下、最終的に勝利を罠たち! ! ! ! ! !', 
    ['我们没能保护好“吉达号”，任务失败了...'] = '「私たちが守る吉达号」、任務の失败した…', 
    ['我们用牲畜和你们交换各种谷物。'] = '我々は家畜に君たちと各種の穀物交換。', 
    ['我们的事业是正义的，红胡子。我会加入神圣同盟，亲手赐予你失败。'] = '私たちの事業は正義の、赤髭。私は神圣同盟加入、直接あなたの失败から授かった。', 
    ['我们的国王同时也是神圣罗马帝国的皇帝。'] = '我々の国王と同時に神聖ローマ帝国の皇帝。', 
    ['我们的国王被处死之后，印加帝国成为了西班牙的傀儡。'] = '我々の国王で処刑された後、インカ帝国の傀儡となったスペイン。', 
    ['我们的城市被称为伊比利亚半岛的明珠。'] = '私たちの都市と呼ばれた韓半島の名手。イベリア', 
    ['我们的大副又在吵吵嚷嚷了，真是的，身为一个航海士一定要稳……那是，拉比斯！走，快跟上！'] = '我々のうきまたざわざわした、本当に、一航海士として必ず安……それは、より!歩いて、早く追いつい!', 
    ['我们的征途是星辰大海。'] = '我々の立つは星辰海。', 
    ['我们的总督才是加勒比海最大的强盗。'] = '我々の総督こそカリブ海の最大の强盗だ。', 
    ['我们的总督是一个伪善的贩奴者！'] = '我々の総督は伪善者の贩奴! ! ! ! ! !', 
    ['我们的总督是印度殖民地的建立者。'] = '我々の総督はインドの植民地の設立者。', 
    ['我们的木工已经无法应付这样的巨舰，走，去酒馆碰碰运气，说不定能遇到一位合适的木工。'] = '我々の大工に対応できなかったが、こんな巨艦、居酒屋、かしこに一運かも適切な大工。', 
    ['我们的目标是【摩尔运奴船】，别去招惹那些船坚炮利的护卫舰！'] = '我々の目標は【ムーア运奴船】、やめてそれらのなす船坚炮利護衛艦!', 
    ['我们的舰队已经集结完毕了，让我们为了生命的平等而战！大地母亲一定会护佑着我们！启程！目标--莫桑比克！'] = '我々の艦隊が结集したために済ませ、生命の平等で戦!大地母はきっと私护佑! ! ! ! ! !旅立ち!目标——モザンビーク!', 
    ['我们的资金十分充足，再次升级装备，强力的火炮才是男人的浪漫'] = '我々の資金の充実、再びアップデート装備、強力な自走砲が男のロマン', 
    ['我们目前为本港口第一商会，无法与其它商会缔结同盟关系'] = '我々は現在本港第1商工会議所で、他の商工会議所と締結同盟関係だ', 
    ['我们相信，年纪越大的人越有智慧。'] = '私を信じ、取るほどの知恵のある人ほど。', 
    ['我们终于可以多一艘船了吗，船长。太好了，这下不用在晚上窝在小船舱里听辛西亚数金币，蒂奇甩皮鞭和汉娜调试火枪的声音了。谢天谢地，我能睡个好觉了。'] = '我々がついに多一隻の船をしたか、船長。よかった、これでなくては夜、小さな船室に巣を闻いて、辛アリマシアルジャコメッティ奇数金貨フラ鞭とハンナ段取の銃筒の声がした。やれやれ、私がぐっすり眠りました。', 
    ['我们被包围了，向西航行，快，利用地形，在他们靠近酒桶时攻击水面的酒桶！'] = '私たちに囲まれた、西に航海を利用し、早く、地形は、彼らが近づく時水面の樽樽攻撃! ! ! ! ! !', 
    ['我们被打败了，提升船只、装配或者航海士的能力后重新挑战吧！'] = '私たちを破った、船舶、組立や航海士の能力の後に再挑戦しましょう!', 
    ['我们要想前往“世界的尽头”，还真是少不了她。走吧，等找到她，说什么都要好好教训一顿！'] = '私たちに「世界の果てたい」と、彼女は本当にせた。行こう、などとは、何もちゃんと教訓!', 
    ['我们认识的第一个欧洲人叫达·伽马。'] = '我々の第一の欧州人は·スイフト。', 
    ['我们该为接下来的征程赚取更多的金钱！记得航经每一个港口都到交易所看看！我们的目标是：拥有4000银币！'] = '私はこれからより多くの金を稼ぎの道!覚えて航経一港が取引所!われわれの目標は、4000銀貨!', 
    ['我们跟随霍金斯的行踪一路追到这里，突然失去了他的踪迹。不知道这个恶棍躲在了什么地方。'] = '私はついホーキングの行方を追いかけて、ここまで道中が突然彼の迹を失った。知らないこの悪役隠れたどこ。', 
    ['我们这样带着几十人回去已经回引起怀疑，先去【交易所】把货物装满仓作为掩饰吧。'] = 'この数十人を連れて帰るが、すでに懐疑に先に行って【取引所】货物をmancangだろうとして。', 
    ['我们这种人怎么配认识有钱人家的老爷？我母亲等了他十几年，一直等到死，现在我只想让他早点下地狱！'] = 'この人たちをどう配認識金持ちの殿さま?私の母など十数年、彼の死を、今まで待たせたい早く下地狱!', 
    ['我们这里卖椰子，这可不是哪里都买的到。'] = 'ここで売れやし、これにはどこにも买ったからだ。', 
    ['我们这里有很多水果，但交易所只卖椰子。'] = 'ここのたくさんの果物が、取引所だけやした。', 
    ['我们这里的乳香非常著名。'] = 'ここの乳香も有名だ。', 
    ['我们这里的雪莉酒非常有名。'] = 'ここの雪のリディアの酒有名。', 
    ['我们遭到攻击了!'] = '私たちが攻撃を受けた!', 
    ['我们首要目标是摧毁炮台，同时不能让货船运走货物，最后击败彼得松•霍因，夺回卡利卡特。'] = 'われわれの目標は、破壊の砲台ない貨物船で、最后にはこびだしピーター松・か弱く、ヒカリが奪還カーター。', 
    ['我们？还有其他人？'] = '私たち?ほかに?', 
    ['我会为你们弄到足够的货源，希望你们能够振作起来。'] = '私はあなたからの十分な供给の皆さんが、がんばれ。', 
    ['我会带你们回去，只要你们把刚才说过的话告诉你们的同胞，让他们都醒过来吧。'] = '私は持って帰りさえすれば、あなたがたは、さっきの言ったことを知らせて、彼らの同胞が覚めるだろう。', 
    ['我会更强大！而你必将失败！'] = '私はもっと强く!あなたは必ず失敗!', 
    ['我会让他上我的船，成为我的伙伴，我保证。'] = '私は彼が私の船で、私の仲间、私が保证した。', 
    ['我会负责监视马铃薯的，小心点，可别引来增援哦。'] = '私はジャガイモを監視する、気をつけて、突如増援ですよ。', 
    ['我倒不是担心这个，之前阻止了达尔布克基，此事最好还是先回$(missioncolor:【里斯本】)向亨利王子解释一番。'] = '私は、前に心配を阻止したが、この方に基先回$(missioncolor:【リスボン】)、ヘンリー王子説明して。', 
    ['我倒是挺羡慕他们这样的生活，起码非常安宁……'] = '私はなかなかそんな彼らの生活を羡、何しろ非常の安寧……', 
    ['我倒是觉得事情没这么简单。'] = '私はそんなに簡単なと思う。', 
    ['我做这些事并不为了需要朝廷承认，只是这对天下女子来说不公平。'] = '私はこれらのことのために、ただこれが朝廷を認め、天下の女子にとっては不公正だ。', 
    ['我准备在岛的西边开辟一片咖啡豆种植园。'] = '私は岛の西一种植园開拓豆。', 
    ['我准备造一艘名叫白银梅丽号的船。'] = '私の準備造一隻の船はシルバーメリー号。', 
    ['我刚从俘虏口中探听得知，拉比斯趁着我们攻打亚历山大的时候，脱身逃往了$(missioncolor:【威尼斯】)。'] = '私が知ってからは、はかばかしく捕虜口より我々に乗じて攻撃の時、アレキサンダー逃走したmissioncolorピョン$(:【ベネチア】)。', 
    ['我刚刚听到一个孩童说着一些奇怪的东西，好像是狮首象身的怪物和什么住在深海里半人半蛇的那伽摩纳娑……'] = 'さっきの子供は聞いて変なもの、ライオンの曲は象の身の怪物と何の深海に里半人半蛇のあの伽摩納ぱた……', 
    ['我刚好要去见一位老朋友，那么回头见。'] = '私はちょうどある友人に会いに行く、じゃあ。', 
    ['我到东南方的【锡兰】去求援吧，希望他们明白厉害关系，愿意伸出援手。'] = '私から東南の【セイロン】行きましょう、請願希望、理解の利害関係を助けた。', 
    ['我到今天这个地步全是拜这群恶魔所赐！实不相瞒，我是萨尔法八世，这片土地的国王。曾经这是一篇祥和的土地，直到恶魔降临，烧杀掳掠。我的人民奋起抵抗却无法抗拒那恐怖的巨龙吐息。他们夺走了我的王位，奴役着我的子民。而我，只能四处躲避，等待复国的时机。'] = '私は今日までこの全この群悪魔から授かっ!実相瞒ない、私は八世、内相法をこの土地の国王。かつてこれは一篇の平穏、悪魔の土地まで、烧杀掳掠。私の人民の抵抗はそれに抵抗できない恐怖のヨンガリ吐息。彼らを奪われた私の、私の王位労役っ子。私、あちこち、待つしか避ける替えの時期だ。', 
    ['我又回来了，这次，我带了无敌战舰送给你们，哈哈哈哈'] = '私は帰ってきたが、今回、私にあなたの無敵戦艦、ハハハハ', 
    ['我发誓，为了加尔各答的自由，我们一定能取得胜利！'] = '誓って、カルカッタの自由のために、必ず勝利!', 
    ['我只不过是尽我作为一名管家的本分而已，这不算什么。'] = '私はただ私の一人の执事として最善の本分だけで、大したことではない。', 
    ['我只是不像其他的海盗一样赶尽杀绝而已，真是可笑，明明是做恶，只要在恶的基础上稍稍施加一点点善，被伤害的人却会给你冠以美誉，对你感激涕零。'] = '私はただ他の海賊のように、本当におかしいやかただけなのに、仕事は悪、悪の土台の上で、少しずつ善を伤つけられた人があなたを、あなたこそ黒潮感激する。', 
    ['我只是为当年死于墨西哥湾的同伴报仇而已。'] = '私は同年死はメキシコ湾の仲间だけの仇だ。', 
    ['我只知道有人被阿芒德给抓到了……不废话，让你见识见识我的厉害。'] = '私かに阿穂先徳捕らえ……あなたは、私の见闻すごい。', 
    ['我只站在自己这一边。你走吧，看在曾经国王的面子上，我会放你一马。远离这纷乱的漩涡吧，否则你只有死路一条。'] = '私は、自分ながら立ってこの。あなたは、かつて见ましょう、国王のメンツで、私はあなたの一马。この騒の渦离うでなければ、あなたは死ぬ。', 
    ['我只能帮到这，在他们发现我之前我得撤退了。'] = '私はこれまで、彼らを助け、発見して私の前に私が撤退した。', 
    ['我叫夏洛克，你需要借贷吗？只需要一点点利息。'] = '私はシャーロック?あなた、借りが必要ほんの少しの利子。', 
    ['我可不仅仅长得漂亮噢，将购销货物的事务交给我，我们的资金很快就会成倍增长的！现在进入交易所点击左下角我的头像就可以购买货物。'] = '私だけがきれいですね、ああで貨物の事務私に任せて、われわれの資金のすぐ倍増!今私の所にクリック左下肖像に貨物を購入できる。', 
    ['我可不像达伽马，我只想稳当的做我的总督，而战争毁掉了城镇，所以，你必须负责把【果阿】和【卡利卡特】建设达到港口等级3。'] = '仆はただ、私はバスコ・ダ・ガマまっとうな私の総督で、戦争の廃棄した町の、だから、あなたを担当しなければならない【果阿】と【ヒカリカーター】建設が港湾等級3。', 
    ['我可不只这点能耐!'] = '私はそれだけに明け暮れ!', 
    ['我可不是娇滴滴的贵族千金！我要让所有人记住我拉比斯的名字！'] = '私は甘えの贵族令嬢!私のすべての人によりて斯の名前!', 
    ['我可不管你为什么，我只想用舰炮狠狠地轰击阿芒德……眼睁睁看着阿芒德耀武扬威又从容而去，这是对我汉娜的蔑视！'] = '私がどんなにあなたがどうして、私はただ用の艦砲はねあげ砲撃阿穂先徳……みるみるうちに阿穂先徳も余裕を振りかざすて行って、これは、私のハンナのさげすむ!', 
    ['我可以在祈祷时喝酒吗？我可以在喝酒时祈祷吗？'] = '私は祈祷に酒を饮みますか。私はお酒を飲むとき祈祷?', 
    ['我可以帮你找到香料群岛，但我绝不会成为你屠杀的凶器。'] = '私が探してくれ、しかし私は決して香料諸島あなた虐殺の凶器。', 
    ['我可对什么十字军和约翰王的联盟那些玩意不感兴趣，我只在意繁华的交易所和热闹的酒馆呢。'] = '私は、何と约翰王十字軍の連盟あれらのおもちゃに兴味がない、私は気になる繁华の取引所とにぎやかな居酒屋だろう。', 
    ['我可没有这样的意思，是你自己想多了……别瞪我，既然你这么喜欢这里，我就帮帮这些人。'] = '私がないという意味で、あなたは自分のしたい……眼で私をこんなに好きからには、ここで、私はこれらの人に助けてくれた。', 
    ['我可没有钱付给你们，但有的是力气，可以为你们工作。'] = '私はあなたに払って、しかし、あなたが御力を仕事。', 
    ['我可没这么闲。我来是想请你协助我前往“世界的尽头”。'] = '私はそんなに闲。私は私の来てもらいたいの協力に「世界の果て」。', 
    ['我听当地的居民说陈祖义的手下甚至对沿海城邦征收高额的贸易税费，稍有不从，便会招致船毁人亡的下场！'] = '現地の住民たちは私陈祖义の部下は、沿岸都市高額の税金賦課貿易、少しはないが、船の死者を招く嗅ぎ付け!', 
    ['我听戴肯叔叔说，需要七海霸主信物才能压制女神的力量。'] = '私は、ケンおじさんがかぶっ七海覇者神仏の力こそ抑圧の女神。', 
    ['我听水手们说过郑和的故事，他是中国最伟大的航海家。'] = 'セーラーたちは私の話、郑和彼は中国の最も偉大な航海家。', 
    ['我听说了你们的事迹……如果我没有破产的话你们倒是不错的合作伙伴。'] = 'あなたの話を聞いて……もし私は破産すればいいですね。君たちの協力パートナーだ。', 
    ['我听说威廉基德正准备和霍金斯宣战，不如我们和他一起联手，打败霍金斯的胜率就更大了！'] = 'ウィリアムの準備をしていると聞いキッドとホーキング斯宣戦布告より、私たちと一绪に、彼の手をホーキング斯の勝率はもっと大きく!', 
    ['我哼，原来如此，怪不得我上次功亏一篑。'] = '私のふん、なるほど、私前回精魂。', 
    ['我嗅到了金币的味道，这里一定有特级商品！我们快去$(missioncolor:【市政厅】)吧，我的直觉不会有错的！'] = '私の埋金货の味、ここがきっと特急商品!早く行く$(missioncolor:【市庁】)でしょう、私の直感は间违ないの!', 
    ['我在土里挖出了几枚中国古代的钱币。'] = '私は土に掘った中国古代のコイン数枚。', 
    ['我在寻找我的父亲，传闻他去了世界的尽头。东印度公司四处劫掠，欺压原住民，我攻击他们是替天行道。'] = '私は、私の父の噂を探して、彼は世界の果てへ行った。東インド会社のあちこちにある、抑圧原住民、私攻撃彼らは天に代わって。', 
    ['我在背诵教皇发布的禁止奴役印第安人的圣训。'] = '私は法王の発表禁止暗記労役インディアンの圣训。', 
    ['我在这颗宝石里感受到了大海的力量，上次在世界尽头的最终路途上被水幕结界所阻，或许就是缺少了这样一把钥匙……'] = '私はこの宝石に海の力を感じ、前回は世界の果ての最終行く手に水幕されるかもしれないが、结界栖は鍵よう……', 
    ['我在附近的种植园里工作。'] = '私は近くの种植园で働いた。', 
    ['我好像听到打雷了，嗝！'] = '私を闻きつけて、雷嗝!', 
    ['我学了一句中国话：有钱能使鬼推磨。'] = '私は中国语を勉强して、金持ちの一言があれば鬼。', 
    ['我完全同意，我们应该到酒馆里去请喝一杯，总有一些人，舌头一大话匣子就打开了，比如我……'] = '私が完全に同意し、我々に行くべき居酒屋で一杯ください、いつかは一部の人が、舌に一大ローリー・が開いて、例えば私……', 
    ['我对你们的感激之情无以言表，我亲爱的朋友。'] = '私はあなたの感谢の気持ちをひとしお、私の亲爱なる友人。', 
    ['我对自己的运气一向很有信心。走，这就去酒馆。'] = '私は自分の运势一向自信があった。歩いて行く、これが居酒屋。', 
    ['我尝试拼了一下，虽然磨损很严重但依稀能看得出是一张地图，您快看。'] = '私の试みは一生、磨耗が深刻なのは分かるが、一枚の地図をいだき、ほら。', 
    ['我就是一个普普通通的管家，可没什么故事可言。'] = '私は普通の执事もおぼつかない、ストーリー。', 
    ['我就知道戴肯叔叔你一定会理解我的。'] = '私は知ってきっとケンおじさんかぶって私を理解するのだ。', 
    ['我就要死了，但现在战况紧急，不要透露我的死讯，请你接替我的位置，以我的名义，继续战斗下去……咦，你不是李莞？'] = '私は死んだが、今、戦況を緊急によると私の死、どうぞ私の位置の後任には、私の名義で、戦い続ける……おや、あなたはイワン?', 
    ['我就说我的运气一向不错吧。这位经验丰富的航海士一定能给我们带来极大的帮助。咦，$(missioncolor:【冒险家笔记】)，这是什么？'] = '私は私の运冷やかすだろう。この経験の豊かな航海士はきっと私に大きな助けに。えっ、$(missioncolor:【冒険家のメモ】)、これは何?', 
    ['我就说我的运气不错吧，在对战中使用钩锁，能够直接封锁对方旗舰的行动，我方旗舰上刚好缺少这样一位人才。'] = '私は私の运がいいでしょう、対戦で使う鍵を直接フック、相手の行动を封鎖する売場でちょうどこちらフラッグ不足ある人材だ。', 
    ['我已经听说了这事了，是的，协议的确没有对个人有约束，这也是我为了我们私人商船在北海的利益而做的让步。'] = '私はもうそのことを聞くと、はい、合意は、個人的にはたしかに、私もそれが私たちのために、私的な商船北海の利益のための譲歩だ。', 
    ['我已经听说了这事了，英国那边暧昧的态度着实令人担忧。霍金斯现在的实力依然不容小觑，你要小心。另外，请你代表我们葡萄牙王室与刚刚重获自由的城市缔结贸易关系，葡萄牙愿意帮助他们走出困境。'] = '私はもうそのことを聞くと、英国あっち暧昧な态度嘆かわしい。ホーキング斯の今の実力は依然としてしたたかあなた、気をつけなければならない。また、あなたが私とポルトガル代表王室ばかりの都市締結自由貿易関係、ポルトガルと彼らを。', 
    ['我已经当了超过40年的水手，现在准备退休做点小生意。'] = '私はすでに40年以上が昔ながらの、今準備退職何小商売。', 
    ['我已经很久没有回到这里了，自移居到普利茅斯后，我就在这一带讨生活，跟着商船到世界各地贩卖红茶和啤酒。大海充满了商机，年轻人你要擅长发现。'] = '私はもうここに戻って来た、久しぶりに、移住〔プリオシン後、私は、この一帯讨生活から世界各地で、商船の人身売買红茶とビール。海に満ちたビジネスチャンス、若者君得意発見。', 
    ['我已经把那块女神之誓给了那小子，戴肯，你觉得靠这小子就一定能在世界的尽头找到女神？'] = '私はもうそれを誓った女神の塊をかぶってあいつ、ケン、こいつだけはきっと、世界の果てを女神?', 
    ['我希望我可以相信你……来【酒馆】找我。'] = '私はあなたを信じることができる……【居酒屋】私を探しに来た。', 
    ['我当然愿意！能与你们一同为了正义而战是我的荣幸，快来【酒馆】签订招募合同吧！'] = 'もちろん私嫌よ!あなたのためにできると一緒に正义のために戦いは私の光栄です、早く来て【居酒屋】公募契約締結しましょう!', 
    ['我怎么可能甘心，空手回去见玛利亚不如直接让我丧生在这片大海当中，成为鱼群的饵料！我去了加勒比海，加入了本杰明.霍尼戈的海盗团。'] = '私が、素手で帰って悔しくて见せるよりもマリアを直接私が死亡し、この海の中で、鱼群の饵になる! ! ! ! ! !私の行ったカリブ海、ベンジャミン加入した。霍尼戈の海賊団。', 
    ['我怎么感觉巴巴罗萨话里有话。'] = '私はどう感じ话里有话やけに羅サルトル。', 
    ['我怎么没感觉到他在推脱。你看，居然有一艘船，不过看上去并不像战舰。先去【舰队】升级装备，做好将它加入舰队的准备，等戴肯叔叔回来向他咨询下关于这艘船的信息。'] = '私はどう感じない彼は首肯き。ほら、なんと1隻の船が见える、は戦舰。先に行って【艦隊】アップグレードする装備、艦隊の準備などに加入し、かぶって、ケン叔父彼について相談でこの船の情報だ。', 
    ['我怎么知道？我和那个纨绔小子可没什么交集。'] = '私が知っているのか。私とあの纨绔男一匹酱油できる。', 
    ['我怎会没付诸行动呢？我的打算是加入一艘船上积累经验，然后慢慢建立自己的船队。'] = 'どうして私の行动かない私は1隻の船に加入を経験、そしてゆっくりと自分の船団。', 
    ['我总觉得还缺点啥，要不到交易所里看看吧'] = '私は、なんだか欠点なら到取引所でみましょう', 
    ['我想凡是有正义感的人没人会愿意如此安宁悠闲的地方被战争给破坏。'] = '私は凡そ正义感の人人がいないほどの安寧とのんびりされたところに戦争の破壊。', 
    ['我想在佛得角建一座小教堂。'] = '私は佛得角建て小さな教会。', 
    ['我想她一定是一个大美人，让您到现在都念念不忘。'] = '彼女はきっと大美人、お今も忘れた。', 
    ['我想如果能够利用好大漩涡，会给我们日后带来诸多便利。至于危险又算得了什么！走，让我们去见识一下这神奇的大漩涡吧！'] = '私ならいい、利用できる大渦を今後の便宜。危険を斟酌、なんだ!歩いて行く、この神秘の见闻の大涡ましょう!', 
    ['我感觉到钱袋又重了一些。'] = '私が感じた財嚢重。', 
    ['我愿意。只要给我足够的继续、足够的时间，而且我还需要你的帮助。'] = '私。私を続けば十分なの、十分な時間を、しかも仆はあなたの助けが必要だ。', 
    ['我懂一点占卜，知道他凶多吉少了……'] = '私に分かる占い知って、彼は凶……', 
    ['我懂了，看来我又得操劳一番了。'] = 'わかりました、どうやら私は苦労してて。', 
    ['我懂的，戴肯叔叔，秘密在金子面前不再是秘密。'] = 'わかった、叔父はケン、秘密の金子の前ではもはや秘密。', 
    ['我成为水手之后，听说有一艘西班牙宝船在佛州被飓风卷进了大海深处，我决定去佛州试一试运气。'] = '私がなったら、セーラー服が一隻の船が、スペインの宝に巻き込まれたフロリダハリケーンされ、私は海の奥へ运フロリダを试してみた。', 
    ['我才不信什么女人会带来厄运呢，如果我们连一个炮手都没有就去和摩尔人战斗那才真的会倒大霉！'] = '信じられないどんな女か、もたらすジンクスさえすれば我々は一つもないと砲手ムーア人戦闘それこそ本当に酷い目に合う!', 
    ['我才不是在向你认错呢……哼！我发现这群自称商人的海盗围绕南方的$(missioncolor:【圣乔治】)经营退路，并和另一股势力有所勾结，我一定要将他们一网打尽！'] = '私は、あなたに探ってね……ふん!私のこの自称商人の海賊南側の$(をめぐってmissioncolor:【セント・ジョージ】)経営退路を他方の勢力と癒着し、彼らは必ず一網打尽!', 
    ['我找你前来正是为了此事。霍金斯并没有在东印度公司手上，而是与海盗勾结，四处劫掠商船。'] = '私があなたを探して来た。まさにこのためホーキングしなかった、東インド会社の手ではなく、海賊と癒着し、ある商船あちこち。', 
    ['我把她卖给了一个威尼斯人，他说要到非洲干一趟大买卖……饶命啊……'] = '私は彼女のベネチア人に売った、彼はアフリカへ行って大商売やっ……云えよ……', 
    ['我把希望留给自己，它将给我带来无穷的财富！'] = '私は希望を自分に残して、私には无限の富をもたらす! ! ! ! ! !', 
    ['我投降！我投降！别杀我，我愿意用我所有的财宝换我一条生路！你看，只要你们放过我，这个美丽的宝瓶就是你们的。'] = '降参!降参!殺さないで、私は私のすべての财宝換私拠り所!ほら、あなたさえ逃さ私、この美しいみずがめは君たちの。', 
    ['我支持不了多久了。'] = '私が支持しないくらいだ。', 
    ['我收到了%s分享的热销信息，谢谢！'] = 'もらった%s分かち合いのヒット情報、ありがとう!', 
    ['我方'] = '韓国', 
    ['我方全体行进速度增加50%，持续8秒。'] = '韓国全体の運行速度増加50%、8秒。', 
    ['我方全体进入隐形状态，持续4秒。'] = '韓国の全体に、ステルス态4秒。', 
    ['我方商会据点被攻占，望大家努力夺回。'] = '韓国商工会議所占拠され、みんな拠点を取り戻す努力。', 
    ['我方在单挑战斗中获胜，对敌方造成了%s伤害！！'] = '我々は単挑戦斗で勝利し、敵に%s傷害! ! ! ! ! ! ! ! ! ! ! !', 
    ['我方在本次据点争夺战中失败，望大家卧薪尝胆，以图东山再起。'] = '韓国は今回の拠点争いで、みんな失败を眺め、再起有り様だ。', 
    ['我方成功的获得本次据点争夺站的胜利，望大家再接再厉，称霸一方。'] = '韓国の成功を今回の拠点争いの勝利で、みんな駅を抜かず、一方を制覇した。', 
    ['我方死亡数少于1'] = '韓国の犠牲者が少ない1', 
    ['我方死亡数少于2'] = '韓国の犠牲者が少ない2', 
    ['我方死亡数量少于2'] = '韓国が死亡数が2', 
    ['我明白了，我会为【亚丁】的【市政厅】投资一笔钱。'] = '分かりました、私は【亜丁】【市庁】投資大金だ。', 
    ['我明白的，你们投资这个城市，会有意想不到的回报。'] = '分かりました、皆さん、この都市の投資の見返りに结びついたのです。', 
    ['我是从印度来的。'] = '私はインドに来た。', 
    ['我是伊梅里纳王国的居民。'] = '私は伊梅里納王国の住民だ。', 
    ['我是和丈夫一起来东南亚讨生活的。'] = '私は夫と一緒に来た東南アジア讨生活。', 
    ['我是女王的顾问--亚当·斯密，你说你代表亨利王子前来商议联盟事宜吗？我很抱歉的通知你，女王并不想卷入北海的纷争，因为不管是哪个势力得胜，他们都不敢罔顾大英帝国的权益的。'] = '私は女王の顧問であるアダム・スミス、あなたはあなたの代表にヘンリー王子を相談し連盟?すみません、女王のお知らせしたくないので、北海の紛争に巻き込まれるどの勢力にすえられ、彼らも罔顾大英帝国の権益の。', 
    ['我是本愿寺的僧人，织田信长就死在本愿寺中。'] = '私は本愿寺の僧、织田信长は、本愿寺で死んだ。', 
    ['我是注定要成为海贼王的男人！'] = '私は运命に海贼王になる男だ!', 
    ['我是葡萄牙人，和丈夫一起来这里旅行。'] = '私はポルトガル人、夫と一绪にここに来て旅行。', 
    ['我是这里的神学教师，向未知探索时不能忘记对上帝的谦卑。'] = '私はここの神学教師、未知の探求に忘れられない、神の谦虚。', 
    ['我是骑兵队长，但只要能消灭入侵者，就是让我刷甲板都没问题！现在我要去饱餐一顿，稍后来【酒馆】找我吧。'] = '私は骑兵队长が、侵入者が消滅すれば、私も大丈夫!デッキブラシ今私の成功に行く、ちょっと后【居酒屋】私を探しましょう。', 
    ['我曾经也是一个冒险者，直到我的膝盖中了一箭。'] = '私も一つ、私の冒険者まで膝で矢。', 
    ['我曾经也是一位探险家，直到我的膝盖中了一箭。'] = '私もかつては、ある探検家まで、私の膝で矢。', 
    ['我曾经和你一样也是个冒险者，直到我的膝盖中了一箭。'] = '私とあなたのようにも、私の冒険者まで膝で矢。', 
    ['我曾经看到过他和印有东印度公司标志旗帜的船只有来往。'] = '私は彼と東インド会社ロゴマークの旗の船舶の往来がある。', 
    ['我曾经认为我会一辈子在海上漂泊，但不是现在……我的家族正在生死存亡的边缘。'] = '私は一生、漂流が、今じゃ……私の家族が存亡の縁。', 
    ['我最喜欢拉菲酒庄出产的葡萄酒。'] = '私の最も好きな酒を庄产のワイン。', 
    ['我最近也总是有些不好的预感。算了，走吧，世界的尽头就在不远的前方。父亲，我来了！'] = '私も最近はいつも多少の悪い予感。まあ、行こう、世界の果ては近くの前方。お父さん、私は来ました! ! ! ! ! !', 
    ['我有一个好消息和一个坏消息告诉你们。'] = '私は良いニュースと悪いニュース皆さん。', 
    ['我有一点不明白，这里深受大明国文化影响我有感受到，但复杂体现在何处？'] = '私は少しわからない、ここがテミョン両国文化の影響を私は感じるが、复雑さは何処?', 
    ['我有喜欢的人，除了她我不会对任何人动心！'] = '私が好きな人、彼女以外の私は、誰にもキュンと!', 
    ['我有幸见识过宫本武藏和佐佐木小次郎的惊天一战。'] = '間近に见て宫本武蔵と佐々木小次郎の希代の戦。', 
    ['我来帮您出售有利润的商品'] = '私が売却は利益の商品だ', 
    ['我来，我见，我征服。'] = '私、私、私征服。', 
    ['我查询了下，最近塞维利亚对薰衣草的需求量很大，我们这趟贸易的目的地就定在塞维利亚吧！'] = '私、最近、セビヤで照会した、ラベンダーの需要が大きく、我々はこの貿易の目的地はビヤましょう!', 
    ['我正在构思一部骑士小说，主人公叫堂吉诃德。'] = '私を構想していると、一部の骑士小説の主人公ドンキホーテ。', 
    ['我正有此意，在突尼斯的敌人援军从东面来的，让我们沿着突尼斯海岸线向东寻找敌人的下一个据点--的黎波里！'] = '私はこの意味は、チュニジアの敵から来た援軍東面、海岸線に沿って東チュニジアを探して敌の次の拠点であるトリポリ!', 
    ['我没看错吧！那艘船竟然悬挂着英国国旗！无耻的家伙，在剥夺了我们在北海的权益后，居然还有脸到非洲来与我们争夺！'] = '私を见ましょう!その船が英国の国旗を掲揚して! ! ! ! ! !ずうずうしい奴、剥奪した我々は、北海の権益後、顔にアフリカと争うて私たち! ! ! ! ! !', 
    ['我熟悉敌人行进路线，你们攻城，我来解决右边巡逻的家伙。'] = '私、あなたの敌に慣れて行進ルート攻城、パトロール中のやつ。解決右', 
    ['我爱上了一个姑娘，她叫玛利亚.哈里特。'] = '私の娘を爱し、彼女はマリア。ハリー特。', 
    ['我独自航行的时候也听过一些老妪聊起关于科纳克太阳神庙的神秘传说，我们快去看看吧！'] = '私は一航海の时も聴いた话から一部の老婆について科ナノグラム太阳の神秘说、造ら早く行ってみましょう!', 
    ['我现在心中的疑惑越来越多，让我冷静一下。'] = '私の今の心の疑惑が増えて、私を落ち着けた。', 
    ['我现在最缺的是一位与帝国官方接触的引荐者，如果你有这个能力，不管你的箭术如何，我可以让你加入。'] = '私は今最も足りないのはあると帝国の公式接触の引荐者、もしあなたはこの能力、君の弓術どう、私があなたに加入した。', 
    ['我用贵族与爱情为主题写了一部小说：公主怀孕了。'] = '私は贵族と愛を中心に小説を書いた「プリンセス妊娠していた。', 
