    ['我的老雇主是韦恩海运公司的创始人，他去世时没有留下继承人，只好由我代为管理公司。最近我听说老雇主还有一个私生子，我想让你们帮我找到他。'] = '私の老雇い主はウェイン海運会社の創業者、彼が亡くなった時は、後継者を残してあたしが代わりに管理会社。最近私も一つ闻老雇い主私生児、皆さんを探してくれ。', 
