    ['我看到许多原住民的手工制品被东印度公司打压，只能滞销与于此地，不如我们帮助他们销出一些产品缓解他们的燃眉之急。'] = '私の原住民の手作りされ、東インド会社が弾圧しか売れないと我々はここよりも、彼らを助け消て一部の製品に彼らの緩和を終えた。', 
    ['我看是心里有鬼吧，保险起见，我们还是去【市政厅】走一趟，请治安官帮我们查查他的底细吧——当然得先准备好一笔投资。'] = '私の心は念のため、污物でしょう、保険か行く【市庁】ゆってください、治安官调べてくれ彼の素性だろう——もちろん先一ペン投資準備。', 
    ['我看看，这句话的大概意思就是一个人思念他的情人，亲手制作了这个容器。这可不是鱼缸，是个笔洗。你看，里面还有笔搁呢。'] = '私を见て、この言叶の意味が一人彼の爱人、想いを手作りしたこの容器。これは、笔洗金魚鉢。ほら、中棚もペンだろう。', 
    ['我真不明白，皇帝收税就好了为什么要禁止海上贸易？'] = '私はわからない、皇帝の課税よかったどうして海上貿易禁止。', 
    ['我知道了'] = 'わかった', 
