    ['我说过我不是将军也不是海盗，所以不要纠结这样的问题，虽然很多人因为我的战绩称我为海盗之王。'] = '私は私は将軍もないので、この海賊没の問題は、多くの人が私の戦績は私を海賊の王。', 
