    ['看上去有些年头，可以尝试拼一下，直觉告诉我这应该是有价值的物品。'] = '少し目が见える、死力を试みて、私の直感は価値のある物。', 
    ['看不出你居然有这等实力！'] = '见えないのにこれなど実力あなた! ! ! ! ! !', 
    ['看准机会，找一艘大船动手，这样才能得到海盗们的信任。'] = 'チャンスを探し、美加手船こそ、海賊たちの信頼を得た。', 
    ['看到海面上的骷髅旗了吗？这些家伙明目张胆地把这里当成了他们的猎场！'] = '海の上を见た骸骨の旗?これらの奴がここを公然と彼らの受注した! ! ! ! ! !', 
    ['看到玛丽被围困，安妮扯掉了头巾，挥舞着指挥刀，嘶吼着命令她的水手向敌人发起进攻，一定要把玛丽救出重围！'] = 'マリーに囲まれ、见れたアンて头巾を振り回し、指揮刀、急がして彼女のセーラー服の命令を敌に侵攻、マリーは必ず救出障壁!', 
    ['看到苏菲的船了，她受损很严重！对方正对她穷追不舍！'] = 'ソフィーの船を见た、彼女は被害が深刻な!相手が彼女に対して追いつめる!', 
    ['看到那个酒桶了吗？先干掉那三艘具有优秀瞭望手的守卫舰，再点燃酒桶给吉布斯发信号。'] = 'その樽を见ましたか。それを先に杀3隻が優秀瞭望手の守備艦、再火にギブス樽発信。', 
    ['看吧，我们几乎“顺便”就把悬赏任务完成了！现在让我们去【酒馆】把奖励领了吧，记得常到酒馆看看哦。'] = 'ほら、私たちはほとんど「ちなみに」を完成した懸賞任務! ! ! ! ! !今行く【居酒屋】インセンティブを連れたでしょう、よく见覚えているよ。居酒屋へ', 
    ['看来你也被我的外表欺骗了呢，其实我是一个内心非常坚强的人。'] = 'どうやらあなたも私の外貌をだまして、実は私は心が强い人。', 
    ['看来你很享受当英雄的感觉。'] = 'あなたが英雄の感覚を楽しんだ。', 
    ['看来只有到竞技商店中用竞技场星章兑换合适的水手宝物了。'] = 'どうやらまでしか競技商店で競技場の星章両替の適切な宝物たセーラー服。', 
    ['看来奥斯曼的海军和海盗早已是合作关系，统治了地中海。'] = 'どうやらオスマンの海軍と海賊はすでに協力関係、地中海を支配した。', 
    ['看来对手都是些欺软怕硬的家伙，让我们继续前进吧！'] = 'どうやら相手はみな青年のやつ、何しましょう!', 
    ['看来我们这次的收获相当丰富，不过可真是惊险，每一个都是亡命之徒。'] = 'どうやら今回の収获がかなり豊富は、スリラー、一は亡命之徒。', 
    ['看来我要把这个好消息告诉【I·F·拉齐】。'] = 'どうやら私はこのニュースを教え【I・F・トラ斉】。', 
    ['看来敌人为数不少，而且作战经验丰富，不可掉以轻心！'] = 'どうやら敵少なくないうえ、作戦の経験が豊富で、油断のない! ! ! ! ! !', 
    ['看来是$(missioncolor:【悬赏令】)发布了，通过悬赏任务，可以获得$(missioncolor:【商会贡献】)，这样就能从商会仓库那里兑换很多好处。这些人恐怕都是为了商会贡献而来。'] = 'どうやら$(missioncolor:【悬赏令】)に発表した、懸賞任務を通じて、$(missioncolor:【商工会議所貢献】)、こうしてそこから多くのメリットに両替商工会議所仓库。おそらくこれらの人は商工会議所で来た。', 
    ['看来没有其他办法了，这里我也待不下去了……你们可以来【酒馆】找我。'] = 'どうやら他に方法はない、ここで私もない……あなたが私を探しに来る【居酒屋】。', 
    ['看来真的有强征民夫的事情发生，他们应该走不远，我们在附近的海域搜寻一下！'] = 'どうやら本当に強制人夫のことが起き、彼らを歩むべき遠く、私たちは近くの海域をさがせ!', 
    ['看来老伙计在等着我了……'] = 'どうやら老伙计が、私を待っていた……', 
    ['看来这里虽然名义上隶属牙买加总督的管辖，实际上是一块混乱无序的领地。'] = 'どうやらここの名目で隷属ジャマイカ総督の管轄、実際は混乱の领地ぐちゃぐちゃだ。', 
    ['看来魔鬼之手并不是指这里的惊涛骇浪，全员警戒，准备迎战！'] = 'どうやら魔の手を指すのではなく、ここの逆巻く大波全員警戒戦に備え、! ! ! ! ! !', 
    ['看来，繁华安逸的生活早已经腐蚀了那些士兵，我们会轻松取得胜利的！'] = 'どうやら、繁の安易な生活はすでに腐食した兵士たちが、軽く勝利した!', 
    ['看来，这次有额外的收益哦'] = '今回は、別途の収益ですよ', 
    ['看杰克使用他的罗盘找到黑珍珠号的方位'] = '彼の羅針盤を见ジャック使用を黒真珠号の方角だ', 
    ['看样子敌人阵势未稳，直接冲击敌人侧翼!'] = 'どうやら、敵のサン・パオロ・フオーリ・レ・ムーラ未直撃敵側面!', 
    ['看看吧。'] = 'みましょう。', 
    ['看看我们造成的轰动吧！不要停下，继续耕耘这条美妙的航线，你知道么？人们已经用黄金商路来形容她了呢！'] = '我々のヒットにましょう!止めないで、引き続きこの条の美しい航路耕し、知ってた?人々はすでに黄金ビジネス用来形容彼女たよ!', 
    ['看看那里的情况。'] = 'そこの状況を见た。', 
    ['看见你们面前的那艘船了吗？这是女王最强大的“吕贝克的耶稣”号，它会毫不留情地粉碎你们！'] = 'あなたの前で见たその船ましたか?これは女王の最も強力な「吕贝克のキリスト」号、それを容赦なく粉砕! !', 
    ['看起来像蛇，但是生活在干净的水中，身体又长又扁，有的品种像叶子一样薄。'] = 'まるで蛇、しかし生活は、きれいな水、体は平、ある品目に薄い。', 
    ['看这辽阔的海面，还有每一艘都满载着贵重货物的船舶！这里真是海盗的天堂啊！'] = 'これを见ても、あすこの海面1隻も満贵重な貨物の船舶!ここはバイキングの天国ですね!', 
    ['看！海盗已经将俘虏装船，正准备离开据点了！'] = '见て!海賊はすでに船積みを離れ、捕虜を準備している拠点! ! ! ! ! ! !', 
    ['看，到处是被劫商船的货物，那些看起来像酒桶！'] = '见ては、あちこちに拉致された商船の貨物、まるで樽!', 
    ['看，前面就是【萨格里什】，我们到了！'] = '见て、前には【萨格ジョニー、我々に! ! ! ! ! !】', 
    ['看，我们马上就到马尼拉了。'] = '私たちはすぐにマニラました。', 
    ['看，是上次那艘下令攻击我们的海盗船，还有………巴巴罗萨的海军！？'] = 'それは、前回私たちを攻撃命令の海贼船隻、そして……やけに羅萨の海軍!?', 
    ['真了不起！你已经绕过了非洲，离印度不远了。'] = 'すごい!あなたはすでにアフリカ迂回し、インドも遠くない。', 
    ['真想喝一杯波尔多的红葡萄酒。'] = '一杯やりたいなボルドーの赤ワイン。', 
    ['真愁今天的收获少呢，你们就来啦！'] = '本当に今日の収获が少ない愁か、君たちが来啦!', 
    ['真是……已经分不清是耿直还是其他的什么了。'] = '本当に……もう分不清は律義は他の何した。', 
    ['真是不堪一击。'] = '実に耐え難い。', 
    ['真是个明事理的人，看在你们如此用心的份上，我可以透露个消息。汉萨同盟首领阿尔伯特·希勒告知女王，北欧海盗势力最近肆无忌惮地劫掠我们大英帝国的商船。'] = '本当に明の道理を、人の心はあなたのように、私のニュースが伝えた。漢萨同盟首領アルベルト・希勒告知女王、北欧バイキング勢力が最近無残にある我々大英帝国の商船だ。', 
    ['真是个棘手的小家伙，这样一来救回你的父亲的线索又断了，看来我得去重新找些老朋友打听情况，刚好你趁这个时间去造船厂购买一艘新船。'] = '本当に厄介な小僧、そうするとあなたに助けた父親の手がかりは切れた、私はここで再び闻て旧友の場合、これに乗じて、ちょうどあなたの时间に造船所に新しい船舶1隻を購入した。', 
    ['真是个翻脸不认人的混蛋！'] = '本当にかえない人の野郎!', 
    ['真是什么也瞒不了你啊，老戴肯。我看你现在陪这个年轻人玩冒险游戏如此兴致盎然，没有忘记我们七众盟约吧。'] = '本当に何も隠してないよ、老戴ケン。私あなた今この若者付き添って游アドベンチャーゲームとそ忘れないよう、私たち七众盟約だろう。', 
    ['真是好运气，这个什么笔搁就是女神之誓碎片制成的！天啊，居然有人用它来……笔搁是干什么用的？'] = '運がよかった、この何ペンは女神の棚に誓の破片で作った! ! ! ! ! !天よ、それを……ペンは棚に何用の?', 
    ['真是痛快的战斗！据点已经摧毁，俘虏也都解救出来了！让我们返航【巴塞罗那】喝一杯庆祝吧！'] = '実に痛快な戦い!拠点が破壊、捕虜も救える! ! ! ! ! ! !我々の【バルセロナ】帰航一杯祝賀ましょう!', 
    ['真是精湛的手艺！真想给舰队里所有的船都改造一番。'] = '実に目覚しい技工!をあげたい艦隊にすべての船も改造ひと。', 
    ['真是糟糕透顶、危机四伏的海域！'] = '大変下ら、危機的状況の海域で!', 
    ['真正努力过的人才会明白，天赋是最重要的。'] = '真の努力した人材がわかる、才能が一番重要なのだ。', 
    ['真没用，后面的突击船给我上！'] = '本当に无駄、うしろの突撃船に私に!', 
    ['真的吗？如果你能够帮助我达成心愿，我会给你奉上令你满意的报酬。'] = '本当に?もしあなたが私を助けてくれ、私はあなたに愿奉であなたの報酬満足。', 
    ['真的？只要我能重新为王，付出任何代价我也在所不惜。推翻东印度公司暴政的事就交给二位了。'] = '本当に?私は再び王、見返り私も辞さない。東インド会社暴政を覆すことは渡した位だ。', 
    ['真的？那一言为定！'] = '本当に?その一言を定!', 
    ['真相'] = '真相', 
    ['真诚的朋友'] = '心からの友达', 
    ['真高兴我们比英国人早发现这里，要不然这里足够让他们造多一个英国出来了！'] = 'うれしい我々英国人より早くここを见せ、ここで十分一英国造出た!', 
    ['真高兴见到你！勇敢的孩子，是你和你的船员用智慧和勇气为我们带来了这场重要的胜利！'] = 'あなたに会って嬉しい! ! ! ! ! !勇敢な子は、あなたとあなたの乗組員用の知恵と勇気を与えてくれるこの重要な胜利!', 
    ['眼睛'] = '目', 
    ['着火了！保护火药舱和酒桶！'] = '火事だ!保護火薬船と樽!', 
    ['着火啦！着火啦！'] = '火事よ!火事よ!', 
    ['瞄准桅杆！狠狠的打！'] = '帆柱を狙って! ! ! ! ! !の! ! ! ! ! !', 
    ['瞧瞧这艘倒霉家伙，这可是我们的前车之鉴。也许船里留下了什么宝物，让我下去看看。'] = 'この隻水差し人攫いやつ、これでも私たちの模様。船に残したかもしれない、私に何の宝物を见続けた。', 
    ['瞧瞧这艘倒霉家伙，这可是我们的前车之鉴。也许船里留下了什么宝贝，待我下去看看。 '] = 'この隻水差し人攫いやつ、これでも私たちの模様。船に残したかもしれない、私何か宝物を见続けた。', 
    ['瞧那边！那些家伙在干吗？难道……不！'] = 'ほらあそこ!あいつ、何やってるの?まさか……いや!', 
    ['瞧那边！那些家伙在干吗？难道……不，他们俘虏了许多本地人，还在将他们赶上船！'] = 'ほらあそこ!あいつ、何やってるの?まさか……彼らの多くは、捕虜地元まで、彼らは船に!', 
    ['瞭望'] = '瞭望', 
