    ['瞭望手的等级+%s'] = '瞭望手の等級+ %s', 
    ['瞭望手看到，一位年轻人正带领着民众突围，咦？这些海盗的旗帜很眼熟啊……'] = '瞭望手を见て、ある若者が率いる民衆包囲、おや?これらの海賊見覚え旗よ……', 
    ['知道是好东西就行了。我走了，别打扰我品尝82年的茴香酒。'] = 'いいものはいいました。私は歩いて、私に邪魔しないで82年の試食フェンネル酒。', 
