    ['确保$(missioncolor:【卑尔根】)、$(missioncolor:【奥斯陆】)和$(missioncolor:【斯德哥尔摩】)已在我们控制下，才能避免让我们在卢卡斯的大本营--$(missioncolor:【哥本哈根】)的战斗中腹背受敌！'] = '$(missioncolor:【確保舵根】)、$(missioncolor:【オスロ】)と$(missioncolor:【ストックホルム】)は我々制御下で避けてこそ、我々はルーカスのベースキャンプ——$(missioncolor:【コペンハーゲン】)の戦闘で応対腹背! ! ! ! ! !', 
