    ['确实如此。现在让我们尽快赶往$(missioncolor:【普利茅斯】)休整一番，然后面见德雷克问清楚霍金斯的情况吧。'] = 'なるほど。今(missioncolor早く駆けつけ$:【〔プリオシン】)休め、そしてあまりにドレークはっきり闻いたのでしょう。ホーキング', 
    ['确实如此，我试试看能不能用金币撬开海盗的嘴，打听一下拉比斯的消息。'] = 'なるほど、私をやって金货をこじ開け、海賊の口より闻くのニュースです。', 
