    ['船身受损严重，我需要援助！'] = '船体が損傷し、私が援助深刻な! ! ! ! ! !', 
    ['船身护甲'] = '船体护甲', 
    ['船身火炮'] = '船体の自走砲', 
    ['船运求助列表'] = '助けリスト船便', 
    ['船长:'] = '船長は、', 
    ['船长下令，要把马拉开波的值钱东西一点不留的搜刮出来，这需要点时间，但敌人的援军已经接近了，阻拦他们的前进。'] = '船長を命じ、马拉开波金目のものを残らず、少しの时间が必要だが、敌の援军が近づいてきて、彼らの前進塞いだ。', 
    ['船长们，我们的据点已迁移到 %s %s，让我们称霸新的港口吧！'] = '船長らが、我々の拠点移転%s %s、新しい港湾を制覇しましょう!', 
    ['船长任命'] = '船長の任命', 
    ['船长信息'] = '船長の情報', 
    ['船长信息界面'] = '船長情報インタフェース', 
    ['船长决定把他的船从“查理二世”改名为“幻想号”。嗯，这是一个好名字。但是，他为何要给全英国写信？'] = '船長の決定は彼の船から「チャーリー2世」と「幻想号」に改名した。うん、これはいい名前だ。しかし、彼はなぜか全英国の手紙を', 
    ['船长别冲动，“梅利号”没了还可以东山再起，但海盗人多势众，我们这么艘小舢板追上去会连人也没了……'] = '船長別冲动、「梅利号」はなかったが、人多势众再起海賊、こんなに隻の小さなボート追い付いてさえする人もなかった……', 
    ['船长大人，不如沿着海岸线继续追击霍金斯残余部队，一定要斩草除根！不能让他们继续干这种伤天害理的事！'] = '船長の大人よりも、海岸に沿って引き続き追撃ホーキング斯残余部隊は、必ず断ち切ら!彼らは引き続きそんな募るのこと!', 
    ['船长大人，市政厅的书记官给我们送来了投资分红。用这些资金，赚取更多的利益吧！'] = '船長さま、市庁の書記官に投資配当。この資金で、より多くの利益を稼ぎましょう!', 
    ['船长大人，我是向导，可不想负责战斗。你看我吹弹可破的肌肤，都被硝烟熏黑了！'] = '船長大人、私はガイドたく、担当の戦闘だ。あなたは私を见てプルプルの肌が黒く、八丁堀! ! ! ! ! ! !', 
    ['船长小心，有人袭击我们的船舰！火炮手准备，反击！'] = '船長の用心、我々の船を袭艦!自走砲手を準備し、反撃!', 
    ['船长就像在自己后院闲逛一样的悠闲，对方的船队已经集结了，他竟命令折返马拉开波，把这个到处还遍布冒烟灰烬的城市又洗劫了一遍。'] = '船長は、自分のように、のんびり裏庭ぶらついて相手の船団が结集した、彼は、この命令を引き返す马拉开波あちこちは煙の都市は灰を染め抜いた略奪一遍。', 
    ['船长提升属性'] = '船長を属性', 
    ['船长界面关闭按钮'] = '船長インタフェースの閉鎖ボタンを押した', 
    ['船长等级'] = '船長の等級', 
    ['船长需要同时扮演贤者和暴君两种角色。'] = '船長を同時に演じ賢者が必要と暴君の二つのキャラクター。', 
    ['船长！刚刚从酒馆得到确切的情报显示，摩尔人正在北非要塞【突尼斯】大规模集结兵力，看来他们又有行动啦！'] = '船長!さっき居酒屋から確実な情報によると、ムーア人がアフリカの要塞【チュニジア】大規模兵力集から、彼らがまた行啦!', 
    ['船长！发现敌人的一支船队企图突围！'] = '船長!敌の発見しようとする一派包囲船団! ! ! ! ! !', 
    ['船长！发现敌人的船队正要离港！是斥候船！我们被发现了？'] = '船長!敌の船団発見のべん出港!船は斥候! ! ! ! ! !我々が発見された。', 
    ['船长！坏消息！听说巴巴罗萨因为我们攻占亚历山大的行动而大发雷霆，正打算对我们进行报复呢！'] = '船長!悪いニュース!やけに闻から羅サルトル攻略アレキサンドリアの行動をするつもりで、怒って我々の報復だろう!', 
    ['船长！悬赏任务已经完成，请去港口的【商会】领赏。'] = '船長!悬赏任務は完成し、行ってください港の【商工会議所领赏】。', 
    ['船长！我们从商会得知:的商品正在热卖，0点前去任意港口出售这些商品，都能卖个好价钱！'] = '船長!我々は知っている商工会議所は、商品のヒットで、0時に任意の港湾の売却も、これらの商品の値段を売っていい! ! ! ! ! !', 
    ['船长！我们的防御舰伤痕累累，这样下去，迟早会不堪重负。'] = '船長!我々の防御艦伤だらけ、このまま行けば、遅かれ早かれ歪む。', 
    ['船长！我似乎闻到了特级商品的味道，快去$(missioncolor:【市政厅】)看看，说不定挣的钱可以给我们换一艘不错的船舰！'] = '船長!私は匂いの特級商品の味、早く行き$(missioncolor:【市庁】)を见て、お金を稼ぐことができるかもしれないの私に換一隻の船艦いい! ! ! ! ! !', 
    ['船长！我倒是迫不及待想要继续向敌人发起攻击，让他们瞧瞧我们舰队的威力了！'] = '船長!私は待ち続けたい敌に発議し、彼らを攻撃の威力を乳我々艦隊! ! ! ! ! ! !', 
    ['船长！我在仓库里发现一些旧羊皮纸碎片，貌似是悬赏任务的奖励。这东西真不知道到底有什么用。'] = '船長!私は仓库で一部の旧羊皮紙の一片を発見、郁は悬赏任務のインセンティブ。というものがわからない一体何の用だ。', 
    ['船长！黑市商人在本港口出现了，快去船厂看看吧！'] = '船長!闇商人は本港が、早く行き並外れてみましょう。', 
    ['船长，【%s】战役爆发了，委托人给予我们大笔赏金，希望我们能去平息。'] = '船長、【%s】バトル勃発した、依頼人は我々に大金を希望に赏金を静めた。', 
    ['船长，【汉堡】是敌人的心脏！确保我们已经攻占【里加】、【但泽】和【阿姆斯特丹】才能开始这里的战斗！'] = '船長、【ハンバーガー】は敵の心臓!我々はすでに確保攻略【リガ】、【しかし沢】と【アムステルダム】才能からここのバトル!', 
    ['船长，【酒馆】现在有一批航海士，前往招募%s次吧。'] = '船長、【居酒屋】今の航海士が、公募%s回だろう。', 
    ['船长，不好了，后方出现很多战船，他们朝着这边过来了！'] = '船長、後方多く、彼らがこっちに向かってぬくぬく! ! ! ! ! ! !', 
    ['船长，不要激怒他，我们根本不是他的对手……'] = '船長、絶対激怒、われわれは彼は彼の相手ではない……', 
    ['船长，世界那么大，带我去看看吧！点我可以查看咱们的行程备忘录……'] = '船長、世界大、私を連れて行ってみよう!私たちがポイントチェックの行程の覚書……', 
    ['船长，亨利王子对于我们驰援巴塞罗那的义举大为赞赏，这是授予您的封爵册，您这下可成了贵族老爷了。'] = '船長は、ヘンリー王子たち向かっバルセロナの義挙を高く、これはあなたの封爵授与册、お殿さまになった贵族で。', 
    ['船长，从与敌人的战斗中我们学习到了新的舰队阵型了呢！'] = '船長は、敵との戦いの中で私たちは新しい艦隊フォーメーションましたね!', 
    ['船长，作为一个航海士，一定要稳……'] = '船長、一航海士として、必ず安……', 
    ['船长，你可真幸运，把这位经验老到的航海士任命到舰队里吧。'] = '船長、あなたは本当にラッキー、この経験を任命しあわの航海士に艦隊に行こうよ。', 
    ['船长，你接到了一个多人任务！'] = '船長、あなた一人を受けたミッション!', 
    ['船长，你的船队看起来是新建立的，需要一个会计师么？'] = '船長、あなたの船団は新に建てた、一会計士が必要ですか?', 
    ['船长，你看那边！'] = '船長、ほらあそこ!', 
    ['船长，信物带来了吗？不同级的信物能在这里招募不同级的航海士哦。'] = '船長、神仏に?同级生の神仏はここでは同级生の航海士公募よ。', 
    ['船长，兄弟们喝醉后出海，撞上礁石，损失了大量货物。'] = '船長、兄弟たちが酔っ払って海に出て、冲突し、大量の貨物岩礁損失だ。', 
    ['船长，再往前走就是“魔鬼之手”--佛得角了！许多年以来，无数的航海家都在那个可怕的地方沉戟！我们能闯过去吗？'] = '船長は、すこし歩く「悪魔の手」——佛得角! ! ! ! ! ! !多くの年以来、无数の航海家はあの恐ろしいところ沈ん戟!われわれが过去ギー?', 
    ['船长，再提升一下吧，我有信心用最强大的火炮轰碎阿芒德旗舰的桅杆！'] = '船長、再引き上げましょう、私は自信が最も强大な火で砕け爆撃阿穂先徳売場のマスト!', 
    ['船长，再提升一下吧，我有信心用最强大的火炮轰碎阿芒德的旗舰！'] = '船長、再引き上げましょう、私は自信が最も强大の火である阿穂先徳のフラッグ砕け! ! ! ! ! !', 
    ['船长，去为我们的舰队进行【船舶升阶】吧，我们只有更强，才会有人愿意委托我们。'] = '船長が私の艦隊を段阶】【船舶リットルだろう、我々はより强く、という依頼たく。', 
    ['船长，去为我们的舰队进行【船舶强化】吧，我们只有更强，才会有人愿意委托我们。'] = '船長が私の艦隊を【船舶強化】でしょう、私たちはより强く、という依頼たく。', 
    ['船长，去寻找并购买%s个【%s】需要花费点时间，委托人可没耐心等下去。'] = '船長を購入し、探す%sつ【%s】时间かかる时、依頼人などないまま根気。', 
    ['船长，去强化我们的航海士吧，我们只有更强，才会有人愿意委托我们。'] = '船長、我々の航海士の強化だろう、我々はより强く、という依頼たく。', 
    ['船长，发现藏宝海湾入口！机会难得，快过去看看吧！'] = '船長、湾岸入口ん! ! ! ! ! !せっかくの机会なので、早く过去みましょう!', 
    ['船长，只要我的火炮再给力点，我早就轻轻松松地把他们轰得稀巴烂了！'] = '船長、私の自走砲をさえ、私はとっくにもう力点気楽に打って彼らを狼! ! ! ! ! ! !', 
    ['船长，咱们再加快些速度吧，我感觉到了塞维利亚美酒的召唤。'] = '船長、さあ、もう何でしょう、私は加速速度を感じてビヤ美酒の召唤。', 
    ['船长，商会又发布了大量悬赏令，这种机会我们可不能错过。'] = '船長は、商工会議所の発表した大量悬赏令、この機会を逃してはならないが。', 
    ['船长，图纸过多，部分低级图纸得去仓库查看！'] = '船長、図面が多すぎて、一部の低級図面に倉庫查看!', 
    ['船长，在您的带领下我们很快完成了任务，快到【商会】领取报酬吧。'] = '船長は、すぐご案内の任務を果たし、もうすぐ【商工会議所】受給报酬でしょう。', 
    ['船长，塞维利亚到了……咦？情况好像有点不对……'] = '船長、セビヤ…えっ?状況が少しいや……', 
    ['船长，大事不好了，拉比斯不见了！'] = '船長、ヤバイして、より消えた!', 
    ['船长，好消息，现在投资塞维利亚就能在市政厅领取一艘三维卡拉维尔！机不可失啊！'] = '今、船長、朗報投資セビヤで市庁受給1隻の3次元カラオケウィル!のぞいたあ!', 
    ['船长，好消息，现在投资塞维利亚就能在市政厅领取一艘双桅横帆船！机不可失啊！'] = '今、船長、朗報投資セビヤで市庁受給1隻のダブル桅横帆船!のぞいたあ!', 
    ['船长，如果坚持要继续前进的话！沿着海岸线继续向东，我们将会到达【亚历山大】，但是，那里就完全处于巴巴罗萨的实力范围了，我们将孤立无援！'] = '船長を固守すれば、前进を続けるなら!东海岸に沿って、我々は続けるが、アレクサンダー】【に到着し、そこは完全にはやけに羅萨の実力の範囲、我々は孤立无援!', 
    ['船长，委托人很满意我们的工作，快到【商会】领取我们的报酬吧。'] = '船長、依頼人たちの仕事に満足、もうすぐ【商工会議所】受給我々の报酬でしょう。', 
    ['船长，委托人很满意我们的表现，下次还会找我们合作，我们先去【商会】领取报酬吧。'] = '船長、依頼人の満足、今度は私たちが協力し、先に行って【商工会議所】受給报酬でしょう。', 
    ['船长，委托人急需我们赚取%s金币向他投资，回报很丰厚哦。'] = '船長、依頼人たちが稼いで%s金貨彼に投資、見返りが豊かですよ。', 
    ['船长，威尼斯人真是消息灵通！我们才刚到港，就有人求见你！说是什么什么公爵的代表呢。'] = '船長、ベネチア人は本当に消息筋!私たちはまだ港、不審あなた!何かというと、公爵の代表だろう。', 
    ['船长，对面人多势众，我们恐怕……'] = '船長、向こう人多势众、われわれは恐らく……', 
    ['船长，快前往【%s】倾销%s个任意类型商品吧，现在该港口物资急缺。'] = '船長、早くに【%s】ダンピング%sの任意のタイプの商品でしょう、今この港の物資が欠けた。', 
    ['船长，快前往【酒馆】进行%s次招募吧。'] = '船長、早くに【居酒屋】を%s次募集だろう。', 
    ['船长，您不能解雇任务中的航海士哦！'] = '船長、解雇できない任務の中の航海士ですよ!', 
    ['船长，您不能解雇编队中的航海士哦！'] = '船長、解雇できない編隊の中の航海士ですよ!', 
    ['船长，您不能选中编队中的航海士哦'] = '船長は、お选の航海士が編隊よ', 
    ['船长，您已提前结束副本，结算奖励将稍候通过邮件发放，请注意查收。 '] = '船長は、あなたの早期終結謄本、決済インセンティブを通じて発給がお待ち、メールチェックに注意してください。', 
    ['船长，您接受了委托人的悬赏，我们跟随你前往【%s】战场。'] = '船長、ご依頼を受けた时分に、私たちのお伴【%s】戦場に向かった。', 
    ['船长，您暂时没有设计图纸！'] = '船長、あなたが設計図面を!', 
    ['船长，您有新船正在制造，人手不足'] = '船長、あなたは新しい船、人手不足を製造している', 
    ['船长，您现在连说话都有贵族老爷的样子了。'] = '船長、今お话さえもある贵族の殿さまの様子。', 
    ['船长，您的舰队不小心撞上了暗礁，损失了部分货物。'] = '船長は、あなたの艦隊うっかり暗礁に冲突し、損失した一部の貨物。', 
    ['船长，您的舰队在经商时被海盗抢劫，损失了全部的货物！'] = '船長は、あなたの艦隊が、商で、海賊に強盗被害たすべての貨物!', 
    ['船长，您的舰队成功击退了来犯的海盗，还缴获了大量物资！'] = '船長は、あなたの艦隊を撃退したの来犯海賊は、大量の物資载以! ! ! ! ! !', 
    ['船长，您的舰队把丁香卖往文莱，赚取金币%s！'] = '船長は、あなたの艦隊を売り、ライラックブルネイに稼いで金货%s !', 
    ['船长，您的舰队把乳酪卖往波尔多，赚取金币%s！'] = '船長は、あなたの艦隊を売って、ボルドーへチーズ金貨%s !', 
    ['船长，您的舰队把乳香卖往霍尔木兹，赚取金币%s！'] = '船長は、あなたの艦隊を売り、乳香を稼ぐホルムズ金貨%s !', 
    ['船长，您的舰队把亚麻卖往里斯本，赚取金币%s！'] = '船長は、あなたの艦隊を売り、亜麻リスボンに稼いで金货%s !', 
    ['船长，您的舰队把人参卖往鹿港，赚取金币%s！'] = '船長は、あなたの艦隊人参を売って鹿港へ、金貨%s !', 
    ['船长，您的舰队把冰河泥卖往里加，赚取金币%s！'] = '船長は、あなたの艦隊を売って、氷河の泥を稼ぐリガ金貨%s !', 
    ['船长，您的舰队把卡瓦酒卖往比萨，赚取金币%s！'] = '船長は、あなたの艦隊を売るカード瓦酒を稼ぐピザ、金貨%s !', 
    ['船长，您的舰队把咖喱卖往巴士拉，赚取金币%s！'] = '船長は、あなたの艦隊を売り、カレーを稼ぐバスラ金貨%s !', 
