    ['船长，我在码头上看到有来自$(missioncolor:【佛得角】)的蓖麻！听商人们说这些质量上乘的蓖麻是佛得角的港口特产！我的直觉告诉我，如果能带回去欧洲出售，一定能赚到超乎想象的利润！'] = '船長、私、埠頭で见missioncolorから$(:【佛得角】)の蓖麻!商人たちは闻いてこれらの質の高い蓖麻は佛得角の港湾特産物!私の直感握り飯をすれば、必ず帰って欧州売却、稼げる利益の想像を絶する! ! ! ! ! !', 
    ['船长，我在码头工人那里得知，沿着海峡前进，可以到达【莫桑比克】，那可是个繁华的港口呢。'] = '船長、私はそこに、港湾労働者に沿って进む、海峡に到着できる【モザンビーク】、港湾の繁华街だろう。', 
    ['船长，我总觉得有点不对劲……他们有些过于热情了。'] = '船長、私は何だかおかしい……彼らが热しすぎた。', 
    ['船长，我想在帮你找回最后一块碎片之后，向你辞行去寻找我的“命运号”。'] = '船長、私はあなたに一片の一片を取り戻して最后に、あなたを探しに行く辞行私の「运命」号。', 
    ['船长，我担心我们是否准备好了，也许我们需要更好的战船及装备才能面对这个挑战！'] = '船長、私は心配したか、準備が必要かもしれない方のベットおよび装備こそこの挑戦!', 
    ['船长，我现在就去轰碎那个混蛋！'] = '船長、今すぐ行く破片几脚あの野郎!', 
    ['船长，战胜敌人后缴获了一些物资，也许可以用它们来提升我们的装备呢！'] = '船長で、敌を一部物資载以できるかもしれない、我々の装備をね!', 
    ['船长，拉比斯并不在亚历山大的监狱里，看起来她仿佛趁乱逃脱了。'] = '船長は、よりはアレキサンドリアの刑務所で、彼女はまるで混乱に乗じて逃げた。', 
    ['船长，掠夺开始了！'] = '船長、略奪が始まった!', 
    ['船长，攻占【卑尔根】、【奥斯陆】和【斯德哥尔摩】才能避免让我们在【哥本哈根】的战斗中腹背受敌！'] = '船長、攻略【舵根】、【オスロ】と【ストックホルム】避けこそ我々は【コペンハーゲン】の戦闘で応対腹背! ! ! ! ! !', 
    ['船长，敌人守军就在不远，让我们立刻发动攻击吧！'] = '船長は、敵守军、我々はすぐに近い攻撃ましょう!', 
    ['船长，敌人已经封锁了港口，正在集结他们的队伍，我们必须立刻出击，趁他们立足未稳，击败港口的守卫力量！'] = '船長、敌はすでに港を封鎖して、彼らの行列の結集しなければならない、私はすぐに、彼ら立足未稳出撃隙をくだし、港湾の守備力!', 
    ['船长，更好的装备才能让我们走得更远，去为我们的舰队进行【船舶强化】吧。'] = '良い船長、の装備が歩いて行く、父母は私たちの艦隊を強化】【船舶だろう。', 
    ['船长，更强的航海士才能让我们走得更远，快去强化我们的航海士吧。'] = '船長、より強い航海士が遠くて、さっさと強化の航海士たちだろう。', 
    ['船长，更强的船只才能让我们走得更远，去为我们的舰队进行【船舶升阶】吧。'] = '船長、もっと強の船舶が歩いて行く、父母は私たちの艦隊を段阶】【船舶リットルだろう。', 
    ['船长，最近塞维利亚对薰衣草的需求量很大，我们这趟贸易的目的地就定在$(missioncolor:【塞维利亚】)吧！'] = '船長、最近ビヤ、ラベンダーの需要が大きく、我々はこの貿易の目的地は$(missioncolor:【ビヤ】)だろう!', 
    ['船长，最近有消息称前往【%s】倾销%s个任意类型商品能达到利润最大值，我们赶紧行动吧。'] = '船長、最近情報筋に【%s】ダンピング%sの任意のタイプの商品が最大の利益、早く行动しましょう。', 
    ['船长，有个人拜托我将这封信交给您，说希望您能把它送到【%s】。'] = '船長は、個人の私に頼んでこの手纸をお渡しすると、ご希望にそれを運んで【%s】。', 
    ['船长，有了金币币咱们继续对火炮进行强化吧，嘿嘿，强力的装备。'] = '船長は、金货の弊を強化し続け、自走砲たちだろう、へへへ、強力な装備。', 
    ['船长，有了银币咱们继续对火炮进行强化吧，我已经对接下来的战斗迫不及待了！'] = '船長、あった銀貨语不続け、自走砲を強化しましょう、私はもうドッキングの戦闘せっぱつまった!', 
    ['船长，有人悬赏资助我们去为舰队进行【船舶升阶】，虽然不知道他的目的是什么？'] = '船長、出て行く时分に私は艦隊を支援阶】、【船舶リットルは知らない彼の目的は何ですか。', 
    ['船长，有人悬赏资助我们去为舰队进行【船舶强化】，虽然不知道他的目的是什么？'] = '船長、出て行く时分に私は艦隊を支援の強化、【】船舶は知らない彼の目的は何ですか。', 
    ['船长，有人悬赏资助我们去强化航海士，虽然不知道他的目的是什么？'] = '船長、行き懸賞支援の強化、航海士は知らない彼の目的は何ですか。', 
    ['船长，有人看见了挂着的一个大大的“陈”字旗帜的船只正在掠夺过往的船只，估计又是陈祖义的手下在为非作歹。'] = '船長、见たのが大きな「陈」の字の旗の船舶が过去の船舶略奪、また陈祖义の部下は、非行。', 
    ['船长，有消息称亨利王子准备在里斯本的王宫接见您这位英雄。'] = '船長は、ヘンリー王子は準備、リスボンの王宮の接見ご同英雄だ。', 
    ['船长，正在航行中，请返回港口后进行VIP购买!'] = '船長、航海しているうちに戻って下さい、港を購入後VIP ! ! ! ! ! !', 
    ['船长，每个港口的酒馆都能为客人提供丰富的悬赏任务，根据完成的难度给予丰富的奖励和经验！能借以提升您的经验等级，尤其每天的前10次，要记得完成哦！'] = '船長、港湾の酒屋が提供できる豊かな客の懸賞任務、完了の難易度のインセンティブを与えると経験豊富な! ! ! ! ! !あなたの経験すらしぶるアップできる等級、特に毎日の前の10回、覚える完成!', 
    ['船长，每多一艘船就意味着可以囤积更多的货物，利润也会随之增长。想想就好兴奋呢！'] = '船長、多一隻の船がより多くの货物を買いだめを意味する、利益も値上がりした。考えればいいか!兴奋', 
    ['船长，水手们都整装待发了，赶快出海对敌方发起攻击吧。'] = 'セーラーたちは、船長が势ぞろいした海は、早く、敵を攻撃するだろう。', 
    ['船长，汉娜，你们都消消气！我们现在只有三个人加一艘轻木帆船了，可没办法对付阿芒德庞大的舰队。先前往$(missioncolor:【塞维利亚】)，看看在那里能否得到些援助吧。'] = '船長、ハンナ、君たちも消おさまら!今は三人しか加一隻の軽いけれども、仕方木帆船対処阿穂先徳の膨大な艦隊。先に$(missioncolor:【ビヤ】)を见て、そこに何か支援さだろう。', 
    ['船长，港口商店里有我们需要的商品，赶紧去吧。'] = '船長、港商店に必要な商品が、早く行きましょう。', 
    ['船长，港口商店里的货物就要买完了，赶紧前往吧。'] = '船長、港の売店に貨物は、早くおしまいに买う。', 
    ['船长，现在是做买卖的黄金时期，快前往【%s】倾销%s个任意类型商品吧。'] = '今、船長は商売の黄金時代に、早く【%s】ダンピング%sの任意のタイプの商品でしょう。', 
    ['船长，皇家海军已经开始盯着我们了，等风声不紧的时候再动手吧!'] = '船長、ロイヤル・海軍が見つめてから、私などのときは風の音手だろう!', 
    ['船长，累了可以去收藏室休息一下，回顾一下自己的航海历程。'] = '船長、疲れた所蔵室へ行くことができる休憩を振り返って、自分の航海の歴程。', 
    ['船长，联盟需要我们的力量，赶快出海去攻击敌方吧。'] = '船長、連盟が私たちの力は、早く行きましょう。敌の攻撃に海', 
    ['船长，舰队的补给都已准备完毕，赶快去海上大肆掠夺吧。'] = '船長、艦隊の补给が用意され、早く行きましょう。大々的に略奪海上', 
    ['船长，船厂里的装备研究已经开放了，让我们去为装备强化提升吧！'] = '船長、船場里の装備を開放した研究が、我々を装備を強化ましょう!', 
    ['船长，船长，你看那边，那个身影……'] = '船長、船長、ほらあそこ、あの姿……', 
    ['船长，营地的情报屋已经启用了，您可以调派赋闲的航海士去完成各地搜集来的任务，除了能提升我们航海士的经验等级，还有机会赢取宝物哦！'] = '船長、キャンプの情報屋には起用したことで、あなたを守って行く中高年の航海士完成各地の任務は、収集が我々の経験を航海士等級、そしてチャンスよ!いくら踏ん張っ宝物', 
    ['船长，营地的材料工坊已经启用了，您可以调派赋闲的航海士去完成任务，生产我们装备研究所急需的材料啦！'] = '船長の材料は、ベースキャンプ青蛙に起用したことで、あなたを守って行く中高年の航海士任務を終え、我々が生産装備研究所の材料啦!', 
    ['船长，营地的贸易站已经启用了，您可以调派赋闲的航海士建设贸易站，为我们的情报屋提供更多更好的任务！'] = '船長、キャンプの貿易駅は、あなたを守って起用した中高年の航海士、建設貿易駅を我々の情報屋より多くの良い任務を提供する! ! ! ! ! !', 
    ['船长，营地的铸造厂已经启用了，您可以调派赋闲的航海士到铸造厂完成任务，铸造我们急需的宝物啦！'] = '船長は、キャンプの铸造厂に起用したことで、あなたを守って铸造厂中高年の航海士任務を終えるまで、私の宝物が鋳造啦!', 
    ['船长，虽然巴塞罗那已经解围了，但我们不少同胞被海盗俘虏，他们会被当成奴隶的。让我们攻击敌人的据点，拯救他们吧！'] = '船長は、バルセロナはしないが、小栗われわれ同胞が、海賊の捕虜された奴隷だ。我々の敵を攻撃拠点、彼らを救うだろう!', 
    ['船长，装备提升的效果非常显著呢，我们物资还有剩余，不继续升级我们的装备了吗？'] = '船長、装備向上の効果が著しいね、私たちも、物資残り続けない我々の装備をアップグレードしたか?', 
    ['船长，要是我们的火炮能再加把劲，我早就轻轻松松地把他们轰得稀巴烂了！'] = '船長、もし我々の自走砲をもう少し頑張れ、俺とっくに気楽にして彼らを叩き狼! ! ! ! ! !', 
    ['船长，请下达航向命令吧！'] = '船長、方向指示命令でしょう!', 
    ['船长，赶紧出发吧！【%s】战役需要我们这样强大的舰队。'] = '船長、さっさと出発!【%s】必要な戦闘に強力な艦隊。', 
    ['船长，赶紧去港口商店采购一批货物吧。'] = '船長、早く店の港を仕入れる貨物だろう。', 
    ['船长，赶紧去购买%s个【%s】吧，委托人可不只是委托我们一只舰队哦。'] = '船長、さっさと买%sつ【%s】でしょう、依頼人はただ一匹の艦隊依頼よ。', 
    ['船长，趁【酒馆】还没打烊，快去进行%s次招募吧。'] = '船長、【居酒屋】まだ閉店、早く行きを%s次募集だろう。', 
    ['船长，这个麻烦一大堆的家伙我们一定要去救吗？'] = '船長、この厄介の奴が必ず助けに行く?', 
    ['船长，这些敌人太强大了，我们还需要提升实力才行。前往【酒馆】，接受并完成悬赏任务，提升等级，才可以挑战实力强大的敌人。'] = '船長、これらの敵强すぎる、私は実力を上げてこそかかる行。【居酒屋】に受け入れ、懸賞金を完成し、任務をレベルアップできる実力こそ、挑戦强大な敌だ。', 
    ['船长，这人说话好奇怪，谁会不是自己……'] = '船長、この奇妙な人の话、谁が自分ではない……', 
    ['船长，这封送去【%s】的信函似乎非常紧急重要，我们得马上出航。'] = '船長、この封送っ【%s】の書簡は、我々が緊急重要にすぐに出港。', 
    ['船长，这是您上次在藏宝海湾寻获的宝贝，请验收吧！'] = '船長は、前回、あなたの宝物、湾岸うらんください!監理', 
    ['船长，这次出海打捞到了不少酒桶，兄弟们有酒喝啦！'] = '船長、海に今回の引き揚げが少なくない樽、兄弟たちは酒饮みだよ!', 
    ['船长，这次出海被鲨鱼袭击了，船只受损！损失了不少弟兄！'] = '船長、今回の出航を襲ったサメ、船舶が損傷し!被害を少なくした兄弟!', 
    ['船长，这次出海遭遇了暴风雨，船只受损！丢失了许多货物！'] = '船長、今回の海に、暴风に遭った船が損傷し!失われた多くの貨物!', 
    ['船长，酒馆里已经可以招募航海士了！我们只需要到酒馆准备好足够的佳酿，那些家伙就会自动扑过来。当然，有时良莠不齐、颜值不高是难以避免的啦！'] = '船長は、居酒屋で公募航海士! ! ! ! ! ! !我々に必要なだけの十分な準備の船居酒屋、連中に自動的に襲ってきた。もちろん、三洋の时、外貌水準が高いのは避けられないのよ!', 
