    ['英格兰人。做奴隶贸易起家的海盗，在印第安人中被称为“禁闭者”。在伦敦的奴隶拍卖会上与上流社会建立了利益关系，在灰色生意上总有人关照。'] = 'イングランド人。奴隷貿易から出発した海賊は、インディアンのうち「谨慎者」と呼ばれる。ロンドンの奴隷競売と上流社会の建てた利害関係は、灰色の商売にもよろしく。総', 
    ['英格兰人。其姑母是葡萄牙国王若奥一世的王后，定居葡萄牙后被王室委以重任，成为促成英葡两国结盟的功臣。与亨利王子是好友。'] = 'イングランド人。その叔母さんはポルトガル王若奥1世の妃、ポルトガルを定着され、王室抜擢実現英葡両国同盟の主役。ヘンリー王子とは亲友だ。', 
    ['英格兰人。典型水手的耿直、冲动和豪迈，会因一言不合大打出手，也会为梦想舍生赴死。虽然自诩为世界公民，但容不得任何人批评自己的祖国。'] = 'イングランド人。典型的なセーラー服の律義、冲动と豪快は、一言も、合わないから胸倉をかく梦舎生。世界は自称公民だが、誰もが自分の祖国を批判した。', 
