    ['英格兰人。印度洋大海盗，最早是武装民运船的船长，他特立独行、胆大妄为，贿赂官员得到民船委任状后四处抢掠，是社会名流和海盗们争相结交的对象。'] = 'イングランド人。インド洋の海盗、早ければ船の船長は武装学生運動、彼、むす言い張る度胸、ロビー官僚の委任状を民船略奪は、あちこち名士と海賊たちが先を争って知り合いの対象だ。', 
