    ['英格兰人。生来就是个亡命徒，喜欢挑战危险的事物，绰号“黑胡子”，被认为是大海上最疯狂、最残忍的海盗，他的骷髅旗几乎成为海盗的图腾。'] = 'イングランド人。生まれつきの亡命者が好きで、危険なものに挑戦し、ニックネーム「黒ひげ」は海で最も、最も残忍な狂気の海賊、彼の骸骨の旗はほとんど海賊のトーテムになった。', 
