    ['葡萄牙人、英国人和法国长得都一个样。'] = 'ポルトガル人、イギリス人とフランスが长い。', 
    ['葡萄牙人。中产阶级，父亲和兄长忙于从政，把家里的生意来交给他照料，而他在犯了大量低级错误后终于渐入佳境，取得了令父亲和兄长都吃惊的进展。'] = 'ポルトガル人。中産層、父や兄を、急いで政治家の商売に面倒で、彼は彼の犯した過ちを大量低級いよいよ佳境、父や兄でも惊くほどの進展だ。', 
    ['葡萄牙人。亨利王子忠心的侍从，也是约翰.恩里克航海方面的启蒙老师。虽然年纪不大，但操心的事情太多，所以总是一副苦大仇深的表情。'] = 'ポルトガル人。ヘンリー王子の忠誠の侍従も、ジョン。恩里克航海側の启蒙先生。年は大きくないものの、心配のことがあまりにも多すぎるので、いつも外面大いにつらの表情。', 
    ['葡萄牙人。凭借敏锐的危机意识和过人的胆量在加勒比海创出名声的狡猾海盗，是来往船只的噩梦。过去是个谜，名字也是假的，在海盗圈子里是个神秘偶像。'] = 'ポルトガル人。で、锐いの危機意識と振り切れの度胸はカリブ海創出名声のずるい海賊は、往来の船舶の悪夢だ。過去の谜、偽の名前も、海賊輪には谜がアイドル。', 
    ['葡萄牙人。原本是海军军官，因为酗酒被降职后索性做起了自由自在的海盗。势力不大但交友极广，无论军方还是海盗都不愿与他为敌。'] = 'ポルトガル人。もともとは海軍士官、飲酒後いっそ左遷された自由な海贼。勢力がない、いくら交友きわめて広軍は海賊が彼を敌としたくない。', 
    ['葡萄牙人。是个壮实的木匠，为了帮青梅竹马出头而误伤人命，开始逃亡生涯。一直认为误伤人命是自己的污点，但很多人因此敬畏他。'] = 'ポルトガル人。政友会の大工は、幼なじみの代を助けるために、亡命生活を始め误伤人命。误伤人命とは自分の污点が、たくさんの人が彼のため畏敬。', 
    ['葡萄牙人。曾经也是富家子弟，因赌博欠下巨额债务，浪子回头后得到资助，开始有了点起色，但麻烦接踵而至，目前要一面照看生意一面躲避债主。'] = 'ポルトガル人。かつては、賭博の子弟も借金、放浪者の巨額の借金を支援し、頻度が始まるが、少し迷惑ならひとつひとつ、現在面倒を避ける面商売面債権。', 
    ['葡萄牙人。有商业头脑的传教士，利用传教的机会兜售一些小商品，在各殖民地都有朋友，商船也乐于让他搭乘。在一次远东旅行中想到了一个新点子，只等大鱼上钩。'] = 'ポルトガル人。头の宣教師がビジネスを利用し、宣教のチャンスで、一部商品ディミーア各植民地が友达、商船も譲り彼の搭乗。一度の旅行では、極東思いついた新しいアイデアを一つだけ、魚などに钓った。', 
    ['葡萄牙人。有经济头脑的情报贩子，靠贩卖亦真亦假的情报赚了第一笔，同时也惹了不少麻烦，一直在寻找一位强有力的靠山帮他摆平一切。'] = 'ポルトガル人。経済が头脳の情報は、博労贩売亦真亦偽の情報を儲けたとともに、一ペンも面倒、ずっと探してある強力な彼の素顔揉み消し用すべて。', 
    ['葡萄牙人。没落贵族，为了中兴家族而成为一名殖民者，虽然外表与普通水手无异，但仍努力维持着自己的贵族标签，对荣誉一类的东西非常重视。'] = 'ポルトガル人。没落貴族のため、家族に一人で中興入植者は、外見と一般マリノスが維持むようなもので、努力して自分の贵族のラベル、栄光のたぐいのものを非常に重視する。', 
    ['葡萄牙人。父亲是殖民地总督，而他是殖民地行侠仗义的游侠，可以说专跟父亲作对。官方忍无可忍之下发出通缉令，卡瓦略不得不逃离殖民地。'] = 'ポルトガル人。父は植民地総督で、彼は植民地の义侠を果たすと、もっぱらソーサラー父亲と対立した。公式耐えざる手配をし卡瓦略脱植民地。', 
