    ['西伯利亚是俄罗斯联邦境内北亚地区的一片广阔地带，西起乌拉尔山脉，东迄太平洋，北临北冰洋，“西伯利亚”这个名称可能来自古突厥语，意思就是“宁静的土地”；早在石器时代以前，西伯利亚已经有人居住。末次冰期时代气候寒冷，所以当时的水位比较低。现时的白令海峡，当年有一条陆桥连接西伯利亚和阿拉斯加。现时美洲原住民的大多数人口都是透过这条陆桥从西伯利亚去到美洲的。'] = 'シベリアはロシア連邦内、北東アジア地域の広い地帯で、西から東太平洋ウラル山脈、豊富、北朝鮮隣接、「シベリアの北極海の可能性」という名称から古トゥルク・语、意味は「静かな土地」;早く、石器时代以前は、シベリアは住居。末次氷期时代の寒い気候、だから当時の水位が低い。现在のベーリング海峡は、同年アメリカシベリアとアラスカをつなぐ。米州の原住民なかれ多数の人口は透この条シベリアからアメリカへ行って米州の。', 
