    ['西班牙“无敌舰队”的主力炮舰，装配有多层的炮楼。依靠这种“海上要塞”般的战舰，西班牙一度成为了世界的海洋霸主。'] = 'スペインの無敵艦隊」の主力炮舰が、重箱の組み立て炮楼。こういう「海上要塞」のような戦艦、スペインは一時世界の海洋覇者。', 
    ['西班牙、意大利的航海家都会来这里学习。'] = 'スペイン、イタリアの航海家勉强もここに来た。', 
    ['西班牙与南美人原住民混血儿。会西班牙语，与各地水手混得熟络，为人淳朴善良，没有财富积累的观念，手头有一点闲钱就会在赌桌上输得精光。'] = 'スペインと南米人先住民の混血児だ。スペイン语と、各地で仲良くし、セーラー服の知らない素朴な善良な、富の蓄積した観念、手元が少し余裕がテーブルの负けてしまう。', 
    ['西班牙人。为了娶到自己的梦中情人不断做着发财梦，因听说某小岛有海盗的宝藏而出海，几年时间里虽然没有找到宝藏，但积累了丰富的航海知识。'] = 'スペイン人。自分の梦のために嫁にやって发财梦バレンタインデーは、ある岛は海贼の宝に向かい、数年間、まだ宝が豊富な航海の知识。', 
    ['西班牙人。乡绅世家，小时候被骑士小说冲昏头脑，在城市里攀援跳跃，把钟楼当龙穴。成年后依然故我，家人希望通过婚姻锁住他，而他索性逃到了海上。'] = 'スペイン人。乡绅一家、幼い顷から骑士小説イカレポンチに头は、都市の里を、攀援ジャンプ台が竜の穴だ。成人した後、家族の希望をしきつめて婚姻を通じて、いっそ彼を彼に脱出した海上。', 
    ['西班牙人。以一头火红的长发著称，在海盗中被称为“女爵”，为了找出逃婚的丈夫而专挑海军船只下手，其疯狂程度只有“黑胡子”可堪匹敌。'] = 'スペイン人。一匹の赤い髪で有名で、海賊に呼ばれた「女」を見つけるために爵、逃婚の夫に向け、その狂気ハツ海軍船舶程度は「黒ひげ」が皆に匹敵する。', 
    ['西班牙人。传奇大海盗“黑胡子”的女儿，喜欢男装打扮，从小苦练剑术并组织自己的马贼团，希望向抛弃自己的父亲复仇。'] = 'スペイン人。伝説海盗「黒ひげ」の娘が好きで、男装をし、オシャレの小さい剣組織自分の马贼団、自分を捨てた父親に復讐だ。', 
    ['西班牙人。博学的收藏家，尤其喜欢收藏各种地图，当发现各种航海地图描述差异极大时觉得马可.波罗等人都是大话精，准备出海亲眼见证真相。'] = 'スペイン人。博学のコレクター、特に好きな各種の地図、所蔵発見各種航海地図描いて大きな差に馬。ポロなどの人はすべて海と論じ精、準備を目の当たりに真相。', 
    ['西班牙人。性格坚毅的小胡子，为躲避当地领主的迫害溜上了远洋商船。5年时间，从一名与老鼠为伍的底层水手成长为商船的大副。'] = 'スペイン人。性格の髭を避けるため硬い、現地の领主の迫害に抜け出して遠洋商船。5年の时间、一人と鼠の底に明け暮れるセーラーを商船のうき成长。', 
    ['西班牙人。沉默而老道的水手，从来只谈生意不谈交情。在吵吵嚷嚷的水手圈子里被称为“冷面人”，但也有相当多的船长喜欢他的务实处事风格。'] = 'スペイン人。黙って許した水夫も、话しないだけの商売付き合い。セーラー服はざわざわの輪に呼ばれた「冷麺人」にも、かなりの船長好きの実務スタイル。', 
    ['西班牙人。脾气暴躁，嗓门儿大，在与海盗的交锋中被刺伤眼睛，伤疤让他显得更狰狞。但其实心地善良，喜欢小孩且擅长做各种玩具。'] = 'スペイン人。気性尖らせ、ハンは、海賊との対決で刺され、伤迹目彼がもっと凶悪。しかし実は、優しい子供好きで各種玩具が得意。', 
    ['西班牙人。英俊而激情洋溢的青年，有很大的志向，但半生都被霉运之神笼罩。虽然已经很少有船长敢招募他，但他仍然没有放弃自己的理想。'] = 'スペイン人。ハンサムで激情あふれるの青年は、かなりの志が、半生がジンクスの神に包まれた。船長は少ないが、敢えて公募彼は諦めずに自分の理想。', 
    ['西班牙人。贵族出身，因被仇家陷害丢掉了爵位和婚约，登上一艘商船开始流浪，一直试图找出陷害者。作为一个有故事的男人，明显与其他水手格格不入。'] = 'スペイン人。贵族の出身が、失った仇計略爵位と婚约を、1隻の商船から流浪、ずっとを探し計略者。一つとしては物语の男を、はっきりと他の轧轹マリノス。', 
    ['西班牙人为了殖民曾经大肆屠杀印第安人。'] = 'スペイン人の植民地が大々的に虐殺インディアン。', 
    ['西班牙人灾星'] = 'スペイン人灾星', 
    ['西班牙人皮萨罗毁掉了我们的国家。'] = 'スペイン人皮萨罗廃棄した我々の国。', 
    ['西班牙人禁止我们崇拜太阳神。'] = 'スペイン人たち。太阳神崇拝禁止', 
    ['西班牙人，是军方背景的贵族后代，从小被当做家族继承人培养。富有冒险精神思想单纯，但是认定的事情会一路走到黑。'] = 'スペイン人は、軍の背景の贵族の子孫、小さい顷から家族の後継者として育てた。富裕な冒険精神思想が、単なる認定のことまで黒。', 
    ['西班牙哈布斯堡家族曾经统治这里。'] = 'スペインハプスブルク家はかつて統治ここ。', 
    ['西班牙国王菲利普二世打算扶持玛丽成为英伦女王，不料玛丽却被伊丽莎白斩首。与此同时，女王的骑士德雷克竟然在加的斯港摧毁了数十艘西班牙船只，还在回程抢劫了葡萄牙贵重香料商船，终于为英国人与西班牙人之间的火药桶点燃了导火索。'] = 'スペイン王フェリペ2世女王になるつもりでし浮揚マリー、はからずもマリはエリザベス首切りされた。これと同時に、女王の骑士ドレークが、加賀の港を破壊した数十隻の船舶は、スペイン、ポルトガル帰り強盗贵重香料商船、ついには英国人とスペイン人同士の火薬庫引き金に点火した。', 
