    ['这个王冠上的珍珠，东方已经触手可及了。'] = 'この王冠の上に、东方の真珠が届きました。', 
    ['这个瓶子是……'] = 'この瓶は……', 
    ['这个美丽的城市如今满目疮痍，一片狼藉。该死的海盗们，接受正义的制裁吧！'] = '今この美しい都市、ボロボロになった。人でなしの海賊たちは、正义の制裁を受けましょう!', 
    ['这个蠢货扰乱阵形，让旗舰防御下降了。'] = 'この马鹿阵形を乱し、フラッグ防御下落した。', 
    ['这个该死的混蛋居然拆了我的“命运号”！没法修复了啊。'] = 'この人でなしの野郎が開けた私の「运命」号!修復できましたね。', 
    ['这个酒桶看起来没有什么特别之处，没想到里面居然藏有%d本【%s】，和%d个【%s】。'] = 'この樽は特に何の见える処、まさかが所持%d本【%s】と、%dつ【%s】。', 
    ['这个重要的港口吧！'] = 'この重要な港ましょう!', 
    ['这个重要的港口！'] = 'この重要な港!', 
    ['这么大的雨，视野都不清晰了，等等我们，小船可经不起折腾。'] = 'こんな雨、视野もはっきりしないなどと、私たちが、ボートは落ちるやうだ。', 
    ['这么快就醉了？！'] = 'こんなに早く酔ったのか?! ! ! ! ! !', 
    ['这么珍贵的东西，要牢牢掌握在自己手中。'] = 'こんなに贵重なものに掌握しなければならない。', 
    ['这么胆大的女人除了拉比斯我实在想不出第二位来。那我们就现在就前往海盗大本营$(missioncolor:【比绍】)去营救她吧，真是令人头疼的家伙。'] = 'こんなに肝の女より以外には思いつかない私は実に2位来。では今は海賊にベースキャンプ$(missioncolor:【比绍】)行きましょう、本当に彼女の救出困るなやつ。', 
    ['这么说你是要站在东印度公司那一边喽。'] = 'そう君は立って、東インド会社がそれですね。', 
    ['这么说您决定跟随船队出海就是为了找到老船长的继承人？'] = 'こうお追従する船団を見つけるために海には老船長の後継者?', 
    ['这么长时间以来，我见过的夷人，全部都是那些野蛮无理、长相奇异的强盗，所以就把你们也误认为来烧杀抢掠的海盗了。'] = '長い間、俺の夷人、すべてはあれらの野蛮無理な、奇妙なので、颜の强盗は君たちも来烧杀と略奪した海賊。', 
    ['这也叫海盗！简直就是不堪一击。'] = 'これも海賊!まるでひで。', 
    ['这也怨不得你。这下我是彻底没什么可去的地方了，只好留在这艘船上，你不会反对吧，亲爱的船长？'] = 'これもあなたの近代。これで私は徹底的になんの场所に行き、この船で、あなたに反対はしないだろうが、亲爱なる船長?', 
    ['这些兵匪难分的家伙原来全部都是巴巴罗萨.海雷丁的手下，消灭这些豺狼，不过要小心阿芒德的旗舰，奥斯曼海盗王可不是好惹的。'] = 'これらの兵匪難分の奴はもともと全部やけに羅萨。海レディングの部下、これらが、消滅豺虎注意阿穂先徳のフラッグ、オスマン海賊王はやっかいよ。', 
    ['这些勇敢的冒险家聚集在一起貌似是为了反抗海盗的压迫，我们已经剿灭了海盗，现在去市政厅投资，说不定会获得一位经验丰富的航海士的青睐呢！'] = 'この勇敢な冒険家が集まって反抗するためには、我々が海賊の圧迫剿灭海賊、今行く市庁投資を得かもしれないある経験の豊かな航海士のでしょう!', 
    ['这些古旧的碎片居然拼出了一张完整的藏宝图，出海探寻宝藏，看看有什么额外的收获吧'] = 'これらの破片が古びた一枚の完全なパッチワーク藏宝图、海に探る宝を见て、何の収获に別途のでしょうか', 
    ['这些只是零散海盗而已，实力不值一晒！根本连海盗团都称不上。'] = 'これらは、実力だけに値しない零細海賊日焼け!根本さえも海賊団ではない。', 
    ['这些奇怪的东西一起熬在一起真的能吃吗……'] = 'これらの妙なものと一绪に、一绪に食べられるシウォナダ本当か……', 
    ['这些家伙速度可真快，好像已经攻进了海上丝绸之路起点——泉州……那边是…达尔布克基！'] = 'これらの奴が早いスピードで、すでにゴールらしい海上シルクロードの起点——泉州……そちらは…ダルに基!', 
    ['这些巨型战舰里装载的是满满的鸦片，这些地狱之花给这里带来了永夜般的黑暗。死灰复燃的东印度公司仍然在制造无边的罪孽，碾碎他们！'] = 'これらの巨大戦舰にはいっぱい積まれた阿片、これらの地狱の花をここに永夜のような暗い。再燃の東インド会社は、依然として製造无辺の罪を砕き、彼ら!', 
    ['这些年来，东南亚多了许多欧洲人。'] = 'この年、東南アジア多かった欧州人。', 
    ['这些无耻的强盗，控制了国王，还掠夺了无数的黄金，一个也不能放过！'] = 'これらのずうずうしいの強盗、統制し、略奪国王は无数の黄金、一つも见逃せません!', 
    ['这些烦人的官兵就像苍蝇一样赶也赶不走，徐海决定自己带队击退追捕的官兵。'] = 'これらの将兵駄々っ子みたいようもないハエ追い出し追い出して歩いて、徐海自分を撃退する引率の追う将兵たち。', 
    ['这些犬牙交错的岛礁不仅可以掩护伏击，也可以分散船阵！'] = 'これらの犬牙岛礁交错するだけでなく、援護待ち伏せ攻撃もできる分散船阵!', 
    ['这些破旧的碎片居然是一张藏宝图，让我们看看藏宝地点在哪！'] = 'これらの破片は一枚のボロが藏宝图、場所はどこん! ! ! ! ! !', 
    ['这些防御炮台非常坚固，尽量将他们诱出炮台火力覆盖范围，再逐个消灭。'] = 'これらの防御の砲台が固い、彼らをできるだけ诱砲台火力カバー范囲、消滅一つ。', 
    ['这伙海盗的做法是每次交易都选择在半夜进行，为的是方便实施抢夺。但同意半夜偷偷交易的难道不也是非法商品贩子吗？不用跟他们“客气”。'] = 'この海賊のやり方は毎回取引が選択は夜半をつくり、便利を奪い実施。しかし夜中こっそり取引の同意も不法商品博労?「远虑なく」と。', 
    ['这伙海盗！打着贸易公司的旗号无恶不作。现在，他们的指挥官彼得松.霍因又指挥着他的海盗船队扑向了新大陆。'] = 'この海賊!貿易会社の旗印を无恶不作。今、彼らの指揮官がピーター松。かくも指揮して彼の海賊船団に飛びかかって新大陆。', 
    ['这伙海盗，在攻击了普林西蒲城后，不但没有仓皇逃走，竟敢企图进攻贝略港。做好准备，给年轻的对手一个难忘的教训。'] = 'この连中は、海賊の攻撃した後、普林西蒲城气がないだけでなく、逃げる利攻撃しようとした。やや港贝準備を相手に、若いの忘れられない教訓だ。', 
    ['这位先生，难道您还不知道吗？那些打着商人旗号的家伙其实贩卖的商品正是……我的同胞呀！已经有许多兄弟姐妹被那个可恶的家伙给贩卖去了天涯海角，再也见不到了！！'] = 'こちらさん、まさかあなたは知らないんですか?あれらのやつを旗印の商人は実は人身売買の商品こそ……私の同胞よ!すでに多くの兄弟姉妹のあの畜生奴、人身売買の果てに行った、もう会えない! ! ! ! ! ! ! ! ! ! ! !', 
    ['这位大叔，不要激动，现在让我们一起来了解您的故事。'] = 'このおじさん、感激のない、今にあなたの物语。', 
    ['这位新来的水手长居然会熟练地使用钩锁，船长，你可赚大了。'] = 'ナムオ甲板長を苦しめるのが、上手に使うフック船長が、键を稼いでた。', 
    ['这句话的意思是把猴封起来非常合我心意，这样海面上就会风平浪静。'] = 'この言叶の意味は、サル封非常合私の気持ちは、海面に凪いだ。', 
    ['这只船正在使用'] = 'この船を利用しているだけだ', 
    ['这可是个好消息，也不枉费我多浪费了几天。我们现在就去改造吧，我早就想给旗舰多加两门火炮。'] = 'これは、私もないニュースしゃあしゃあと浪費した余り数日。今すぐ行くでしょう、私はとっくに改造を与えたい2ドア砲フラッグ。', 
    ['这可是个好消息，我早就想给旗舰上多加装两门火炮了。'] = 'これは、私に早く知らせたい売場にインストールした約2ドア砲。', 
    ['这可是个好消息，马上就去造船厂。'] = 'これは、すぐ行く造船所。', 
    ['这可是好东西！这上面记录着经历丰富的冒险家们的毕生经验.交给你的航海士阅读，可以提升阅历，增长知识。'] = 'これでもいいもの!その上に経験豊富な記録の冒険家たちの生涯の経験に任せた。あなたの航海士を読むこと、経験、成長知識。', 
    ['这可真是个好地方呢！茂密的丛林和辽阔的草原，看来这是个适合发展，值得投资的好地方呢！'] = 'それはとてもいいところですね!鬱蒼とした森と広い草原に、どうやらこれは発展し、投資価値のいいところですね!', 
    ['这可真是个好消息，戴肯叔叔。就按您说的办。'] = 'これは本当に嬉しい、おじさん。ケンはあなたの言う。', 
    ['这场战役实在是太惊险了，没想到陈祖义如此心狠手辣，竟然都是下死手。'] = 'この戦いはあまりにスリルなかったそう陈祖义とても残酷で、なんとは死の手だ。', 
    ['这场战斗真是艰难，维达号名不虚传！'] = '戦いは本当に厳しいが、维达号さすがです! ! ! ! ! !', 
    ['这场荒唐的战争该结束了，我会向民众证明这场战争是个错误，你们只是无辜的受害者。'] = 'この突拍子のない戦争が終わると、私は、この戦争は間違って民衆証明、善意の被害者だけだ。', 
    ['这块冰看起来没什么威胁，不过我们还是轰碎它吧，别让它挡着路。'] = '氷が、見えない脅威は割れ几脚でしょう、それが立ちはだかる路。', 
    ['这块大陆上要什么有什么。'] = 'この大陸に何が何だ。', 
    ['这大英帝国可真舍得下这么大的血本……'] = 'この大英帝国は本当にただの下の金相佑……', 
    ['这对你来说的确有失公平，难道你要因此卸下你肩上的责任？'] = 'これはあなたにとってたしかに公正を、あなたのために責任を取り外す肩?', 
    ['这就明了了！海盗其实是有两拨，一波是真正的海盗，而另一波则是……来不及了，我们火速赶往卡利卡特增援！'] = 'これは明瞭! ! ! ! ! ! !海賊は実は2回し、波は真の海賊に、もう一波は……间に合わない、军势早速ミカエリスカーター増援!', 
    ['这就是糖胶？真想不到长相那么凶恶的乌加尔·马丁能用这些东西做出那么精制的糖人。'] = 'これは糖?真ふとした颜じゃあ凶悪の烏加尔·マーティン使えるものにこれらの糖人そんなに精制された。', 
    ['这就是索法拉么？看起来就像个小渔村呀！'] = 'これは索ファレリー?まるで小さな渔村よ!', 
    ['这就是那群海盗的首领了'] = 'それが群海賊の首領ました', 
    ['这就足够了！愿诸神保佑你我，如果有机会，我一定回来助你一臂之力！以报答你的慷慨援助！'] = 'これで十分!あなたは私の諸神に愿神頼み、機会があれば、私はきっと帰って助君です!あなたの気前を報いる支援!', 
    ['这帮混蛋！'] = 'これらの野郎!', 
    ['这年月想做海盗的比想做骑士的还多！'] = 'この年月やりたいのやりたい海賊よりも多い骑士の! ! ! ! ! !', 
    ['这并非易事，我想我们需要准备充分才行。'] = 'これは容易なことではない、私が十分に準備した。', 
    ['这座城市原来是玛雅人的特奥城。'] = 'この都市はもともとマヤのテオ城。', 
    ['这座城市的实际统治者不是总督，而是银行家们。'] = 'この都市の実際の支配者は総督ではなく、银行家たちだ。', 
    ['这座城市的年纪比葡萄牙王国的年纪还大呢！'] = 'この都市の年齢よりもポルトガル王国の大ですね!', 
    ['这座岛被称为印度洋上的明珠。'] = 'この岛のインド洋での名手と呼ばれる。', 
    ['这座港口是从穆斯林的手中夺来的。'] = 'この港は、イスラム教徒の手に夺った。', 
    ['这座港口是根据圣经中的圣多美日命名的。'] = 'この港は、圣书の中の聖多美日と名付けられた。', 
    ['这座港口没什么有意思的东西。'] = 'この港いや面白いものです。', 
    ['这座贸易港可真繁盛，人们都在港口边忙碌。'] = 'この貿易港が栄え、人々は、港の下働き。', 
    ['这很突然……'] = 'これは突然……', 
    ['这我倒是没意见，那家伙差点害我没命，不过，我要先到加尔各答一趟，顺便还个欠下的人情。'] = 'それは、あいつがハンディー害私が、私の农学校に行っても、カルカッタついでの借金の人情だ。', 
    ['这我倒是还没考虑过，你可以说说你的条件，太难的要求我可做不到。'] = 'それはまだ考え、あなたを教えて、あなたの条件を要求し难のことできない。', 
    ['这战力，并不是贩奴船！而是普通的商船！'] = 'この戦いの力は、贩奴船!普通の商船ではなく!', 
    ['这才是我葡萄牙的勇士！正好，最近威尼斯联邦牵头组建神圣联盟，准备讨伐奥斯曼海军，奥斯曼海军统帅正是巴巴罗萨，第一块信物就在他手中。'] = 'これこそ私のポルトガルの勇士!ちょうど、最近ベニス連邦リーディング・構成、圣連盟準備讨伐オスマン海軍、オスマン海軍統帥権者こそ、やけに羅サルトルの第一は、彼の手の目印だ。', 
    ['这支神秘的工匠锤是工匠公会的信物，有了它就可以找到那些臭脾气的老工匠协助我们改造船只'] = 'この谜の职人は职人公労の槌をしたが、それは神仏を見つけることができるあれらの臭気心の老职人の協力を改造して船', 
    ['这支神秘的工匠锤是工匠公会的信物，有了它就可以找到那些臭脾气的老工匠协助我们改造船只。不过那些臭脾气的老工匠C级以下的船只可看不上眼。前往【舰队】，改造C级或以上船舶'] = 'この谜の职人は职人公労の槌をしたが、それは神仏を見つけることができるあれらの臭気心の老职人の協力を改造して船。しかしその臭気心の老职人C級以下の船舶もできる目。【艦隊】に、改造C級以上の船舶だ', 
    ['这是一个大海贼时代，前往伟大的航路吧！'] = 'これは大贼时代に、伟大な航路ましょう!', 
    ['这是一张记录着宝藏埋藏地的地图。'] = 'これは一枚の記録に宝の地図に埋蔵された。', 
    ['这是一点小小的心意顾问先生，您看能不能通融一下……'] = 'これは少し小さな気持ち顧問さん、ちょっと融通いただけない……', 
    ['这是个锤子？'] = 'これは槌?', 
    ['这是什么东西？船上的渔网居然没人会用，还是离这个怪物远一点吧！'] = 'これは何ですか?船の漁網でなかった人も、この怪物から远う!', 
    ['这是什么？'] = 'これは何ですか?', 
    ['这是冒险家协会为新人冒险家的准备的宝物精华，这些足够你把这门火炮提升一阶，不过，之后升阶所需的宝物精华，只有通过冒险来获得了。'] = 'これは冒険家協会は新人の冒険家の準備の宝物エキス、これらを十分あなたこの門砲を一阶、でも、后段阶に必要な宝物エッセンスリットルを通じてのみ、冒険を上げた。', 
    ['这是刚刚那个废物口中“美丽的宝瓶”——塞壬低语魔瓶，可笑的家伙，居然只把它当做一个美丽的装饰品，真是愚蠢！'] = 'これはさっきの廃物の口から「美しいみずがめ」——ふさぐ壬ささや魔本、おかしな奴だ、なんと受け止めれだけの美しいアクセサリー、愚かな!', 
    ['这是因为贪婪！从战争英雄到成功商人，到最后沦为恶贯满盈的海盗，是欲望与贪婪使你变得多面……'] = 'これはむさぼる!戦争の英雄は成功するまで、最後まで恶贯满盈商人に転落した海賊は、欲望と貪欲あなたが多くなり面……', 
    ['这是塞壬低语魔瓶，它就能创造出真实的幻境，你曾打败过的敌人会以更强大的姿态重新出现。挑战并打败他们，你就会得到魔瓶上一任主人——迪亚士封印在里面的奖励。'] = 'これはふさぐ壬ささや魔瓶を作ることができ、その真実の如きは、あなたの敌を破って、より強い姿勢再登場。挑戦して彼らを、あなたは魔瓶で初代主人——ディアス封印は奥のインセンティブ。', 
    ['这是我为拯救昔日故友的一点心意，你不用推辞，现在我帮助你，以后我会需要你的帮助……'] = 'これは私を救うために、故郷の気持ち、昔日のあなたを断った、今私が助けたのだから、これからはあなたの助けが必要……', 
    ['这是我们应做的，夺回巴塞罗那只是开始，我们的目标是彻底消灭敌人！可惜我的人手不足，您是一名航海士？'] = 'これは私の奪還、バルセロナはただから、我々の目標は一掃し敌!残念ながら私の人手不足で、あなたは一人の航海士?', 
    ['这是汉萨同盟最强的力量，正面强攻无异于以卵击石，先攻击旁边的护卫船，瓦解他们防线，最后围歼这只“雄鹰”。'] = 'これは漢萨同盟最強の力が、正面攻撃に先制攻撃を押し上げよ以卵击石、隣の护卫船、彼らの、最后围歼瓦解マジノ線だけ「スーパー・イーグルズ」。', 
    ['这是海洋女神之誓言，据传在它共有7块，分布在世界的七大海域之中，据说集齐七块碎片，才能获得面见女神的资格。这块碎片正是当年我亲手交给你父亲的一块……'] = 'これは海の女神の誓いは、計7個、分布は、世界の中で、七海域という七块手編みの破片を賜りこそ、女神の资格。この破片は私に手渡しでお父さんの……', 
    ['这是葡萄牙总督达尔布克基的旗帜。'] = 'これはポルトガル総督ダルに基の旗。', 
    ['这是！'] = 'これは!', 
    ['这枚被他当做假眼的物件就是霸主信物，巴巴罗萨貌似要说一些秘辛。不好，有人偷袭，巴巴罗萨中弹身亡'] = 'この発として目されて偽の物件は、やけに覇者の目印と羅サルトルの秘话らしい。悪い、やけに襲いかかれ羅ピザで撃たれて死亡した', 
    ['这样不会耽误我们的行程吧。'] = 'こんな取りかえしない私の行程だろう。', 
    ['这样你就可以顺利的掌控整个印度洋了。'] = 'そうすれば君が顺调に掌握した全体のインド洋。', 
    ['这样做出来的东西真的能吃吗？'] = 'ようのものが本当に食べるか。', 
    ['这样啊，实在太可惜了，至少700%的利润啊，太可惜了，太可惜了，太可惜了……'] = 'そうか、まことにもったいない、少なくとも700%利益のああ、もったいない、もったいない、もったいない……', 
    ['这样的一个港口重镇自然有很多人盯着，我手下的一个水手刚刚和我说，张保仔想见你，想和你一起啃下最难啃的港口马六甲。'] = 'この港の重鎮自然が多い人をじろじろ、私の部下のセーラー服と私は、张保仔ばかりあなたに会いたいと、あなたと一绪に啃下最もかじるの港湾マラッカ。', 
    ['这样的对手我都赢不了，还要怎么去挑战阿芒德？怎么去救出拉比斯？怎么去找到失踪的父亲呢？我真是……'] = 'そんなの相手に胜てないで、私はあまり行きも挑戦阿穂先徳?どう救出より斯?行方不明の父どう?私は本当に……', 
    ['这次就当是个教训，骄兵必败，你当引以为戒。但是这场战斗过后，我们需要休养生息，才有机会攻破陈祖义的老巢，找到女神之誓碎片。'] = '今回は、骄兵必败教訓は、あなたを戒める。しかし戦いの后、私たちが生息こそ、チャンス陈祖义のねぐらを攻略、女神の誓一片。', 
    ['这次收获可真不少！不仅获得%s金币，还有%s个【%s】。'] = '今回の収获が少なくない!%s金货だけでなく、また%sつ【%s】。', 
    ['这款游戏是中国人开发的。'] = 'このゲームは中国人の開発だ。', 
    ['这片海域都在巴巴罗萨的势力范围内，要继续前进，必须先清除沿途2个'] = 'この海域はやけに羅萨の勢力の範囲内で、前进を続けるなら、沿道に2つの除去', 
    ['这片海域，寒风和浮冰都让人难受，喝一口烈酒投入战斗才能让人热血沸腾起来。'] = 'この海域は、風と流氷がつらくて、一口饮飲みほし戦闘投入できる人血を沸かせた。', 
    ['这真是一个伟大的文艺复兴时代！'] = 'まことに偉大なルネサンス时代!', 
    ['这真是个艰难的任务'] = 'これは本当に厳しい任務だ', 
    ['这真是让我痛不欲生，我的梦想就是消灭这种苦难，请你一定帮助我！到开普敦找到曼德拉王子，他一定会伸出援手的！'] = 'これは本当に私を忘れて、私の梦はこの苦消滅て、私を助けてくれ!ケープタウンから見つけマンデラ王子、きっと彼は手を差し伸べて!', 
    ['这真是让我痛不欲生，我的梦想就是消灭这种苦难，请你一定帮助我！到开普敦找到曼德拉王子，制止霍金斯的罪行！'] = 'これは本当に私を忘れて、私の梦はこの苦消滅て、私を助けてくれ!ケープタウンから見つけマンデラ王子、制止ホーキング斯の犯行!', 
    ['这种托后腿的队友真是令人头痛，不过唯一的好处是能够帮我们分散火力。有消息称，红胡子在偷袭神圣同盟旗舰时，被四散奔逃的神圣同盟舰队冲散了阵型，这对于我们来说可是个好机会。。'] = 'この托後足の仲間は困るけど、唯一の利点は我々の火力が分散した。消息筋によると、赤ひげはとっぷり神圣同盟売場の時、散った神圣な同盟艦隊奔逃头フォーメーション私たちにとって、これでもいい機会だ。', 
    ['这种材料不允许合成'] = 'こういう材料の不許可合成', 
    ['这简直是侮辱，谁都知道我们欧洲商人最讲信誉。'] = 'これは谁でも知っている、私を侮辱欧州商人の最も信用。', 
    ['这美丽的纹饰，锋利的剑刃，真是一件精良的武器。'] = 'この美しい薫る、锐利な刃一件、本当に良い武器。', 
    ['这群小鬼还真难对付！'] = 'この群の小僧はまだ本当に苦手!', 
    ['这群屠夫连平民都不放过，一定要保护这些果阿难民安全撤离！'] = 'この群のステッカーがさえ逃さない庶民を保護し、必ずこの果阿難民安全撤収!', 
    ['这群疯狂的家伙，居然对总督大人的悬赏令置若罔闻，又在我们眼皮底下进行犯罪活动，这次一定要把他们一网打尽。'] = 'この群の狂ったやつが、大人の悬赏令、総督の背は、我々がまぶたの下を、今度は必ず犯罪活動を一網打尽彼ら。', 
    ['这自然没有问题。辛西亚，过来帮忙。'] = 'この自然の問題はない。辛西アジア、手伝え。', 
    ['这艘轻木帆船恐怕无法在后续的战斗中发挥更大的作用。'] = 'これはおそらくない軽い木帆船隻、後続の戦闘においてより大きな役割を果たす。', 
    ['这里举例黄金海岸非常近。'] = 'ここで例えば黄金海岸がとても近いです。', 
    ['这里也是非洲的奴隶贸易据点之一。'] = 'ここもアフリカの奴隷貿易拠点の一つ。', 
    ['这里全称是圣迪西玛特立尼达德圣玛丽亚港布宜诺斯艾利斯。'] = 'ここのフルネームはヒマラヤは西引き立つ徳サンタマリア港ブエノスアイレス。', 
    ['这里到处是坚硬的浮冰，在没人会清除障碍之前，我们得小心绕过去。'] = 'ここには流氷の硬い、人がいないし、障害物をとり除こまで注意を过去。', 
    ['这里到处都是亨利·摩根的悬赏令，他居然还敢出现在这里。'] = 'ここはどこもヘンリー・モルガンの悬赏令彼が、またここに现れた。', 
    ['这里发生了什么事，为什么码头上的人突然惊慌奔逃？我们可不会伤害他们的呀！'] = 'ここで何が起きたか、どうして埠頭の上の人が急に慌て奔逃?我々は彼らを傷つけないのよ!', 
    ['这里可不是异教徒该来的地方！'] = 'ここは異教徒の来るべきところ!', 
    ['这里地处干旱地带，只能从事畜牧业和贸易。'] = 'ここは乾燥地帯、畜産農家と貿易。', 
    ['这里安全得有点诡异啊。'] = 'ここでちょっと不気味安全よ。', 
    ['这里就是$(missioncolor:【蒙巴萨】)——约翰王的国度！听说这里与欧洲王室有着密切的关系，所以并未被霍金斯染指。'] = 'ここが$(missioncolor:【モンバサ】)——约翰王の国!ここで欧州王家と聞いて密接な関系をお手つきされなかったホーキング斯。', 
    ['这里就是【卑尔根】，好冷啊！'] = 'ここが【舵根】、寒いですね!', 
    ['这里就是【蒙巴萨】，约翰王的国度！听说迪亚士的任务之一就是寻找到她！真可惜他没有坚持下来。'] = 'ここが【モンバサ】、约翰王の国!闻ディアスの任務の一つが、彼女を探して! ! ! ! ! !惜しい彼は坚持した。', 
    ['这里就是传说中的新世界了！'] = 'ここは伝说の新世界(シンセゲ)! ! ! ! ! ! !', 
    ['这里就是伦敦，连空气闻起来都是茶香，我们初来乍到又人生地不熟的，戴肯叔叔，你觉得该从何处下手寻找女神之誓的消息呢？'] = 'ここは、ロンドン、空気も嗅いでは、またオバコワラウくつろが避免かぶった、ケンおじさん、どこから探しとハツ女神の誓のニュース?', 
    ['这里就是你们欧洲人所说的新世界。'] = 'ここはお前の欧州人の新世界(シンセゲ)。', 
    ['这里就是因向外输出大量的鹿皮而得名“鹿港”的地方，是一个非常繁荣的天然良港，因此不少夷人都觊觎此处。'] = 'ここでは、外に大量の出力の由来:「鹿港」の场所は、非常に繁栄のため、少なくない天然◆夷人がここをにらんだ。', 
    ['这里已经是印度啦！'] = 'ここではすでにインド啦!', 
    ['这里已经是印度洋的西岸了。'] = 'ここはインド洋の西岸ました。', 
