    ['这里是世界上最古老的香水产地。'] = 'ここは世界最古の香水の产地。', 
    ['这里是丹麦王国的首都。'] = 'ここはデンマークの王国の首都。', 
    ['这里是前往非洲南部或返回欧洲的中转站。'] = 'ここでは、アフリカの南部や欧州のハブに戻った。', 
    ['这里是加勒比海的大都市，投资有丰厚回报。'] = 'ここはカリブ海の大都市、投資が手厚い見返り。', 
