    ['这里曾经和琉球长期贸易，后来因为倭寇之乱终止了。'] = 'かつてここと琉球長期貿易、倭の乱を中止した。', 
    ['这里最多七个字'] = 'ここで最多七字', 
    ['这里最多有八个字'] = 'ここでは最大8文字', 
