    ['这里的天气非常炎热，很多殖民者适应不了。'] = 'ここの天気はとても暑いに適応できず、多くの入植者。', 
    ['这里的物产真是丰富，许多见所未见的商品，一定能卖出好价钱！'] = 'ここの物産本当に豊かで、多くの商品のない、きっといい値段で売れること!', 
    ['这里的白葡萄酒味道也不错，不比波尔图的差。'] = 'ここの白ワインの味もいいが、ポールの差図に劣らず。', 
    ['这里的鱼虾非常美味。'] = 'ここの果実が美味しい。', 
    ['这里离中国杭州和日本长崎都不远。'] = 'ここは中国杭州と日本长崎も遠くない。', 
