    ['这里要是有一条运河就好了。'] = 'ここがあったらよかった一条運河。', 
    ['这里还真是个不错的地方呢，如果作为向南探索的落脚点一定不错，不妨投资这里，使这里发展起来吧。'] = 'ここはいいところだろう、南に探求のスタンスが、きっといい投資ここ、ここの発展につながるでしょう。', 
