    ['陈祖义的海上战术是出了名的诡谲，最善使用谋略，多次从大明海军手中逃脱，下一个目标$(missioncolor:【泗水】)他估计已经设下了陷阱。'] = '陈祖义の海上戦術は、最も善のdvdを使用、数回にわたって、谋略デミョン海軍から逃れ、次の目標$(missioncolor:【スラバヤ駐在】)彼が新設さで罠だ。', 
