    ['陶斯印第安村保存了一系列的居民点和仪式中心，是具有史前传统的阿那萨基印第安部落文化的典型代表，村落可能出现在公元1400年以前，并且是由瓜得鲁普爵士条约确定的边界北部保存的最好的村落。'] = 'インディアン村陶斯保存した一連の居民点と式センターは、先史時代の伝统のおそれ萨基インディアン文化の典型的な代表、集落かも西暦1400年以前、そしては、瓜得ルフジャズ条約の境界確定北部の保存の最高の集落。', 
