    ['随着政治、信仰、领土及商业竞争等领域摩擦的升温，基督教国家与强大的奥斯曼帝国之间的战事已是无法避免。在希腊勒班陀近海，由西班牙王国、威尼斯共和国、教皇国、萨伏依公国、热那亚共和国及马耳他骑士团组成的神圣同盟即将与雄霸地中海的奥斯曼海军展开一场空前绝后的海战，这场战役，将最终决定的绝不仅仅是海军的胜负！'] = '政治的、信仰、領土や商業競争などの分野で摩擦の加熱し、キリスト教国と強力なオスマン帝国の間の戦場にすでには避けられない。ギリシャでは、巳班陀の近海でスペインの王国、ベネチア共和国、教皇国ルビエンフィブリック、伏依公国、ジェノア共和国やマルタの骑士団で構成された神圣同盟と地中海の制覇をオスマン海軍残酷绝后の海戦、この戦いは、最終決定は海軍の胜负!', 
    ['随着欧洲人的扩张，对于霍尔木兹海峡的争夺已经无可避免，加入保护海峡的防御力量，抵御敌人的进攻。'] = 'ヨーロッパ人の拡張、ホルムズ海峡の争いは避け、保護海峡の防御力を、敌の攻撃を防ぐ。', 
    ['随着等级提升开放四个专用建筑，命令手下赋闲的航海士完成对应营地任务，获取丰厚的任务奖励及航海士经验！'] = '開放によって等級を4専用の建物で、部下の航海士命令中高年の完成に対応し、泊る任務ヨーロツパの任務奨励及び航海士経験!', 
    ['随着航程越来越远，要在各个海域间航行的时间越来越长，像我们这次前往北海，不知要航行多久，真是头疼啊。'] = '航海が遠く、各海域を航行中の时间が长くなっている间に、私の今度の北海、どれくらい航海、本当に头が痛いよ。', 
